l sitio en [site:name] ha creado una cuenta para usted. Puede ahora iniciar sesión haciendo clic en este enlace o copiando y pegándolo en su navegador:\r\n\r\n[user:one-time-login-url]\r\n\r\nEste enlace solo puede ser usado una vez para iniciar sesión y le conducirá a la página donde podrá establecer su contraseña.\r\n\r\nDespués de establecer su contraseña, será capaz de iniciar sesión en [site:login-url] en el futuro usando:\r\n\r\nNombre de usuario: [user:name]\r\nContraseña: Su contraseña\r\n\r\n--  Equipo de [site:name]\";s:7:\"subject\";s:63:\"Un administrador ha creado una cuenta para usted en [site:name]\";}s:29:\"register_no_approval_required\";a:2:{s:4:\"body\";s:531:\"[user:display-name],\r\n\r\nGracias por registrarse en [site:name]. Puede ahora iniciar sesión haciendo clic en este enlace o copiando y pegandolo en su navegador:\r\n\r\n[user:one-time-login-url]\r\n\r\nEste enlace solo puede ser usado una vez para iniciar sesión y le conducirá a una página donde podrá establecer sus contraseña.\r\n\r\nDespués de establecer su contraseña, será capaz de iniciar sesión en [site:login-url] en el futuro usando:\r\n\r\nNombre de usuario: [user:name]\r\nContraseña: Su contraseña\r\n\r\n--  Equipo de [site:name]\";s:7:\"subject\";s:61:\"Detalles de la cuenta para [user:display-name] en [site:name]\";}s:25:\"register_pending_approval\";a:2:{s:4:\"body\";s:326:\"[user:display-name],\r\n\r\nGracias por registrarse en [site:name]. Su solicitud por una cuenta está en estos momentos pendiente de aprobación. Una vez que haya sido aprobada, recibirá otro correo electrónico con información sobre como iniciar sesión, establecer su contraseña y otros detalles.\r\n\r\n--  Equipo de [site:name]\";s:7:\"subject\";s:106:\"Detalles de cuenta para [user:display-name] en [site:name] (pendiente de aprobación por el administrador)\";}s:31:\"register_pending_approval_admin\";a:2:{s:4:\"body\";s:64:\"[user:display-name] ha solicitado una cuenta.\r\n\r\n[user:edit-url]\";s:7:\"subject\";s:106:\"Detalles de cuenta para [user:display-name] en [site:name] (pendiente de aprobación por el administrador)\";}s:16:\"status_activated\";a:2:{s:4:\"body\";s:545:\"[user:display-name],\r\n\r\nSu cuenta en [site:name] ha sido activada.\r\n\r\nUsted puede ahora iniciar sesión haciendo click en este enlace o copiándolo y pegándolo en su navegador:\r\n\r\n[user:one-time-login-url]\r\n\r\nEste enlace solo puede ser usado una vez para iniciar sesión y lo llevará a usted a una página donde podrá establecer su clave personal.\r\n\r\nDespués de establecer su clave personal, usted podrá iniciar sesión en [site:login-url] utilizando:\r\n\r\nusuario: [user:account-name]\r\nclave personal: Your password\r\n\r\n--  Equipo [site:name]\";s:7:\"subject\";s:69:\"Detalles de cuenta para [user:display-name] en [site:name] (aprobado)\";}s:14:\"status_blocked\";a:2:{s:4:\"body\";s:99:\"[user:display-name],\r\n\r\nSu cuenta en [site:name] ha sido bloqueada.\r\n\r\n--  El equipo de [site:name]\";s:7:\"subject\";s:71:\"Detalles de la cuenta de [user:display-name] en [site:name] (bloqueada)\";}s:15:\"status_canceled\";a:2:{s:4:\"body\";s:99:\"[user:display-name],\r\n\r\nSu cuenta en [site:name] ha sido cancelada.\r\n\r\n--  El equipo de [site:name]\";s:7:\"subject\";s:70:\"Detalles de cuenta para [user:display-name] en [site:name] (cancelado)\";}}'),('language.es','user.role.anonymous',_binary 'a:1:{s:5:\"label\";s:16:\"Usuario anónimo\";}'),('language.es','user.role.authenticated',_binary 'a:1:{s:5:\"label\";s:19:\"Usuario autenticado\";}'),('language.es','user.settings',_binary 'a:1:{s:9:\"anonymous\";s:8:\"Anónimo\";}'),('language.es','views.view.block_content',_binary 'a:1:{s:7:\"display\";a:1:{s:7:\"default\";a:1:{s:15:\"display_options\";a:1:{s:6:\"fields\";a:1:{s:10:\"operations\";a:1:{s:5:\"label\";s:11:\"Operaciones\";}}}}}}');
