ixel\">device-independent pixel</a> size. The Breakpoint module defines multipliers of 1, 1.5, and 2; when defining breakpoints, modules and themes can define which multipliers apply to each breakpoint.','','none'),(6400,_binary 'Defining breakpoints and breakpoint groups','','none'),(6401,_binary 'Modules and themes can use the API provided by the Breakpoint module to define breakpoints and breakpoint groups, and to assign resolution multipliers to breakpoints.','','none'),(6402,_binary 'Comment author name','Validation','none'),(6403,_binary 'Changing the text format to %text_format will permanently remove content that is not allowed in that text format.<br><br>Save your changes before switching the text format to avoid losing data.','','none'),(6404,_binary 'Change text format?','','none'),(6405,_binary 'Managing and displaying entity reference fields','','none'),(6406,_binary 'Selecting reference type','','none'),(6407,_binary 'In the field settings you can select which entity type you want to create a reference to.','','none'),(6408,_binary 'Filtering and sorting reference fields','','none'),(6409,_binary 'Depending on the chosen entity type, additional filtering and sorting options are available for the list of entities that can be referred to, in the field settings. For example, the list of users can be filtered by role and sorted by name or ID.','','none'),(6410,_binary 'Displaying a reference','','none'),(6411,_binary 'An entity reference can be displayed as a simple label with or without a link to the entity. Alternatively, the referenced entity can be displayed as a teaser (or any other available view mode) inside the referencing entity.','','none'),(6412,_binary 'Managing text formats','','none'),(6413,_binary 'Assigning roles to text formats','','none'),(6414,_binary 'Selecting filters','','none'),(6415,_binary 'Each filter can have additional configuration options. For example, for the \"Limit allowed HTML tags\" filter you need to define the list of H