y 'Log in to post new content in the forum.','','none'),(7472,_binary 'Providing page-specific help','','none'),(7473,_binary 'Effect settings','','none'),(7474,_binary 'Allow to alter the language','','none'),(7475,_binary 'Influence of \'@title\'','','none'),(7476,_binary 'Installing supporting modules','','none'),(7477,_binary 'Default indexing settings','','none'),(7478,_binary '<p>Search pages that use an index may use the default index provided by the Search module, or they may use a different indexing mechanism. These settings are for the default index. <em>Changing these settings will cause the default search index to be rebuilt to reflect the new settings. Searching will continue to work, based on the existing index, but new content won\'t be indexed until all existing content has been re-indexed.</em></p><p><em>The default settings should be appropriate for the majority of sites.</em></p>','','none'),(7479,_binary 'The default search index will be rebuilt.','','none'),(7480,_binary 'This will re-index content in the search indexes of all active search pages. Searching will continue to work, but new content won\'t be indexed until all existing content has been re-indexed. This action cannot be undone.','','none'),(7481,_binary 'All search indexes will be rebuilt.','','none'),(7482,_binary 'Add shortcut link','','none'),(7483,_binary 'Popular content block settings','','none'),(7484,_binary 'Number of day\\s top views to display','','none'),(7485,_binary 'Publish status','','none'),(7486,_binary 'Whether or not the content related to a term is published.','','none'),(7487,_binary 'Major upgrade warning','','none'),(7488,_binary 'This update is a major version update which means that it may not be backwards compatible with your currently running version. It is recommended that you read the release notes and proceed at your own risk.','','none'),(7489,_binary 'User data field','','none'),(7490,_binary 'Only users with the selected permission flag will be able to access this display.','','none'),(7491,_binary 'Only the checked roles will be able to access this display.','','none'),(7492,_binary 'The formatted text of the area','','none'),(7493,_binary 'The corresponding entity field','','none'),(7494,_binary 'The plugin ID','','none'),(7495,_binary 'Row options','','none'),(7496,_binary 'Display extender settings','','none'),(7497,_binary 'View block','','none'),(7498,_binary 'Number integer display format settings','','none'),(7499,_binary 'Static menu link overrides','','none'),(7500,_binary 'Entities exist of type %entity_type and %bundle_label %bundle. These entities need to be deleted before importing.','','none'),(7501,_binary 'Feed title','Validation','none'),(7502,_binary 'A feed named %value already exists. Enter a unique title.','','none'),(7503,_binary 'Feed URL','Validation','none'),(7504,_binary 'A feed with this URL %value already exists. Enter a unique URL.','','none'),(7505,_binary 'Disabled','Plural','none'),(7506,_binary 'The language code of the language the comment is written in.','','none'),(7507,_binary 'The message language code.','','none'),(7508,_binary 'The source language from which this translation was created.','','none'),(7509,_binary 'The author of this translation.','','none'),(7510,_binary 'A boolean indicating whether the translation is visible to non-translators.','','none'),(7511,_binary 'The Unix timestamp when the translation was created.','','none'),(7512,_binary 'The Unix timestamp when the translation was most recently saved.','','none'),(7513,_binary 'Alternative text is required.<br />(Only in rare cases should this be left empty. To create empty alternative text, enter <code>\"\"</code> — two double quotes without any content).','','none'),(7514,_binary 'Entities and entity types','','none'),(7515,_binary 'The website\'s content and configuration is managed using <em>entities</em>, which are grouped into <em>entity types</em>. <em>Content entity types</em> are the entity types for site content (such as the main site content, comments, custom blocks, taxonomy terms, and user accounts). <em>Configuration entity types</em> are used to store configuration information for your site, such as individual views in the Views module, and settings for your main site content types.','','none'),(7516,_binary 'Entity sub-types','','none'),(7517,_binary 'Some content entity types are further grouped into sub-types (for example, you could have article and page content types within the main site content entity type, and tag and category vocabularies within the taxonomy term entity type); other entity types, such as user accounts, do not have sub-types. Programmers use the term <em>bundle</em> for entity sub-types.','','none'),(7518,_binary 'Fields and field types','','none'),(7519,_binary 'Content entity types and sub-types store most of their text, file, and other information in <em>fields</em>. Fields are grouped by <em>field type</em>; field types define what type of data can be stored in that field, such as text, images, or taxonomy term references.','','none'),(7520,_binary 'Formatters and view modes','','none'),(7521,_binary 'Content entity types and sub-types can have one or more <em>view modes</em>, used for displaying the entity items. For instance, a content item could be viewed in full content mode on its own page, teaser mode in a list, or RSS mode in a feed. In each view mode, each field can be hidden or displayed, and if it is displayed, you can choose and configure the <em>formatter</em> that is used to display the field. For instance, a long text field can be displayed trimmed or full-length, and taxonomy term reference fields can be displayed in plain text or linked to the taxonomy term page.','','none'),(7522,_binary 'Widgets and form modes','','none'),(7523,_binary 'Content entity types and sub-types can have one or more <em>form modes</em>, used for editing. For instance, a content item could be edited in a compact format with only some fields editable, or a full format that allows all fields to be edited. In each form mode, each field can be hidden or displayed, and if it is displayed, you can choose and configure the <em>widget</em> that is used to edit the field. For instance, a taxonomy term reference field can be edited using a select list, radio buttons, or an autocomplete widget.','','none'),(7524,_binary 'Enabling field types, widgets, and formatters','','none'),(7525,_binary 'Views entity field handler','','none'),(7526,_binary 'Creating a field','','none'),(7527,_binary 'On the <em>Manage fields</em> page for your entity type or sub-type, you can add, configure, and delete fields for that entity type or sub-type. Each field has a <em>machine name</em>, which is used internally to identify the field and must be unique across an entity type; once a field is created, you cannot change the machine name. Most fields have two types of settings. The field-level settings depend on the field type, and affect how the data in the field is stored. Once they are set, they can no longer be changed; examples include how many data values are allowed for the field and where files are stored. The sub-type-level settings are specific to each entity sub-type the field is used on, and they can be changed later; examples include the field label, help text, default value, and whether the field is required or not. You can return to these settings by choosing the <em>Edit</em> link for the field from the <em>Manage fields</em> page.','','none'),(7528,_binary 'Re-using fields','','none'),(7529,_binary 'Once you have created a field, you can use it again in other sub-types of the same entity type. For instance, if you create a field for the article content type, you can also use it for the page content type, but you cannot use it for custom blocks or taxonomy terms. If there are fields available for re-use, after clicking <em>Add field</em> from the <em>Manage fields</em> page, you will see a list of available fields for re-use. After selecting a field for re-use, you can configure the sub-type-level settings.','','none'),(7530,_binary 'Configuring field editing','','none'),(7531,_binary 'On the <em>Manage form display</em> page of your entity type or sub-type, you can configure how the field data is edited by default and in each form mode. If your entity type has multiple form modes (on most sites, most entities do not), you can toggle between the form modes at the top of the page, and you can toggle whether each form mode uses the default settings or custom settings in the <em>Custom display settings</em> section. For each field in each form mode, you can select the widget to use for editing; some widgets have additional configuration options, such as the size for a text field, and these can be edited using the Edit button (which looks like a wheel). You can also change the order of the fields on the form. You can exclude a field from a form by choosing <em>Hidden</em> from the widget drop-down list, or by dragging it into the <em>Disabled</em> section.','','none'),(7532,_binary 'Configuring field display','','none'),(7533,_binary 'On the <em>Manage display</em> page of your entity type or sub-type, you can configure how each field is displayed by default and in each view mode. If your entity type has multiple view modes, you can toggle between the view modes at the top of the page, and you can toggle whether each view mode uses the default settings or custom settings in the <em>Custom display settings</em> section. For each field in each view mode, you can choose whether and how to display the label of the field from the <em>Label</em> drop-down list. You can also select the formatter to use for display; some formatters have configuration options, which you can edit using the Edit button (which looks like a wheel). You can also change the display order of fields. You can exclude a field from a specific view mode by choosing <em>Hidden</em> from the formatter drop-down list, or by dragging it into the <em>Disabled</em> section.','','none'),(7534,_binary 'Configuring view and form modes','','none'),(7535,_binary 'Listing fields','','none'),(7536,_binary 'Images must be exactly <strong>@size</strong> pixels.','','none'),(7537,_binary 'Images must be larger than <strong>@min</strong> pixels. Images larger than <strong>@max</strong> pixels will be resized.','','none'),(7538,_binary 'Images must be larger than <strong>@min</strong> pixels.','','none'),(7539,_binary 'Images larger than <strong>@max</strong> pixels will be resized.','','none'),(7540,_binary 'Forum leaf','Validation','none'),(7541,_binary 'The menu link language code.','','none'),(7542,_binary 'Node authored by (uid)','','none'),(7543,_binary 'Revision authored by (uid)','','none'),(7544,_binary 'Content access view grants','','none'),(7545,_binary 'The location this shortcut points to.','','none'),(7546,_binary 'Unable to install @extension, %config_names already exists in active configuration.Unable to install @extension, %config_names already exist in active configuration.','','none'),(7547,_binary 'No access to execute %action on the @entity_type_label %entity_label.','','none'),(7548,_binary 'narrow','','none'),(7549,_binary 'The reference view %view_name cannot be found.','','none'),(7550,_binary 'Enabled','Plural','none'),(7551,_binary 'Active menu trail','','none'),(7552,_binary 'Configuration updates','','none'),(7553,_binary 'The listed configuration will be updated.','','none'),(7554,_binary 'An entity field containing a password value.','','none'),(7555,_binary 'An autocomplete text field with tagging support.','','none'),(7556,_binary 'The feed %label has been deleted.','','none'),(7557,_binary 'Block Content revision is a history of changes to block content.','','none'),(7558,_binary 'Get the actual block content from a block content revision.','','none'),(7559,_binary 'The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. If you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if you haven\'t changed the colors</em>. This step is required because the module stylesheets in the files directory need to be recreated to reflect your changes.','','none'),(7560,_binary 'Responsive image style %label saved.','','none'),(7561,_binary 'Field, widget, and formatter information','','none'),(7562,_binary 'Provided by modules','','none'),(7563,_binary 'Here is a list of the currently enabled field, formatter, and widget modules:','','none'),(7564,_binary 'Provided by Drupal core','','none'),(7565,_binary 'As mentioned previously, some field types, widgets, and formatters are provided by Drupal core. Here are some notes on how to use some of these:','','none'),(7566,_binary '<strong>Number fields</strong>: When you add a number field you can choose from three types: <em>decimal</em>, <em>float</em>, and <em>integer</em>. The <em>decimal</em> number field type allows users to enter exact decimal values, with fixed numbers of decimal places. The <em>float</em> number field type allows users to enter approximate decimal values. The <em>integer</em> number field type allows users to enter whole numbers, such as years (for example, 2012) or values (for example, 1, 2, 5, 305). It does not allow decimals.','','none'),(7567,_binary 'Defining image styles','','none'),(7568,_binary 'Naming image styles','','none'),(7569,_binary 'When you define an image style, you will need to choose a displayed name and a machine name. The displayed name is shown in administrative pages, and the machine name is used to generate the URL for accessing an image processed in that style. There are two common approaches to naming image styles: either based on the effects being applied (for example, <em>Square 85x85</em>), or based on where you plan to use it (for example, <em>Profile picture</em>).','','none'),(7570,_binary 'Configuring image fields','','none'),(7571,_binary 'A few of the settings for image fields are defined once when you create the field and cannot be changed later; these include the choice of public or private file storage and the number of images that can be stored in the field. The rest of the settings can be edited later; these settings include the field label, help text, allowed file extensions, image resolution restrictions, and the subdirectory in the public or private file storage where the images will be stored. The editable settings can also have different values for different entity sub-types; for instance, if your image field is used on both Page and Article content types, you can store the files in a different subdirectory for the two content types.','','none'),(7572,_binary 'The maximum file size that can be uploaded is limited by PHP settings of the server, but you can restrict it further by configuring a <em>Maximum upload size</em> in the field settings (this setting can be changed later). The maximum file size, either from PHP server settings or field configuration, is automatically displayed to users in the help text of the image field.','','none'),(7573,_binary 'You can also configure a default image that will be used if no image is uploaded in an image field. This default can be defined for all instances of the field in the field storage settings when you create a field, and the setting can be overridden for each entity sub-type that uses the field.','','none'),(7574,_binary 'Configuring displays and form displays','','none'),(7575,_binary 'On the <em>Manage display</em> page, you can choose the image formatter, which determines the image style used to display the image in each display mode and whether or not to display the image as a link. On the <em>Manage form display</em> page, you can configure the image upload widget, including setting the preview image style shown on the entity edit form.','','none'),(7576,_binary 'Selected language configuration','','none'),(7577,_binary 'Selected default language no longer exists.','','none'),(7578,_binary 'Language detection configuration saved.','','none'),(7579,_binary 'Language codes or other custom text to use as a path prefix for URL language detection. For the selected fallback language, this value may be left blank. <strong>Modifying this value may break existing URLs. Use with caution in a production environment.</strong> Example: Specifying \"deutsch\" as the path prefix code for German results in URLs like \"example.com/deutsch/contact\".','','none'),(7580,_binary 'Manually entered paths should start with /, ? or #.','','none'),(7581,_binary 'Start typing the title of a piece of content to select it. You can also enter an internal path such as %add-node or an external URL such as %url. Enter %front to link to the front page.','','none'),(7582,_binary 'Link URI can be accessed by the user.','Validation','none'),(7583,_binary 'The path \'@uri\' is inaccessible.','','none'),(7584,_binary 'The path \'@uri\' is invalid.','','none'),(7585,_binary 'The location this menu link points to.','','none'),(7586,_binary '@title [%language translation]','','none'),(7587,_binary 'The username of the content author.','','none'),(7588,_binary 'Defining responsive image styles','','none'),(7589,_binary 'Using responsive image styles in Image fields','','none'),(7590,_binary 'A responsive image style associates an image style with each breakpoint defined by your theme.','','none'),(7591,_binary 'Responsive image styles','','none'),(7592,_binary 'Edit responsive image style','','none'),(7593,_binary 'Duplicate responsive image style','','none'),(7594,_binary 'Add responsive image style','','none'),(7595,_binary 'Responsive image style','','none'),(7596,_binary 'Image style mappings','','none'),(7597,_binary 'Image style mapping','','none'),(7598,_binary 'Responsive image mapping type','','none'),(7599,_binary 'Sizes attribute','','none'),(7600,_binary 'Image styles to be used when using the \'sizes\' attribute','','non