e for this field. Note that due to rendering order, you cannot use fields that come after this field; if you need a field not listed here, rearrange your fields.','','none'),(7626,_binary '@label (@id)','','none'),(7627,_binary 'Entity reference field storage settings','','none'),(7628,_binary 'Entity reference field settings','','none'),(7629,_binary 'Entity reference selection plugin settings','','none'),(7630,_binary 'Display in native language','','none'),(7631,_binary 'HTTP cookies','','none'),(7632,_binary 'HTTP headers','','none'),(7633,_binary 'Is super user','','none'),(7634,_binary 'Query arguments','','none'),(7635,_binary 'Request format','','none'),(7636,_binary 'Field settings (@on_label / @off_label)','','none'),(7637,_binary '@on_label / @off_label','','none'),(7638,_binary 'Displayed in native language','','none'),(7639,_binary 'Submitted by @username on @datetime','','none'),(7640,_binary 'By @author @time ago','','none'),(7641,_binary 'With multiple languages configured, registered users can select their preferred language and authors can assign a specific language to content.','','none'),(7642,_binary 'This page also provides an overview of how much of the site\'s interface has been translated for each configured language.','','none'),(7643,_binary 'If the Interface Translation module is enabled, this page will provide an overview of how much of the site\'s interface has been translated for each configured language.','','none'),(7644,_binary 'Depending on your site features, additional modules that you might want to enable are:','','none'),(7645,_binary 'This must be an external URL such as %url.','','none'),(7646,_binary 'No dangerous external protocols','Validation','none'),(7647,_binary 'No broken internal links','Validation','none'),(7648,_binary 'Submitted by @author_name on @date','','none'),(7649,_binary 'Search looks for exact, case-insensitive keywords; keywords shorter than a minimum length are ignored.','','none'),(7650,_binary 'Use upper-case OR to get more results. Example: cat OR dog (content contains either \"cat\" or \"dog\").','','none'),(7651,_binary 'You can use upper-case AND to require all words, but this is the same as the default behavior. Example: cat AND dog (same as cat dog, content must contain both \"cat\" and \"dog\").','','none'),(7652,_binary 'Use quotes to search for a phrase. Example: \"the cat eats mice\".','','none'),(7653,_binary 'You can precede keywords by - to exclude them; you must still have at least one \"positive\" keyword. Example: cat -dog (content must contain cat and cannot contain dog).','','none'),(7654,_binary 'The testing framework requires the %sites-simpletest directory to exist and be writable in order to run tests.','','none'),(7655,_binary 'The file %file does not exist and could not be created automatically, which poses a security risk. Ensure that the directory is writable.','','none'),(7656,_binary 'User is admin','','none'),(7657,_binary 'Include the anonymous user in the matched entities.','','none'),(7658,_binary 'Include the anonymous user.','','none'),(7659,_binary 'User search looks for user names and partial user names. Example: mar would match usernames mar, delmar, and maryjane.','','none'),(7660,_binary 'You can use * as a wildcard within your keyword. Example: m*r would match user names mar, delmar, and elementary.','','none'),(7661,_binary 'No eligible views were found.','','none'),(7662,_binary 'The view is not based on a translatable entity type or the site is not multilingual.','','none'),(7663,_binary 'Display \"@display\" uses a \"more\" link but there are no displays it can link to. You need to specify a custom URL.','','none'),(7664,_binary 'Disabling SQL rewriting will omit all query tags, i. e. disable node access checks as well as override hook_query_alter() implementations in other modules.','','none'),(7665,_binary 'Testing config overrides','','none'),(7666,_binary 'Minimal profile for running tests with config overrides in a profile.','','none'),(7667,_binary 'Account\'s permissions','','none'),(7668,_binary 'The hashed password','','none'),(7669,_binary 'Existing password','','none'),(7670,_binary 'Filter output for aggregator items','','none'),(7671,_binary 'Display the author name.','','none'),(7672,_binary 'Are you sure you want to create a new %name @type?','','none'),(7673,_binary 'Using the personal contact form','','none'),(7674,_binary 'Site visitors can email registered users on your site by using the personal contact form, without knowing or learning the email address of the recipient. When a site visitor is viewing a user profile, the viewer will see a <em>Contact</em> tab or link, which leads to the personal contact form. The personal contact link is not shown when you are viewing your own profile, and users must have both <em>View user information</em> (to see user profiles) and <em>Use users\' personal contact forms</em> permission to see the link. The user whose profile is being viewed must also have their personal contact form enabled (this is a user account setting); viewers with <em>Administer users</em> permission can bypass this setting.','','none'),(7675,_binary 'Configuring contact forms','','none'),(7676,_binary 'Linking to contact forms','','none'),(7677,_binary 'Adding content to contact forms','','none'),(7678,_binary '@entity using @field_name','','none'),(7679,_binary 'Relate each @entity with a @field_name set to the @label.','','none'),(7680,_binary 'Configuring form displays','','none'),(7681,_binary 'Reference fields have several widgets available on the <em>Manage form display</em> page:','','none'),(7682,_binary 'The <em>Check boxes/radio buttons</em> widget displays the existing entities for the entity type as check boxes or radio buttons based on the <em>Allowed number of values</em> set for the field.','','none'),(7683,_binary 'The <em>Select list</em> widget displays the existing entities in a drop-down list or scrolling list box based on the <em>Allowed number of values</em> setting for the field.','','none'),(7684,_binary 'The <em>Autocomplete</em> widget displays text fields in which users can type entity labels based on the <em>Allowed number of values</em>. The widget can be configured to display all entities that contain the typed characters or restricted to those starting with those characters.','','none'),(7685,_binary 'The <em>Autocomplete (Tags style)</em> widget displays a multi-text field in which users can type in a comma-separated list of entity labels.','','none'),(7686,_binary 'Your server is not capable of displaying file upload progress. File upload progress requires an Apache server running PHP with mod_php or Nginx with PHP-FPM.','','none'),(7687,_binary 'Your server is not capable of displaying file upload progress. File upload progress requires PHP be run with mod_php or PHP-FPM and not as FastCGI.','','none'),(7688,_binary 'Display download path','','none'),(7689,_binary 'Display the filemime as icon','','none'),(7690,_binary 'Detect tar','','none'),(7691,_binary 'Link this field to the file download URL','','none'),(7692,_binary 'File link','','none'),(7693,_binary 'Include tar in extension','','none'),(7694,_binary 'If the part of the filename just before the extension is \'.tar\', include this in the extension output.','','none'),(7695,_binary 'Display the file download URI','','none'),(7696,_binary 'Display an icon','','none'),(7697,_binary 'The icon is representing the file type, instead of the MIME text (such as \"image/jpeg\")','','none'),(7698,_binary 'Using text fields with text formats','','none'),(7699,_binary 'Text fields that allow text formats are those with \"formatted\" in the description. These are <em>Text (formatted, long, with summary)</em>, <em>Text (formatted)</em>, and <em>Text (formatted, long)</em>. You cannot change the type of field once a field has been created.','','none'),(7700,_binary 'Setting the allowed link type','','none'),(7701,_binary 'In the field settings you can define the allowed link type to be <em>internal links only</em>, <em>external links only</em>, or <em>both internal and external links</em>. <em>Internal links only</em> and <em>both internal and external links</em> options enable an autocomplete widget for internal links, so a user does not have to copy or remember a URL.','','none'),(7702,_binary 'Revisions allow you to track differences between multiple versions of your content, and revert to older versions.','','none'),(7703,_binary '@type %title has been reverted to the revision from %revision-date.','','none'),(7704,_binary 'Speeding up your site','','none'),(7705,_binary 'The Shortcut module creates an add/remove link for each page on your site; the link lets you add or remove the current page from the currently-enabled set of shortcuts (if your theme displays it and you have permission to edit your shortcut set). The core Seven administration theme displays this link next to the page title, as a grey or yellow star. If you click on the grey star, you will add that page to your preferred set of shortcuts. If the page is already part of your shortcut set, the link will be a yellow star, and will allow you to remove the current page from your shortcut set.','','none'),(7706,_binary 'PHP (multiple statement disabling)','','none'),(7707,_binary 'PHP versions higher than 5.6.5 or 5.5.21 provide built-in SQL injection protection for mysql databases. It is recommended to update.','','none'),(7708,_binary 'Site default language code','','none'),(7709,_binary 'Page caching','','none'),(7710,_binary 'Please log in to access this page.','','none'),(7711,_binary 'Allowing users to add new terms gradually builds a vocabulary as content is added and edited. Users can add new terms if either of the two <em>Autocomplete</em> widgets is chosen for the Taxonomy term reference field in the <em>Manage form display</em> page for the field. You will also need to enable the <em>Create referenced entities if they don\'t already exist</em> option, and restrict the field to one vocabulary.','','none'),(7712,_binary 'If you choose <em>Text (plain)</em> or <em>Text (formatted)</em> as the field type on the <em>Manage fields</em> page, then a field with a single row is displayed. You can change the maximum text length in the <em>Field settings</em> when you set up the field.','','none'),(7713,_binary 'If you choose <em>Text (plain, long)</em>, <em>Text (formatted, long)</em>, or <em>Text (formatted, long, with summary)</em> on the <em>Manage fields</em> page, then users can insert text of unlimited length. On the <em>Manage form display</em> page, you can set the number of rows that are displayed to users.','','none'),(7714,_binary 'As an alternative to using a trimmed version of the text, you can enter a separate summary by choosing the <em>Text (formatted, long, with summary)</em> field type on the <em>Manage fields</em> page. Even when <em>Summary input</em> is enabled, and summaries are provided, you can display <em>trimmed</em> text nonetheless by choosing the appropriate format on the <em>Manage display</em> page.','','none'),(7715,_binary 'The Update Manager also allows administrators to update and install modules and themes through the administration interface.','','none'),(7716,_binary 'Performing updates through the Update page','','none'),(7717,_binary 'Installing new modules and themes through the Install page','','none'),(7718,_binary 'Link to the user','','none'),(7719,_binary 'Display the user or author name.','','none'),(7720,_binary 'Password required for protected field change','Validation','none'),(7721,_binary 'Text to use for this variant, @count will be replaced with the value.','','none'),(7722,_binary 'Text to use for the singular form, @count will be replaced with the value.','','none'),(7723,_binary 'Testing multilingual with English','','none'),(7724,_binary 'Contains US ASCII characters only','','none'),(7725,_binary 'Checkout complete! Thank you for your purchase.','','none'),(7726,_binary 'Resolving missing content','','none'),(7727,_binary 'The following @entity-type translations will be deleted:','','none'),(7728,_binary 'Delete @language translation','','none'),(7729,_binary 'The @entity-type %label @language translation has been deleted.','','none'),(7730,_binary 'Are you sure you want to delete the @language translation of the @entity-type %label?','','none'),(7731,_binary 'The core.extension configuration does not exist.','','none'),(7732,_binary 'Unable to install the %module module since it does not exist.','','none'),(7733,_binary 'Unable to uninstall the %module module since the %dependent_module module is installed.','','none'),(7734,_binary 'Unable to install the %theme theme since it does not exist.','','none'),(7735,_binary 'Unable to install the %theme theme since it requires the %required_theme theme.','','none'),(7736,_binary 'Unable to uninstall the %theme theme since the %dependent_theme theme is installed.','','none'),(7737,_binary 'Configuration %name depends on the %owner module that will not be installed after import.','','none'),(7738,_binary 'Configuration %name depends on the %owner theme that will not be installed after import.','','none'),(7739,_binary 'Configuration %name depends on the %owner extension that will not be installed after import.','','none'),(7740,_binary 'Unable to install the %module module since it requires the %required_module module.Unable to install the %module module since it requires the %required_module modules.','','none'),(7741,_binary 'Configuration %name depends on the %module module that will not be installed after import.Configuration %name depends on modules (%module) that will not be installed after import.','','none'),(7742,_binary 'Configuration %name depends on the %theme theme that will not be installed after import.Configuration %name depends on themes (%theme) that will not be installed after import.','','none'),(7743,_binary 'Configuration %name depends on the %config configuration that will not exist after import.Configuration %name depends on configuration (%config) that will not exist after import.','','none'),(7744,_binary 'NotNull','Validation','none'),(7745,_binary 'Null','Validation','none'),(7746,_binary 'Aggregator title','','none'),(7747,_binary 'Formats an aggregator item or feed title with an optional link.','','none'),(7748,_binary 'Empty block library behavior','','none'),(7749,_binary 'Provides a link to add a new block.','','none'),(7750,_binary 'Books have a hierarchical structure, called a <em>book outline</em>. Each book outline can have nested pages up to nine levels deep. Multiple content types can be configured to behave as a book outline. From the content edit form, it is possible to add a page to a book outline or create a new book.','','none'),(7751,_binary 'Configuring content types for books','','none'),(7752,_binary 'Content type for the <em>Add child page</em> link','','none'),(7753,_binary 'The configuration cannot be imported because it failed validation for the following reasons:','','none'),(7754,_binary 'Link to translate @entity_type_label','','none'),(7755,_binary 'Provide a translation link to the @entity_type_label.','','none'),(7756,_binary 'The Forum module lets you create threaded discussion forums with functionality similar to other message board systems. In a forum, users post topics and threads in nested hierarchies, allowing discussions to be categorized and grouped.','','none'),(7757,_binary 'A forum is represented by a hierarchical structure, consisting of:','','none'),(7758,_binary '<em>Forums</em> (for example, <em>Recipes for cooking vegetables</em>)','','none'),(7759,_binary '<em>Forum topics</em> submitted by users (for example, <em>How to cook potatoes</em>), which start discussions.','','none'),(7760,_binary 'Threaded <em>comments</em> submitted by users (for example, <em>You wash the potatoes first and then...</em>).','','none'),(7761,_binary 'Optional <em>containers</em>, used to group similar forums. Forums can be placed inside containers, and vice versa.','','none'),(7762,_binary 'Setting up the forum structure','','none'),(7763,_binary 'Navigating in the forum','','none'),(7764,_binary 'The domain for %language may only contain the domain name, not a trailing slash, protocol and/or port.','','none'),(7765,_binary '@language translation of the @type %label has been deleted.','','none'),(7766,_binary 'always_populate_raw_post_data PHP setting','','none'),(7767,_binary 'Not set to -1.','','none'),(7768,_binary 'Domain of the relation','','none'),(7769,_binary 'Xdebug settings','','none'),(7770,_binary 'xdebug.max_nesting_level is set to %value.','','none'),(7771,_binary 'Set <code>xdebug.max_nesting_level=@level</code> in your PHP configuration as some pages in your Drupal site will not work when this setting is too low.','','none'),(7772,_binary 'For more detailed information, see the <a href=\"https://www.drupal.org/upgrade\">upgrading handbook</a>. If you are unsure what these terms mean you should probably contact your hosting provider.','','none'),(7773,_binary 'Trimmed limit','','none'),(7774,_binary 'If the summary is not set, the trimmed %label field will end at the last full sentence before this character limit.','','none'),(7775,_binary 'Trimmed limit: @trim_length characters','','none'),(7776,_binary '%name is blocked or has not been activated yet.','','none'),(7777,_binary 'Working with multilingual views','','none'),(7778,_binary 'If your site has multiple languages and translated entities, each result row in a view will contain one translation of each involved entity (a view can involve multiple entities if it uses relationships). You can use a filter to restrict your view to one language: without filtering, if an entity has three translations it will add three rows to the results; if you filter by language, at most one result will appear (it could be zero if that particular entity does not have a translation matching your language filter choice). If a view uses relationships, each entity in the relationship needs to be filtered separately. You can filter a view to a fixed language choice, such as English or Spanish, or to the language selected by the page the view is displayed on (the language that is selected for the page by the language detection settings either for Content or User interface).','','none'),(7779,_binary 'Because each result row contains a specific translation of each entity, field-level filters are also relative to these entity translations. For example, if your view has a filter that specifies that the entity title should contain a particular English word, you will presumably filter out all rows containing Chinese translations, since they will not contain the English word. If your view also has a second filter specifying that the title should contain a particular Chinese word, and if you are using \"And\" logic for filtering, you will presumably end up with no results in the view, because there are probably not any entity translations containing both the English and Chinese words in the title.','','none'),(7780,_binary 'Independent of filtering, you can choose the display language (the language used to display the entities and their fields) via a setting on the display. Your language choices are the same as the filter language choices, with an additional choice of \"Content language of view row\" and \"Original language of content in view row\", which means to display each entity in the result row using the language that entity has or in which it was originally created. In theory, this would give you the flexibility to filter to French translations, for instance, and then display the results in Spanish. The more usual choices would be to use the same language choices for the display language and each entity filter in the view, or to use the Row language setting for the display.','','none'),(7781,_binary 'Entity link','','none'),(7782,_b