ef=\":server_url\">@server_url</a>.','','none'),(7941,_binary 'The %language translation file is not available at the translation server. <a href=\":url\">Choose a different language</a> or select English and translate your website later.','','none'),(7942,_binary 'The %language translation file could not be downloaded. <a href=\":url\">Choose a different language</a> or select English and translate your website later.','','none'),(7943,_binary 'The @drupal installer requires that you create a %file as part of the installation process. Copy the %default_file file to %file. More details about installing Drupal are available in <a href=\":install_txt\">INSTALL.txt</a>.','','none'),(7944,_binary '@drupal requires read permissions to %file at all times. The <a href=\":handbook_url\">webhosting issues</a> documentation section offers help on this and other topics.','','none'),(7945,_binary 'The @drupal installer requires write permissions to %file during the installation process. The <a href=\":handbook_url\">webhosting issues</a> documentation section offers help on this and other topics.','','none'),(7946,_binary 'The @drupal installer failed to create a %file file with proper file ownership. Log on to your web server, remove the existing %file file, and create a new one by copying the %default_file file to %file. More details about installing Drupal are available in <a href=\":install_txt\">INSTALL.txt</a>. The <a href=\":handbook_url\">webhosting issues</a> documentation section offers help on this and other topics.','','none'),(7947,_binary 'Check the messages and <a href=\":retry\">retry</a>, or you may choose to <a href=\":cont\">continue anyway</a>.','','none'),(7948,_binary 'Check the messages and <a href=\":url\">try again</a>.','','none'),(7949,_binary 'The following modules are required but were not found. Move them into the appropriate modules subdirectory, such as <em>/modules</em>. Missing modules: @modules','','none'),(7950,_binary 'Updating @module','','none'),(7951,_binary 'Post updating @module','','none'),(7952,_binary 'Entity type mismatch on rename. @old_type not equal to @new_type for existing configuration @old_name and staged configuration @new_name.','','none'),(7953,_binary 'Rename operation for simple configuration. Existing configuration @old_name and staged configuration @new_name.','','none'),(7954,_binary 'Your MySQL server and PHP MySQL driver must support utf8mb4 character encoding. Make sure to use a database system that supports this (such as MySQL/MariaDB/Percona 5.5.3 and up), and that the utf8mb4 character set is compiled in. See the <a href=\":documentation\" target=\"_blank\">MySQL documentation</a> for more information.','','none'),(7955,_binary 'The %driver database must use %encoding encoding to work with Drupal. Recreate the database with %encoding encoding. See <a href=\"INSTALL.pgsql.txt\">INSTALL.pgsql.txt</a> for more details.','','none'),(7956,_binary 'The %setting setting is currently set to \'%current_value\', but needs to be \'%needed_value\'. Change this by running the following query: <code>@query</code>','','none'),(7957,_binary 'Date (e.g. @format)','','none'),(7958,_binary 'Time (e.g. @format)','','none'),(7959,_binary '@uri','','none'),(7960,_binary 'Operating in maintenance mode. <a href=\":url\">Go online.</a>','','none'),(7961,_binary 'Textfield size: @size','','none'),(7962,_binary 'Number of rows: @rows','','none'),(7963,_binary 'URI field size: @size','','none'),(7964,_binary 'WARNING: You are not using an encrypted connection, so your password will be sent in plain text. <a href=\":https-link\">Learn more</a>.','','none'),(7965,_binary 'Failed to connect to the server. The server reports the following message: <p class=\"error\">@message</p> For more help installing or updating code on your server, see the <a href=\":handbook_url\">handbook</a>.','','none'),(7966,_binary '@name cannot be longer than %max characters but is currently %length characters long.','','none'),(7967,_binary '<ul>\n<li>To start over, you must empty your existing database and copy <em>default.settings.php</em> over <em>settings.php</em>.</li>\n<li>To upgrade an existing installation, proceed to the <a href=\":update-url\">update script</a>.</li>\n<li>View your <a href=\":base-url\">existing site</a>.</li>\n</ul>','','none'),(7968,_binary 'All necessary changes to %dir and %file have been made, so you should remove write permissions to them now in order to avoid security risks. If you are unsure how to do so, consult the <a href=\":handbook_url\">online handbook</a>.','','none'),(7969,_binary 'The system will notify you when updates and important security releases are available for installed components. Anonymous information about your site is sent to <a href=\":drupal\">Drupal.org</a>.','','none'),(7970,_binary 'File Transfer failed, reason: @reason','','none'),(7971,_binary 'Unique field constraint','Validation','none'),(7972,_binary 'A @entity_type with @field_name %value already exists.','','none'),(7973,_binary 'The Actions module provides tasks that can be executed by the site such as unpublishing content, sending email messages, or blocking a user. Other modules can trigger these actions when specific system events happen; for example, when new content is posted or when a user logs in. Modules can also provide additional actions. For more information, see the <a href=\":documentation\">online documentation for the Actions module</a>.','','none'),(7974,_binary '<em>Simple actions</em> do not require configuration and are listed automatically as available on the <a href=\":actions\">Actions page</a>.','','none'),(7975,_binary '<em>Advanced actions</em> are user-created and have to be configured individually. Create an advanced action on the <a href=\":actions\">Actions page</a> by selecting an action type from the drop-down list. Then configure your action, for example by specifying the recipient of an automated email message.','','none'),(7976,_binary 'The message that should be sent. You may include placeholders like [node:title], [user:account-name], [user:display-name] and [comment:body] to represent data that will be different each time message is sent. Not all placeholders will be available in all contexts.','','none'),(7977,_binary 'The message to be displayed to the current user. You may include placeholders like [node:title], [user:account-name], [user:display-name] and [comment:body] to represent data that will be different each time message is sent. Not all placeholders will be available in all contexts.','','none'),(7978,_binary 'The Aggregator module is an on-site syndicator and news reader that gathers and displays fresh content from RSS-, RDF-, and Atom-based feeds made available across the web. Thousands of sites (particularly news sites and blogs) publish their latest headlines in feeds, using a number of standardized XML-based formats. For more information, see the <a href=\":aggregator-module\">online documentation for the Aggregator module</a>.','','none'),(7979,_binary 'Users view feed content in the <a href=\":aggregator\">main aggregator display</a>, or by <a href=\":aggregator-sources\">their source</a> (usually via an RSS feed reader). The most recent content in a feed can be displayed as a block through the <a href=\":admin-block\">Blocks administration page</a>.','','none'),(7980,_binary 'Configuring the display of feed items','','none'),(7981,_binary 'Discarding old feed items','','none'),(7982,_binary 'A <a href=\":aggregator-opml\">machine-readable OPML file</a> of all feeds is available. OPML is an XML-based file format used to share outline-structured information such as a list of RSS feeds. Feeds can also be <a href=\":import-opml\">imported via an OPML file</a>.','','none'),(7983,_binary 'A working <a href=\":cron\">cron maintenance task</a> is required to update feeds automatically.','','none'),(7984,_binary 'Current feeds are listed below, and <a href=\":addfeed\">new feeds may be added</a>. For each feed, the <em>latest items</em> block may be enabled at the <a href=\":block\">blocks administration page</a>.','','none'),(7985,_binary '@title feed','','none'),(7986,_binary 'No feeds available. <a href=\":link\">Add feed</a>.','','none'),(7987,_binary 'The parent website\'s description that comes from the @description element in the feed.','','none'),(7988,_binary 'The length of time between feed updates. Requires a correctly configured <a href=\":cron\">cron maintenance task</a>.','','none'),(7989,_binary 'Requires a correctly configured <a href=\":cron\">cron maintenance task</a>.','','none'),(7990,_binary 'The Ban module allows administrators to ban visits to their site from individual IP addresses. For more information, see the <a href=\":url\">online documentation for the Ban module</a>.','','none'),(7991,_binary 'Administrators can enter IP addresses to ban on the <a href=\":bans\">IP address bans</a> page.','','none'),(7992,_binary 'The HTTP Basic Authentication module supplies an <a href=\"http://en.wikipedia.org/wiki/Basic_access_authentication\">HTTP Basic authentication</a> provider for web service requests. This authentication provider authenticates requests using the HTTP Basic Authentication username and password, as an alternative to using Drupal\'s standard cookie-based authentication system. It is only useful if your site provides web services configured to use this type of authentication (for instance, the <a href=\":rest_help\">RESTful Web Services module</a>). For more information, see the <a href=\":hba_do\">online documentation for the HTTP Basic Authentication module</a>.','','none'),(7993,_binary 'The Block module allows you to place blocks in regions of your installed themes, and configure block settings. For more information, see the <a href=\":blocks-documentation\">online documentation for the Block module</a>.','','none'),(7994,_binary 'You can see where the regions are for the current theme by clicking the <em>Demonstrate block regions</em> link on the <a href=\":blocks\">Block layout page</a>. Regions are specific to each theme.','','none'),(7995,_binary 'To change the settings of an individual block click on the <em>Configure</em> link on the <a href=\":blocks\">Block layout page</a>. The available options vary depending on the module that provides the block. For all blocks you can change the block title and toggle whether to display it.','','none'),(7996,_binary 'You can add custom blocks, if the <em>Custom Block</em> module is installed. For more information, see the <a href=\":blockcontent-help\">Custom Block help page</a>.','','none'),(7997,_binary 'Block settings updated.','','none'),(7998,_binary 'Edit %label custom block type','','none'),(7999,_binary 'Block with uuid %uuid does not exist. <a href=\":url\">Add custom block</a>.','','none'),(8000,_binary 'Add a <a href=\":url\">custom block</a>.','','none'),(8001,_binary 'The Book module is used for creating structured, multi-page content, such as site resource guides, manuals, and wikis. It allows you to create content that has chapters, sections, subsections, or any similarly-tiered structure. Enabling the module creates a new content type <em>Book page</em>. For more information, see the <a href=\":book\">online documentation for the Book module</a>.','','none'),(8002,_binary 'You can assign separate permissions for <em>creating new books</em> as well as <em>creating</em>, <em>editing</em> and <em>deleting</em> book content. Users with the <em>Administer book outlines</em> permission can add <em>any</em> type of content to a book by selecting the appropriate book outline while editing the content. They can also view a list of all books, and edit and rearrange section titles on the <a href=\":admin-book\">Book list page</a>.','','none'),(8003,_binary 'The <em>Book page</em> content type is the initial content type enabled for book outlines. On the <a href=\":admin-settings\">Book settings page</a> you can configure content types that can used in book outlines.','','none'),(8004,_binary 'Users with the <em>Add content and child pages to books</em> permission will see a link to <em>Add child page</em> when viewing a content item that is part of a book outline. This link will allow users to create a new content item of the content type you select on the <a href=\":admin-settings\">Book settings page</a>. By default this is the <em>Book page</em> content type.','','none'),(8005,_binary 'Book pages have a default book-specific navigation block. This navigation block contains links that lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. This block can be enabled on the <a href=\':admin-block\'>Blocks layout page</a>. For book pages to show up in the book navigation, they must be added to a book outline.','','none'),(8006,_binary 'The outline feature allows you to include pages in the <a href=\":book\">Book hierarchy</a>, as well as move them within the hierarchy or to <a href=\":book-admin\">reorder an entire book</a>.','','none'),(8007,_binary 'The parent page in the book. The maximum depth for a book and all child pages is @maxdepth. Some pages in the selected book may not be available as parents if selecting them would exceed this limit.','','none'),(8008,_binary 'The Breakpoint module keeps track of the height, width, and resolution breakpoints where a responsive design needs to change in order to respond to different devices being used to view the site. This module does not have a user interface. For more information, see the <a href=\":docs\">online documentation for the Breakpoint module</a>.','','none'),(8009,_binary '<a href=\":w3\">Media  queries</a> are a formal way to encode breakpoints. For instance, a width breakpoint at 40em would be written as the media query \"(min-width: 40em)\". Breakpoints are really just media queries with some additional meta-data, such as a name and multiplier information.','','none'),(8010,_binary 'The CKEditor module provides a highly-accessible, highly-usable visual text editor and adds a toolbar to text fields. Users can use buttons to format content and to create semantically correct and valid HTML. The CKEditor module uses the framework provided by the <a href=\":text_editor\">Text Editor module</a>. It requires JavaScript to be enabled in the browser. For more information, see the <a href=\":doc_url\">online documentation for the CKEditor module</a> and the <a href=\":cke_url\">CKEditor website</a>.','','none'),(8011,_binary 'CKEditor has to be enabled and configured separately for individual text formats from the <a href=\":formats\">Text formats and editors page</a> because the filter settings for each text format can be different. For more information, see the <a href=\":text_editor\">Text Editor help page</a> and <a href=\":filter\">Filter help page</a>.','','none'),(8012,_binary 'CKEditor only allow users to format content in accordance with the filter configuration of the specific text format. If a text format excludes certain HTML tags, the corresponding toolbar buttons are not displayed to users when they edit a text field in this format. For more information see the <a href=\":filter\">Filter help page</a>.','','none'),(8013,_binary 'The built in WYSIWYG editor (CKEditor) comes with a number of <a href=\":features\">accessibility features</a>. CKEditor comes with built in <a href=\":shortcuts\">keyboard shortcuts</a>, which can be beneficial for both power users and keyboard only users.','','none'),(8014,_binary 'The Color module allows users with the <em>Administer site configuration</em> permission to change the color scheme (color of links, backgrounds, text, and other theme elements) of compatible themes. For more information, see the <a href=\":color_do\">online documentation for the Color module</a>.','','none'),(8015,_binary 'To change the color settings, select the <em>Settings</em> link for your theme on the <a href=\":appearance\">Appearance</a> page. If the color picker does not appear then the theme is not compatible with the Color module.','','none'),(8016,_binary 'The Comment module allows users to comment on site content, set commenting defaults and permissions, and moderate comments. For more information, see the <a href=\":comment\">online documentation for the Comment module</a>.','','none'),(8017,_binary 'Enabling commenting','','none'),(8018,_binary 'Comment functionality can be enabled for any entity sub-type (for example, a <a href=\":content-type\">content type</a>) by adding a <em>Comments</em> field on its <em>Manage fields page</em>. Adding or removing commenting for an entity through the user interface requires the <a href=\":field_ui\">Field UI</a> module to be enabled, even though the commenting functionality works without it. For more information on fields and entities, see the <a href=\":field\">Field module help page</a>.','','none'),(8019,_binary 'Configuring commenting settings','','none'),(8020,_binary 'Commenting settings can be configured by editing the <em>Comments</em> field on the <em>Manage fields page</em> of an entity type if the <em>Field UI module</em> is enabled. Configuration includes the label of the comments field, the number of comments to be displayed, and whether they are shown in threaded list. Commenting can be be configured as: <em>Open</em> to allow new comments, <em>Closed</em> to view existing comments, but prevent new comments, or <em>Hidden</em> to hide existing comments and prevent new comments. Changing this configuration for an entity type will not change existing entity items.','','none'),(8021,_binary 'Users with the appropriate permissions can override the default commenting settings of an entity type when they create an item of that type.','','none'),(8022,_binary 'Comments from users who have the <em>Skip comment approval</em> permission are published immediately. All other comments are placed in the <a href=\":comment-approval\">Unapproved comments</a> queue, until a user who has permission to <em>Administer comments and comment settings</em> publishes or deletes them. Published comments can be bulk managed on the <a href=\":admin-comment\">Published comments</a> administration page. When a comment has no replies, it remains editable by its author, as long as the author has <em>Edit own comments</em> permission.','','none'),(8023,_binary 'In reply to @parent_title by @parent_username','','none'),(8024,_binary 'Name for @anonymous','','none'),(8025,_binary '<a href=\":login\">Log in</a> or <a href=\":register\">register</a> to post comments','','none'),(8026,_binary '<a href=\":login\">Log in</a> to post comments','','none'),(8027,_binary 'Select the Comment type to use for this comment field. Manage the comment types from the <a href=\":url\">administration overview page</a>.','','none'),(8028,_binary 'The Configuration Manager module provides a user interface for importing and exporting configuration changes between installations of your website in different environments. Configuration is stored in YAML format. For more information, see the <a href=\":url\">online documentation for the Configuration Manager module</a>.','','none'),(8029,_binary 'You can create and download an archive consisting of all your site\'s configuration exported as <em>*.yml</em> files on the <a href=\":url\">Export</a> page.','','none'),(8030,_binary 'You can upload a full site configuration from an archive file on the <a href=\":url\">Import</a> page. When importing data from a different environment, the site and import files must have matching configuration values for UUID in the <em>system.site</em> configuration item. That means that your other environments should initially be set up as clones of the target site. Migrations are not supported.','','none'),(8031,_binary 'You can review differences between the active configuration and an imported configuration archive on the <a href=\":synchronize\">Synchronize</a> page to ensure that the changes are as expected, before finalizing the import. The Synchronize page also shows configuration items that would be added or removed.','','none'),(8032,_binary 'You can export a single configuration item by selecting a <em>Configuration type</em> and <em>Configuration name</em> on the <a href=\":single-export\">Single export</a> page. The configuration and its corresponding <em>*.yml file name</em> are then displayed on the page for you to copy.','','none'),(8033,_binary 'You can import a single configuration item by pasting it in YAML format into the form on the <a href=\":single-import\">Single import</a> page.','','none'),(8034,_binary 'Export and download the full configuration of this site as a gzipped tar file.','','none'),(8035,_binary 'Choose a configuration item to display its YAML structure.','','none'),(8036,_binary 'Import a single configuration item by pasting its YAML structure into the text field.','','none'),(8037,_binary 'Full archive','','none'),(8038,_binary 'Single item','','none'),(8039,_binary 'Staged','','none'),(8040,_binary 'The following items in your active configuration have changes since the last import that may be lost on the next import.','','none'),(8041,_binary '@collection configuration collection','','none'),(8042,_binary '@source_name to @target_name','','none'),(8043,_binary 'The Configuration Translation module allows you to translate configuration text; for example, the site name, vocabularies, menus, or date formats. Together with the modules <a href=\":language\">Language</a>, <a href=\":content-translation\">Content Translation</a>, and <a href=\":locale\">Interface Translation</a>, it allows you to build multilingual websites. For more information, see the <a href=\":doc_url\">online documentation for the Configuration Translation module</a>.','','none'),(8044,_binary 'In order to translate configuration, the website must have at least two <a href=\":url\">languages</a>.','','none'),(8045,_binary 'Users with the <em>Translate user edited configuration</em> permission can access the configuration translation overview, and manage translations for specific languages. The <a href=\":translation-page\">Configuration translation</a> page shows a list of all configuration text that can be translated, either as individual items or as lists. After you click on <em>Translate</em>, you are provided with a list of all languages. You can <em>add</em> or <em>edit</em> a translation for a specific language. Users with specific configuration permissions can also <em>edit</em> the text for the site\'s default language. For some configuration text items (for example for the site information), the specific translation pages can also be accessed directly from their configuration pages.','','none'),(8046,_binary 'You can choose to translate date formats on the <a href=\":translation-page\">Configuration translation</a> page. This allows you not only to translate the label text, but also to set a language-specific <em>PHP date format</em>.','','none'),(8047,_binary '@label <span class=\"visually-hidden\">(@source_language)</span>','','none'),(8048,_binary 'The Contact module allows visitors to contact registered users on your site, using the personal contact form, and also allows you to set up site-wide contact forms. For more information, see the <a href=\":contact\">online documentation for the Contact module</a>.','','none'),(8049,_binary 'On the <a href=\":contact_admin\">Contact forms page</a>, you can configure the fields and display of the personal contact form, and you can set up one or more site-wide contact forms. Each site-wide contact form has a machine name, a label, and one or more defined recipients; when a site visitor submits the form, the field values are sent to those recipients.','','none'),(8050,_binary 'One site-wide contact form can be designated as the default contact form. If you choose to designate a default form, the <em>Contact</em> menu link in the <em>Footer</em> menu will link to it. You can modify this link from the <a href=\":menu-settings\">Menus page</a> if you have the Menu UI module installed. You can also create links to other contact forms; the URL for each form you have set up has format <em>contact/machine_name_of_form</em>.','','none'),(8051,_binary 'From the <a href=\":contact_admin\">Contact forms page</a>, you can configure the fields to be shown on contact forms, including their labels and help text. If you would like other content (such as text or images) to appear on a contact form, use a block. You can create and edit blocks on the <a href=\":blocks\">Block layout page</a>, if the Block module is installed.','','none'),(8052,_binary '[@form] @subject','','none'),(8053,_binary '@sender-name (@sender-url) sent a message using the contact form at @form-url.','','none'),(8054,_binary '[@site-name] @subject','','none'),(8055,_binary 'Hello @recipient-name,','','none'),(8056,_binary '@sender-name (@sender-url) has sent you a message via your contact form at @site-name.','','none'),(8057,_binary 'If you don\'t want to receive such emails, you can change your settings at @recipient-edit-url.','','none'),(8058,_binary '@name (not verified)','','none'),(8059,_binary 'The contact form has not been configured. <a href=\":add\">Add one or more forms</a> .','','none'),(8060,_binary 'The Content Translation module allows you to translate content, comments, custom blocks, taxonomy terms, users and other <a href=\":field_help\" title=\"Field module help, with background on content entities\">content entities</a>. Together with the modules <a href=\":language\">Language</a>, <a href=\":config-trans\">Configuration Translation</a>, and <a href=\":locale\">Interface Translation</a>, it allows you to build multilingual websites. For more information, see the <a href=\":translation-entity\">online documentation for the Content Translation module</a>.','','none'),(8061,_binary 'In order to translate content, the website must have at least two <a href=\":url\">languages</a>. When that is the case, you can enable translation for the desired content entities on the <a href=\":translation-entity\">Content language</a> page. When enabling translation you can choose the default language for content and decide whether to show the language selection field on the content editing forms.','','none'),(8062,_binary 'Before you can translate content, there must be at least two languages added on the <a href=\":url\">languages administration</a> page.','','none'),(8063,_binary 'To configure translation for this field, <a href=\":language-settings-url\">enable language support</a> for this type.','','none'),(8064,_binary '<a href=\":settings_url\">Enable translation</a> for <em>content types</em>, <em>taxonomy vocabularies</em>, <em>accounts</em>, or any other element you wish to translate.','','none'),(8065,_binary 'The Contextual links module gives users with the <em>Use contextual links</em> permission quick access to tasks associated with certain areas of pages on your site. For example, a menu displayed as a block has links to edit the menu and configure the block. For more information, see the <a href=\":contextual\">online documentation for the Contextual Links module</a>.','','none'),(8066,_binary 'Hovering over the area of interest will temporarily make the contextual links button visible (which looks like a pencil in most themes, and is normally displayed in the upper right corner of the area). The icon typically looks like this: @picture','','none'),(8067,_binary 'If you have the <a href=\":toolbar\">Toolbar module</a> enabled, clicking the contextual links button in the toolbar (which looks like a pencil) will make all contextual links buttons on the page visible. Clicking this button again will toggle them to invisible.','','none'),(8068,_binary 'The Datetime module provides a Date field that stores dates and times. It also provides the Form API elements <em>datetime</em> and <em>datelist</em> for use in programming modules. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI module help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":datetime_do\">online documentation for the Datetime module</a>.','','none'),(8069,_binary 'The <em>settings</em> and the <em>display</em> of the Date field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(8070,_binary 'Dates can be displayed using the <em>Plain</em> or the <em>Default</em> formatter. The <em>Plain</em> formatter displays the date in the <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601</a> format. If you choose the <em>Default</em> formatter, you can choose a format from a predefined list that can be managed on the <a href=\":date_format_list\">Date and time formats</a> page.','','none'),(8071,_binary 'Date part order: @order','','none'),(8072,_binary 'Time type: @time_type','','none'),(8073,_binary 'Time increments: @increment','','none'),(8074,_binary 'The Database Logging module logs system events in the Drupal database. For more information, see the <a href=\":dblog\">online documentation for the Database Logging module</a>.','','none'),(8075,_binary 'The Database Logging module allows you to view an event log on the <a href=\":dblog\">Recent log messages</a> page. The log is a chronological list of recorded events containing usage data, performance data, errors, warnings and operational information. Administrators should check the log on a regular basis to ensure their site is working properly.','','none'),(8076,_binary 'In case of errors or problems with the site, the <a href=\":dblog\">Recent log messages</a> page can be useful for debugging, since it shows the sequence of events. The log messages include usage information, warnings, and errors.','','none'),(8077,_binary 'The maximum number of messages to keep in the database log. Requires a <a href=\":cron\">cron maintenance task</a>.','','none'),(8078,_binary 'Pages which are suitable for caching are cached the first time they are requested, then the cached version is served for all later requests. Dynamic content is handled automatically so that both cache correctness and hit ratio is maintained.','','none'),(8079,_binary 'Internal Dynamic Page Cache','','none'),(8080,_binary 'The Text Editor module provides a framework that other modules (such as <a href=\":ckeditor\">CKEditor module</a>) can use to provide toolbars and other functionality that allow users to format text more easily than typing HTML tags directly. For more information, see the <a href=\":documentation\">online documentation for the Text Editor module</a>.','','none'),(8081,_binary 'The Text Editor module provides a framework for managing editors. To use it, you also need to enable a text editor. This can either be the core <a href=\":ckeditor\">CKEditor module</a>, which can be enabled on the <a href=\":extend\">Extend page</a>, or a contributed module for any other text editor. When installing a contributed text editor module, be sure to check the installation instructions, because you will most likely need to download and install an external library as well as the Drupal module.','','none'),(8082,_binary 'On the <a href=\":formats\">Text formats and editors page</a> you can see which text editor is associated with each text format. You can change this by clicking on the <em>Configure</em> link, and then choosing a text editor or <em>none</em> from the <em>Text editor</em> drop-down list. The text editor will then be displayed with any text field for which this text format is chosen.','','none'),(8083,_binary 'The <em>settings</em> and the <em>display</em> of the entity reference field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(8084,_binary 'No eligible views were found. <a href=\":create\">Create a view</a> with an <em>Entity Reference</em> display, or add such a display to an <a href=\":existing\">existing view</a>.','','none'),(8085,_binary 'The Field module allows custom data fields to be defined for <em>entity</em> types (see below). The Field module takes care of storing, loading, editing, and rendering field data. Most users will not interact with the Field module directly, but will instead use the <a href=\":field-ui-help\">Field UI module</a> user interface. Module developers can use the Field API to make new entity types \"fieldable\" and thus allow fields to be attached to them. For more information, see the <a href=\":field\">online documentation for the Field module</a>.','','none'),(8086,_binary 'The Field module provides the infrastructure for fields; the field types, formatters, and widgets are provided by Drupal core or additional modules. Some of the modules are required; the optional modules can be enabled from the <a href=\":modules\">Extend administration page</a>. Additional fields, formatters, and widgets may be provided by contributed modules, which you can find in the <a href=\":contrib\">contributed module section of Drupal.org</a>.','','none'),(8087,_binary 'The Field UI module provides an administrative user interface (UI) for managing and displaying fields. Fields can be attached to most content entity sub-types. Different field types, widgets, and formatters are provided by the modules enabled on your site, and managed by the Field module. For background information and terminology related to fields and entities, see the <a href=\":field\">Field module help page</a>. For more information about the Field UI, see the <a href=\":field_ui_docs\">online documentation for the Field UI module</a>.','','none'),(8088,_binary 'You can add, edit, and delete view modes for entities on the <a href=\":view_modes\">View modes page</a>, and you can add, edit, and delete form modes for entities on the <a href=\":form_modes\">Form modes page</a>. Once you have defined a view mode or form mode for an entity type, it will be available on the Manage display or Manage form display page for each sub-type of that entity.','','none'),(8089,_binary 'There are two reports available that list the fields defined on your site. The <a href=\":entity-list\" title=\"Entities field list report\">Entities</a> report lists all your fields, showing the field machine names, types, and the entity types or sub-types they are used on (each sub-type links to the Manage fields page). If the <a href=\":views\">Views</a> and <a href=\":views-ui\">Views UI</a> modules are enabled, the <a href=\":views-list\" title=\"Used in views field list report\">Used in views</a> report lists each field that is used in a view, with a link to edit that view.','','none'),(8090,_binary 'There are no fields yet added. You can add new fields on the <a href=\":link\">Manage fields</a> page.','','none'),(8091,_binary 'The %display_mode mode now uses custom display settings. You might want to <a href=\":url\">configure them</a>.','','none'),(8092,_binary 'file from @field_name','','none'),(8093,_binary 'The File module allows you to create fields that contain files. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":file_documentation\">online documentation for the File module</a>.','','none'),(8094,_binary 'The <em>settings</em> and the <em>display</em> of the file field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(8095,_binary 'Uploaded files can either be stored as <em>public</em> or <em>private</em>, depending on the <a href=\":file-system\">File system settings</a>. For more information, see the <a href=\":system-help\">System module help page</a>.','','none'),(8096,_binary 'The file used in the @name field may not be referenced.','','none'),(8097,_binary 'The file referenced by the @name field does not exist.','','none'),(8098,_binary 'You can create and edit text formats on the <a href=\":formats\">Text formats page</a> (if the Text Editor module is enabled, this page is named Text formats and editors). One text format is included by default: Plain text (which removes all HTML tags). Additional text formats may be created during installation. You can create a text format by clicking \"<a href=\":add_format\">Add text format</a>\".','','none'),(8099,_binary 'For more information see W3C\'s <a href=\":html-specifications\">HTML Specifications</a> or use your favorite search engine to find other sites that explain HTML.','','none'),(8100,_binary 'If you do encounter problems, try using HTML character entities. A common example looks like &amp;amp; for an ampersand &amp; character. For a full list of entities see HTML\'s <a href=\":html-entities\">entities</a> page. Some of the available characters include:','','none'),(8101,_binary 'Limit allowed HTML tags and correct faulty HTML','','none'),(8102,_binary 'The Forum module adds and uses a content type called <em>Forum topic</em>. For background information on content types, see the <a href=\":node_help\">Node module help page</a>.','','none'),(8103,_binary 'For more information, see the <a href=\":forum\">online documentation for the Forum module</a>.','','none'),(8104,_binary 'Visit the <a href=\":forums\">Forums page</a> to set up containers and forums to hold your discussion topics.','','none'),(8105,_binary 'The <a href=\":create-topic\">Forum topic</a> link on the <a href=\":content-add\">Add content</a> page creates the first post of a new threaded discussion, or thread.','','none'),(8106,_binary 'Enabling the Forum module provides a default <em>Forums</em> menu item in the Tools menu that links to the <a href=\":forums\">Forums page</a>.','','none'),(8107,_binary 'Adjust the display of your forum topics. Organize the forums on the <a href=\":forum-structure\">forum structure page</a>.','','none'),(8108,_binary 'To uninstall Forum, first delete all <a href=\":url\">%vocabulary</a> terms','','none'),(8109,_binary 'No containers or forums available. <a href=\":container\">Add container</a> or <a href=\":forum\">Add forum</a>.','','none'),(8110,_binary '<a href=\":hal_spec\">Hypertext Application Language (HAL)</a> is a format that supports the linking required for hypermedia APIs.','','none'),(8111,_binary 'This module adds support for serializing entities (such as content items, taxonomy terms, etc.) to the JSON version of HAL. For more information, see the <a href=\":hal_do\">online documentation for the HAL module</a>.','','none'),(8112,_binary '<strong>Configure your website</strong> Once logged in, visit the <a href=\":admin\">Administration page</a>, where you may <a href=\":config\">customize and configure</a> all aspects of your website.','','none'),(8113,_binary '<strong>Enable additional functionality</strong> Next, visit the <a href=\":modules\">Extend page</a> and enable modules that suit your specific needs. You can find additional modules at the <a href=\":download_modules\">Drupal.org modules page</a>.','','none'),(8114,_binary '<strong>Customize your website design</strong> To change the \"look and feel\" of your website, visit the <a href=\":themes\">Appearance page</a>. You may choose from one of the included themes or download additional themes from the <a href=\":download_themes\">Drupal.org themes page</a>.','','none'),(8115,_binary '<strong>Start posting content</strong> Finally, you may <a href=\":content\">add new content</a> to your website.','','none'),(8116,_binary 'The Help module generates <a href=\":help-page\">Help reference pages</a> to guide you through the use and configuration of modules, and provides a Help block with page-level help. The reference pages are a starting point for <a href=\":handbook\">Drupal.org online documentation</a> pages that contain more extensive and up-to-date information, are annotated with user-contributed comments, and serve as the definitive reference point for all Drupal documentation. For more information, see the <a href=\":help\">online documentation for the Help module</a>.','','none'),(8117,_binary 'The Help module displays explanations for using each module listed on the main <a href=\":help\">Help reference page</a>.','','none'),(8118,_binary 'Page-specific help text provided by modules is displayed in the Help block. This block can be placed and configured on the <a href=\":blocks\">Block layout page</a>.','','none'),(8119,_binary 'The History module keeps track of which content a user has read. It marks content as <em>new</em> or <em>updated</em> depending on the last time the user viewed it. History records that are older than one month are removed during cron, which means that content older than one month is always considered <em>read</em>. The History module does not have a user interface but it provides a filter to <a href=\":views-help\">Views</a> to show new or updated content. For more information, see the <a href=\":url\">online documentation for the History module</a>.','','none'),(8120,_binary 'image from @field_name','','none'),(8121,_binary 'The Image module allows you to create fields that contain image files and to configure <a href=\":image_styles\">Image styles</a> that can be used to manipulate the display of images. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for terminology and general information on entities, fields, and how to create and manage fields. For more information, see the <a href=\":image_documentation\">online documentation for the Image module</a>.','','none'),(8122,_binary 'The concept of image styles is that you can upload a single image but display it in several ways; each display variation, or <em>image style</em>, is the result of applying one or more <em>effects</em> to the original image. As an example, you might upload a high-resolution image with a 4:3 aspect ratio, and display it scaled down, square cropped, or black-and-white (or any combination of these effects). The Image module provides a way to do this efficiently: you configure an image style with the desired effects on the <a href=\":image\">Image styles page</a>, and the first time a particular image is requested in that style, the effects are applied. The resulting image is saved, and the next time that same style is requested, the saved image is retrieved without the need to recalculate the effects. Drupal core provides several effects that you can use to define styles; others may be provided by contributed modules.','','none'),(8123,_binary 'When you create an image field, you will need to choose whether the uploaded images will be stored in the public or private file directory defined in your settings.php file and shown on the <a href=\":file-system\">File system page</a>. This choice cannot be changed later. You can also configure your field to store files in a subdirectory of the public or private directory; this setting can be changed later and can be different for each entity sub-type using the field. For more information on file storage, see the <a href=\":system-help\">System module help page</a>.','','none'),(8124,_binary 'There are currently no styles. <a href=\":url\">Add a new one</a>.','','none'),(8125,_binary 'Both a height and width value must be specified in the @name field.','','none'),(8126,_binary 'The primary identifier for an image style.','','none'),(8127,_binary 'The style machine name.','','none'),(8128,_binary 'The style administrative name.','','none'),(8129,_binary 'You can add languages on the <a href=\":language_list\">Languages</a> page by selecting <em>Add language</em> and choosing a language from the drop-down menu. This language is then displayed in the languages list, where it can be configured further. If the <a href=\":interface\">Interface translation module</a> is enabled, and the <em>translation server</em> is set as a translation source, then the interface translation for this language is automatically downloaded as well.','','none'),(8130,_binary 'By default, content is created in the site\'s default language and no language selector is displayed on content creation pages. On the <a href=\":content_language\">Content language</a> page you can customize the language configuration for any supported content entity on your site (for example for content types or menu links). After choosing an entity, you are provided with a drop-down menu to set the default language and a check-box to display language selectors.','','none'),(8131,_binary 'If the Block module is enabled, then you can add a language switcher block on the <a href=\":blocks\">Block layout</a> page to allow users to switch between languages.','','none'),(8132,_binary 'If the Block module is enabled, then the Language module allows you to set the visibility of a block based on selected languages on the <a href=\":blocks\">Block layout</a> page.','','none'),(8133,_binary 'The <a href=\":detection\">Detection and selection</a> page provides several methods for deciding which language is used for displaying interface text. When a method detects and selects an interface language, then the following methods in the list are not applied. You can order them by importance, with your preferred method at the top of the list, followed by one or several fall-back methods.','','none'),(8134,_binary '<em>Browser</em> sets the interface language based on the browser\'s language settings. Since browsers use different language codes to refer to the same languages, you can add and edit languages codes to map the browser language codes to the <a href=\":language_list\">language codes</a> used on your site.','','none'),(8135,_binary 'Reorder the configured languages to set their order in the language switcher block and, when editing content, in the list of selectable languages. This ordering does not impact <a href=\":detection\">detection and selection</a>.','','none'),(8136,_binary 'The site default language can also be set. It is not recommended to change the default language on a working site. <a href=\":language-detection\">Configure the Selected language</a> setting on the detection and selection page to change the fallback language for language selection.','','none'),(8137,_binary 'Define how to decide which language is used to display page elements (primarily text provided by modules, such as field labels and help text). This decision is made by evaluating a series of detection methods for languages; the first detection method that gets a result will determine which language is used for that type of text. Be aware that some language detection methods are unreliable under certain conditions, such as browser detection when page-caching is enabled and a user is not currently logged in. Define the order of evaluation of language detection methods on this page. The default language can be changed in the <a href=\":admin-change-language\">list of languages</a>.','','none'),(8138,_binary 'Browsers use different language codes to refer to the same languages. Internally, a best effort is made to determine the correct language based on the code that the browser sends. You can add and edit additional mappings from browser language codes to <a href=\":configure-languages\">site languages</a>.','','none'),(8139,_binary 'Changing the selected language here (and leaving this option as the last among the detection and selection options) is the easiest way to change the fallback language for the website, if you need to change how your site works by default (e.g., when using an empty path prefix or using the default domain). <a href=\":admin-change-language\">Changing the site\'s default language</a> itself might have other undesired side effects.','','none'),(8140,_binary 'Use one of the language switcher blocks to allow site visitors to switch between languages. You can enable these blocks on the <a href=\":block-admin\">block administration page</a>.','','none'),(8141,_binary 'Use language codes as <a href=\":w3ctags\">defined by the W3C</a> for interoperability. <em>Examples: \"en\", \"en-gb\" and \"zh-hant\".</em>','','none'),(8142,_binary '%field must be a valid language tag as <a href=\":url\">defined by the W3C</a>.','','none'),(8143,_binary 'The prefix may only be left blank for the <a href=\":url\">selected detection fallback language.</a>','','none'),(8144,_binary 'The Link module allows you to create fields that contain internal or external URLs and optional link text. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":link_documentation\">online documentation for the Link module</a>.','','none'),(8145,_binary 'The <em>settings</em> and the <em>display</em> of the link field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(8146,_binary 'One translation file could not be checked. <a href=\":url\">See the log</a> for details.@count translation files could not be checked. <a href=\":url\">See the log</a> for details.','','none'),(8147,_binary '@message (@percent%).','','none'),(8148,_binary 'One translation file could not be imported. <a href=\":url\">See the log</a> for details.@count translation files could not be imported. <a href=\":url\">See the log</a> for details.','','none'),(8149,_binary 'One translation string was skipped because of disallowed or malformed HTML. <a href=\":url\">See the log</a> for details.@count translation strings were skipped because of disallowed or malformed HTML. <a href=\":url\">See the log</a> for details.','','8.6.5'),(8150,_binary 'The Interface Translation module allows you to translate interface text (<em>strings</em>) into different languages, and to switch between them for the display of interface text. It uses the functionality provided by the <a href=\":language\">Language module</a>. For more information, see the <a href=\":doc-url\">online documentation for the Interface Translation module</a>.','','none'),(8151,_binary 'Translation files with translated interface text are imported automatically when languages are added on the <a href=\":languages\">Languages</a> page, or when modules or themes are enabled. On the <a href=\":locale-settings\">Interface translation settings</a> page, the <em>Translation source</em> can be restricted to local files only, or to include the <a href=\":server\">Drupal translation server</a>. Although modules and themes may not be fully translated in all languages, new translations become available frequently. You can specify whether and how often to check for translation file updates and whether to overwrite existing translations on the <a href=\":locale-settings\">Interface translation settings</a> page. You can also manually import a translation file on the <a href=\":import\">Interface translation import</a> page.','','none'),(8152,_binary 'You can check how much of the interface on your site is translated into which language on the <a href=\":languages\">Languages</a> page. On the <a href=\":translation-updates\">Available translation updates</a> page, you can check whether interface translation updates are available on the <a href=\":server\">Drupal translation server</a>.','','none'),(8153,_binary 'You can translate individual strings directly on the <a href=\":translate\">User interface translation</a> page, or download the currently-used translation file for a specific language on the <a href=\":export\">Interface translation export</a> page. Once you have edited the translation file, you can then import it again on the <a href=\":import\">Interface translation import</a> page.','','none'),(8154,_binary 'Interface translations are automatically imported when a language is added, or when new modules or themes are enabled. The report <a href=\":update\">Available translation updates</a> shows the status. Interface text can be customized in the <a href=\":translate\">user interface translation</a> page.','','none'),(8155,_binary 'This page allows a translator to search for specific translated and untranslated strings, and is used when creating or editing translations. (Note: Because translation tasks involve many strings, it may be more convenient to <a title=\"User interface translation export\" href=\":export\">export</a> strings for offline editing in a desktop Gettext translation editor.) Searches may be limited to strings in a specific language.','','none'),(8156,_binary 'Translation files are automatically downloaded and imported when <a title=\"Languages\" href=\":language\">languages</a> are added, or when modules or themes are enabled.','','none'),(8157,_binary 'This page allows translators to manually import translated strings contained in a Gettext Portable Object (.po) file. Manual import may be used for customized translations or for the translation of custom modules and themes. To customize translations you can download a translation file from the <a href=\":url\">Drupal translation server</a> or <a title=\"User interface translation export\" href=\":export\">export</a> translations from the site, customize the translations using a Gettext translation editor, and import the result using this page.','','none'),(8158,_binary 'No translation status is available. See the <a href=\":updates\">Available translation updates</a> page for more information.','','none'),(8159,_binary 'Interface translation settings','','none'),(8160,_binary 'Interface translation export','','none'),(8161,_binary 'Select how frequently you want to check for new interface translations for your currently installed modules and themes. <a href=\":url\">Check updates now</a>.','','none'),(8162,_binary 'Translation files are stored locally in the  %path directory. You can change this directory on the <a href=\":url\">File system</a> configuration page.','','none'),(8163,_binary 'Translation files will not be stored locally. Change the Interface translation directory on the <a href=\":url\">File system configuration</a> page.','','none'),(8164,_binary 'You have selected local translation source, but no <a href=\":url\">Interface translation directory</a> was configured.','','none'),(8165,_binary 'No translatable languages available. <a href=\":add_language\">Add a language</a> first.','','none'),(8166,_binary 'No translation status available. <a href=\":check\">Check manually</a>.','','none'),(8167,_binary 'It is required by the Menu UI module, which provides an interface for managing menus and menu links. For more information, see the <a href=\":menu-help\">Menu UI module help page</a> and the <a href=\":drupal-org-help\">online documentation for the Custom Menu Links module</a>.','','none'),(8168,_binary 'For more information, see the <a href=\":drupal-org-help\">online documentation for the Custom Menu Links module</a>. If you enable the Menu UI module, it provides an interface for managing menus and menu links.','','none'),(8169,_binary 'The Menu UI module provides an interface for managing menus. A menu is a hierarchical collection of links, which can be within or external to the site, generally used for navigation. For more information, see the <a href=\":menu\">online documentation for the Menu UI module</a>.','','none'),(8170,_binary 'Users with the <em>Administer menus and menu items</em> permission can add, edit, and delete custom menus on the <a href=\":menu\">Menus page</a>. Custom menus can be special site menus, menus of external links, or any combination of internal and external links. You may create an unlimited number of additional menus, each of which will automatically have an associated block (if you have the <a href=\":block_help\">Block module</a> installed). By selecting <em>Edit menu</em>, you can add, edit, or delete links for a given menu. The links listing page provides a drag-and-drop interface for controlling the order of links, and creating a hierarchy within the menu.','','none'),(8171,_binary 'If you have the Block module enabled, then each menu that you create is rendered in a block that you enable and position on the <a href=\":blocks\">Block layout page</a>. In some <a href=\":themes\">themes</a>, the main menu and possibly the secondary menu will be output automatically; you may be able to disable this behavior on the <a href=\":themes\">theme\'s settings page</a>.','','none'),(8172,_binary 'You can enable the newly-created block for this menu on the <a href=\":blocks\">Block layout page</a>.','','none'),(8173,_binary 'Each menu has a corresponding block that is managed on the <a href=\":blocks\">Block layout page</a>.','','none'),(8174,_binary 'There are no menu links yet. <a href=\":url\">Add link</a>.','','none'),(8175,_binary 'The Migrate module provides a framework for migrating data, usually from an external source into your site. It does not provide a user interface. For more information, see the <a href=\":migrate\">online documentation for the Migrate module</a>.','','none'),(8176,_binary 'Migration failed with source plugin exception: @e','','none'),(8177,_binary 'Memory usage is @usage (@pct% of limit @limit), reclaiming memory.','','none'),(8178,_binary 'Memory usage is now @usage (@pct% of limit @limit), not enough reclaimed, starting new batch','','none'),(8179,_binary 'Memory usage is now @usage (@pct% of limit @limit), reclaimed enough, continuing','','none'),(8180,_binary 'The Migrate Drupal module provides a framework based on the <a href=\":migrate\">Migrate module</a> to facilitate migration from a Drupal (6, 7, or 8) site to your website. It does not provide a user interface. For more information, see the <a href=\":migrate_drupal\">online documentation for the Migrate Drupal module</a>.','','none'),(8181,_binary 'The content access permissions need to be rebuilt. <a href=\":node_access_rebuild\">Rebuild permissions</a>.','','none'),(8182,_binary 'The Node module manages the creation, editing, deletion, settings, and display of the main site content. Content items managed by the Node module are typically displayed as pages on your site, and include a title, some meta-data (author, creation time, content type, etc.), and optional fields containing text or other data (fields are managed by the <a href=\":field\">Field module</a>). For more information, see the <a href=\":node\">online documentation for the Node module</a>.','','none'),(8183,_binary 'When new content is created, the Node module records basic information about the content, including the author, date of creation, and the <a href=\":content-type\">Content type</a>. It also manages the <em>publishing options</em>, which define whether or not the content is published, promoted to the front page of the site, and/or sticky at the top of content lists. Default settings can be configured for each <a href=\":content-type\">type of content</a> on your site.','','none'),(8184,_binary 'The Node module gives users with the <em>Administer content types</em> permission the ability to <a href=\":content-new\">create new content types</a> in addition to the default ones already configured. Creating custom content types gives you the flexibility to add <a href=\":field\">fields</a> and configure default settings that suit the differing needs of various site content.','','none'),(8185,_binary 'The <a href=\":content\">Content</a> page lists your content, allowing you add new content, filter, edit or delete existing content, or perform bulk operations on existing content.','','none'),(8186,_binary 'The Node module makes a number of permissions available for each content type, which can be set by role on the <a href=\":permissions\">permissions page</a>.','','none'),(8187,_binary 'This text will be displayed on the <em>Add new content</em> page.','','none'),(8188,_binary 'No content types available. <a href=\":link\">Add content type</a>.','','none'),(8189,_binary 'The Options module allows you to create fields where data values are selected from a fixed list of options. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":options_do\">online documentation for the Options module</a>.','','none'),(8190,_binary 'The <em>settings</em> and the <em>display</em> of the list fields can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(8191,_binary 'The Internal Page Cache module caches pages for anonymous users in the database. For more information, see the <a href=\":pagecache-documentation\">online documentation for the Internal Page Cache module</a>.','','none'),(8192,_binary 'Pages are usually identical for all anonymous users, while they can be personalized for each authenticated user. This is why entire pages can be cached for anonymous users, whereas they will have to be rebuilt for every authenticated user.','','none'),(8193,_binary 'To speed up your site for authenticated users, see the <a href=\":dynamic_page_cache-help\">Dynamic Page Cache module</a>.','','none'),(8194,_binary 'The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\":pathauto\">Pathauto</a>. For more information, see the <a href=\":path\">online documentation for the Path module</a>.','','none'),(8195,_binary 'If you create or edit a taxonomy term you can add an alias (for example <em>music/jazz</em>) in the field \"URL alias\". When creating or editing content you can add an alias (for example <em>about-us/team</em>) under the section \"URL path settings\" in the field \"URL alias\". Aliases for any other path can be added through the page <a href=\":aliases\">URL aliases</a>. To add aliases a user needs the permission <a href=\":permissions\">Create and edit URL aliases</a>.','','none'),(8196,_binary 'The Path module provides a way to search and view a <a href=\":aliases\">list of all aliases</a> that are in use on your website. Aliases can be added, edited and deleted through this list.','','none'),(8197,_binary 'No URL aliases available. <a href=\":link\">Add URL alias</a>.','','none'),(8198,_binary 'The internal system path.','','none'),(8199,_binary 'The path alias.','','none'),(8200,_binary 'The Quick Edit module allows users with the <a href=\":quickedit_permission\">Access in-place editing</a> and <a href=\":contextual_permission\">Use contextual links</a> permissions to edit field content without visiting a separate page. For more information, see the <a href=\":handbook_url\">online documentation for the Quick Edit module</a>.','','none'),(8201,_binary 'To edit content in place, you need to activate quick edit mode for a content item. Activate quick edit mode by choosing Quick edit from the contextual links for an area displaying the content (see the <a href=\":contextual\">Contextual Links module help</a> for more information about how to use contextual links).','','none'),(8202,_binary 'The RDF module enriches your content with metadata to let other applications (e.g., search engines, aggregators, and so on) better understand its relationships and attributes. This semantically enriched, machine-readable output for your website uses the <a href=\":rdfa\">RDFa specification</a>, which allows RDF data to be embedded in HTML markup. Other modules can define mappings of their data to RDF terms, and the RDF module makes this RDF data available to the theme. The core modules define RDF mappings for their data model, and the core themes output this RDF metadata information along with the human-readable visual information. For more information, see the <a href=\":rdf\">online documentation for the RDF module</a>.','','none'),(8203,_binary 'The Responsive Image module provides an image formatter that allows browsers to select which image file to display based on media queries or which image file types the browser supports, using the HTML 5 picture and source elements and/or the sizes, srcset and type attributes. For more information, see the <a href=\":responsive_image\">online documentation for the Responsive Image module</a>.','','none'),(8204,_binary 'By creating responsive image styles you define which options the browser has in selecting which image file to display. In most cases this means providing different image sizes based on the viewport size. On the <a href=\":responsive_image_style\">Responsive image styles</a> page, click <em>Add responsive image style</em> to create a new style. First choose a label, a fallback image style and a breakpoint group and click Save.','','none'),(8205,_binary 'The breakpoint group typically only needs a single breakpoint with an empty media query in order to do <em>viewport sizing.</em> Multiple breakpoints are used for changing the crop or aspect ratio of images at different viewport sizes, which is often referred to as <em>art direction.</em> Once you select a breakpoint group, you can choose which breakpoints to use for the responsive image style. By default, the option <em>do not use this breakpoint</em> is selected for each breakpoint. See the <a href=\":breakpoint_help\">help page of the Breakpoint module</a> for more information.','','none'),(8206,_binary 'Below the Sizes field you can choose multiple image styles so the browser can choose the best image file size to fill the space defined in the Sizes field. Typically you will want to use image styles that resize your image to have options that range from the smallest px width possible for the space the image will appear in to the largest px width possible, with a variety of widths in between. You may want to provide image styles with widths that are 1.5x to 2x the space available in the layout to account for high resolution screens. Image styles can be defined on the <a href=\":image_styles\">Image styles page</a> that is provided by the <a href=\":image_help\">Image module</a>.','','none'),(8207,_binary 'After defining responsive image styles, you can use them in the display settings for your Image fields, so that the site displays responsive images using the HTML5 picture tag. Open the Manage display page for the entity type (content type, taxonomy vocabulary, etc.) that the Image field is attached to. Choose the format <em>Responsive image</em>, click the Edit icon, and select one of the responsive image styles that you have created. For general information on how to manage fields and their display see the <a href=\":field_ui\">Field UI module help page</a>. For background information about entities and fields see the <a href=\":field_help\">Field module help page</a>.','','none'),(8208,_binary 'See the <a href=\":responsive_image_help\">Responsive Image help page</a> for information on the sizes attribute.','','none'),(8209,_binary 'Configure Responsive Image Styles','','none'),(8210,_binary 'In order to use REST on a web site, you need to install modules that provide serialization and authentication services. You can use the Core module <a href=\":hal\">HAL</a> for serialization and <a href=\":basic_auth\">HTTP Basic Authentication</a> for authentication, or install a contributed or custom module.','','none'),(8211,_binary 'The Search module provides the ability to set up search pages based on plugins provided by other modules. In Drupal core, there are two page-type plugins: the Content page type provides keyword searching for content managed by the Node module, and the Users page type provides keyword searching for registered users. Contributed modules may provide other page-type plugins. For more information, see the <a href=\":search-module\">online documentation for the Search module</a>.','','none'),(8212,_binary 'To configure search pages, visit the <a href=\":search-settings\">Search pages page</a>. In the Search pages section, you can add a new search page, edit the configuration of existing search pages, enable and disable search pages, and choose the default search page. Each enabled search page has a URL path starting with <em>search</em>, and each will appear as a tab or local task link on the <a href=\":search-url\">search page</a>; you can configure the text that is shown in the tab. In addition, some search page plugins have additional settings that you can configure for each search page.','','none'),(8213,_binary 'Some search page plugins, such as the core Content search page, index searchable text using the Drupal core search index, and will not work unless content is indexed. Indexing is done during <em>cron</em> runs, so it requires a <a href=\":cron\">cron maintenance task</a> to be set up. There are also several settings affecting indexing that can be configured on the <a href=\":search-settings\">Search pages page</a>: the number of items to index per cron run, the minimum word length to index, and how to handle Chinese, Japanese, and Korean characters.','','none'),(8214,_binary 'Modules providing search page plugins generally ensure that content-related actions on your site (creating, editing, or deleting content and comments) automatically cause affected content items to be marked for indexing or reindexing at the next cron run. When content is marked for reindexing, the previous content remains in the index until cron runs, at which time it is replaced by the new content. However, there are some actions related to the structure of your site that do not cause affected content to be marked for reindexing. Examples of structure-related actions that affect content include deleting or editing taxonomy terms, enabling or disabling modules that add text to content (such as Taxonomy, Comment, and field-providing modules), and modifying the fields or display parameters of your content types. If you take one of these actions and you want to ensure that the search index is updated to reflect your changed site structure, you can mark all content for reindexing by clicking the \"Re-index site\" button on the <a href=\":search-settings\">Search pages page</a>. If you have a lot of content on your site, it may take several cron runs for the content to be reindexed.','','none'),(8215,_binary 'The Search module includes a block, which can be enabled and configured on the <a href=\":blocks\">Block layout page</a>, if you have the Block module enabled; the default block title is Search, and it is the Search form block in the Forms category, if you wish to add another instance. The block is available to users with the <a href=\":search_permission\">Use search</a> permission, and it performs a search using the configured default search page.','','none'),(8216,_binary 'Users with <a href=\":search_permission\">Use search</a> permission can use the Search block and <a href=\":search\">Search page</a>. Users with the <a href=\":node_permission\">View published content</a> permission can use configured search pages of type <em>Content</em> to search for content containing exact keywords; in addition, users with <a href=\":search_permission\">Use advanced search</a> permission can use more complex search filtering. Users with the <a href=\":user_permission\">View user information</a> permission can use configured search pages of type <em>Users</em> to search for active users containing the keyword anywhere in the username, and users with the <a href=\":user_permission\">Administer users</a> permission can search for active and blocked users, by email address or username keyword.','','none'),(8217,_binary 'By default, the Search module only supports exact keyword matching in content searches. You can modify this behavior by installing a language-specific stemming module for your language (such as <a href=\":porterstemmer_url\">Porter Stemmer</a> for American English), which allows words such as walk, walking, and walked to be matched in the Search module. Another approach is to use a third-party search technology with stemming or partial word matching features built in, such as <a href=\":solr_url\">Apache Solr</a> or <a href=\":sphinx_url\">Sphinx</a>. There are also contributed modules that provide additional search pages. These and other <a href=\":contrib-search\">search-related contributed modules</a> can be downloaded by visiting Drupal.org.','','none'),(8218,_binary '… @excerpt … @excerpt …','','none'),(8219,_binary 'This module does not have a user interface. It is used by other modules which need to serialize data, such as <a href=\":rest\">REST</a>.','','none'),(8220,_binary 'For more information, see the <a href=\":doc_url\">online documentation for the Serialization module</a>.','','none'),(8221,_binary 'The Shortcut module allows users to create sets of <em>shortcut</em> links to commonly-visited pages of the site. Shortcuts are contained within <em>sets</em>. Each user with <em>Select any shortcut set</em> permission can select a shortcut set created by anyone at the site. For more information, see the <a href=\":shortcut\">online documentation for the Shortcut module</a>.','','none'),(8222,_binary 'Users with the <em>Administer shortcuts</em> permission can manage shortcut sets and edit the shortcuts within sets from the <a href=\":shortcuts\">Shortcuts administration page</a>.','','none'),(8223,_binary 'You can display your shortcuts by enabling the <em>Shortcuts</em> block on the <a href=\":blocks\">Blocks administration page</a>. Certain administrative modules also display your shortcuts; for example, the core <a href=\":toolbar-help\">Toolbar module</a> provides a corresponding menu item.','','none'),(8224,_binary 'Define which shortcut set you are using on the <a href=\":shortcut-link\">Shortcuts tab</a> of your account page.','','none'),(8225,_binary 'No shortcuts available. <a href=\":link\">Add a shortcut</a>','','none'),(8226,_binary 'You are now using the new %set_name shortcut set. You can edit it from this page or <a href=\":switch-url\">switch back to a different one.</a>','','none'),(8227,_binary 'The menu.mlid primary key for this menu item (= shortcut link).','','none'),(8228,_binary 'The menu_name (= set name) for this shortcut link.','','none'),(8229,_binary 'The link for this shortcut.','','none'),(8230,_binary 'The title for this shortcut.','','none'),(8231,_binary 'The weight for this shortcut','','none'),(8232,_binary 'The name under which the set\'s links are stored.','','none'),(8233,_binary 'The title of the set.','','none'),(8234,_binary 'The users.uid for this set.','','none'),(8235,_binary 'The shortcut_set.set_name that will be displayed for this user.','','none'),(8236,_binary 'The Testing module provides a framework for running automated tests. It can be used to verify a working state of Drupal before and after any code changes, or as a means for developers to write and execute tests for their modules. For more information, see the <a href=\":simpletest\">online documentation for the Testing module</a>.','','none'),(8237,_binary 'Visit the <a href=\":admin-simpletest\">Testing page</a> to display a list of available tests. For comprehensive testing, select <em>all</em> tests, or individually select tests for more targeted testing. Note that it might take several minutes for all tests to complete.','','none'),(8238,_binary 'The testing framework requires the PHP memory limit to be at least %memory_minimum_limit. The current value is %memory_limit. <a href=\":url\">Follow these steps to continue</a>.','','none'),(8239,_binary 'The Statistics module shows you how often content is viewed. This is useful in determining which pages of your site are most popular. For more information, see the <a href=\":statistics_do\">online documentation for the Statistics module</a>.','','none'),(8240,_binary 'The module includes a <em>Popular content</em> block that displays the most viewed pages today and for all time, and the last content viewed. To use the block, enable <em>Count content views</em> on the <a href=\":statistics-settings\">Statistics page</a>, and then you can enable and configure the block on the <a href=\":blocks\">Block layout page</a>.','','none'),(8241,_binary 'The Statistics module includes a counter for each page that increases whenever the page is viewed. To use the counter, enable <em>Count content views</em> on the <a href=\":statistics-settings\">Statistics page</a>, and set the necessary <a href=\":permissions\">permissions</a> (<em>View content hits</em>) so that the counter is visible to the users.','','none'),(8242,_binary 'How long any statistics may be cached, i.e. the refresh interval','','none'),(8243,_binary 'This theme requires PHP version @php_required and is incompatible with PHP version @php_version.','','none'),(8244,_binary 'The System module is integral to the site: it provides user interfaces for many core systems and settings, as well as the basic administrative menu structure. For more information, see the <a href=\":system\">online documentation for the System module</a>.','','none'),(8245,_binary 'Users with appropriate permission can install and uninstall modules from the <a href=\":modules\">Extend page</a>. Depending on which distribution or installation profile you choose when you install your site, several modules are installed and others are provided but not installed. Each module provides a discrete set of features; modules may be installed or uninstalled depending on the needs of the site. Many additional modules contributed by members of the Drupal community are available for download from the <a href=\":drupal-modules\">Drupal.org module page</a>. Note that uninstalling a module is a destructive action: when you uninstall a module, you will permanently lose all data connected to the module.','','none'),(8246,_binary 'Users with appropriate permission can install and uninstall themes on the <a href=\":themes\">Appearance page</a>. Themes determine the design and presentation of your site. Depending on which distribution or installation profile you choose when you install your site, a default theme is installed, and possibly a different theme for administration pages. Other themes are provided but not installed, and additional contributed themes are available at the <a href=\":drupal-themes\">Drupal.org theme page</a>.','','none'),(8247,_binary 'When you are performing site maintenance, you can prevent non-administrative users (including anonymous visitors) from viewing your site by putting it in <a href=\":maintenance-mode\">Maintenance mode</a>. This will prevent unauthorized users from making changes to the site while you are performing maintenance, or from seeing a broken site while updates are in progress.','','none'),(8248,_binary 'On the <a href=\":performance-page\">Performance page</a>, the site can be configured to aggregate CSS and JavaScript files, making the total request size smaller. Note that, for small- to medium-sized websites, the <a href=\":page-cache\">Internal Page Cache module</a> should be installed so that pages are efficiently cached and reused for anonymous users. Finally, for websites of all sizes, the <a href=\":dynamic-page-cache\">Dynamic Page Cache module</a> should also be installed so that the non-personalized parts of pages are efficiently cached (for all users).','','none'),(8249,_binary 'Your site has several file directories, which are used to store and process uploaded and generated files. The <em>public</em> file directory, which is configured in your settings.php file, is the default place for storing uploaded files. Links to files in this directory contain the direct file URL, so when the files are requested, the web server will send them directly without invoking your site code. This means that the files can be downloaded by anyone with the file URL, so requests are not access-controlled but they are efficient. The <em>private</em> file directory, also configured in your settings.php file and ideally located outside the site web root, is access controlled. Links to files in this directory are not direct, so requests to these files are mediated by your site code. This means that your site can check file access permission for each file before deciding to fulfill the request, so the requests are more secure, but less efficient. You should only use the private storage for files that need access control, not for files like your site logo and background images used on every page. The <em>temporary</em> file directory is used internally by your site code for various operations, and is configured on the <a href=\":file-system\">File system settings</a> page. You can also see the configured public and private file directories on this page, and choose whether public or private should be the default for uploaded files.','','none'),(8250,_binary 'On the <a href=\":toolkit\">Image toolkit page</a>, you can select and configure the PHP toolkit used to manipulate images. Depending on which distribution or installation profile you choose when you install your site, the GD2 toolkit and possibly others are included; other toolkits may be provided by contributed modules.','','none'),(8251,_binary 'Set and configure the default theme for your website.  Alternative <a href=\":themes\">themes</a> are available.','','none'),(8252,_binary 'You can place blocks for each theme on the <a href=\":blocks\">block layout</a> page.','','none'),(8253,_binary 'Download additional <a href=\":modules\">contributed modules</a> to extend your site\'s functionality.','','none'),(8254,_binary 'Regularly review available updates to maintain a secure and current site. Always run the <a href=\":update-php\">update script</a> each time a module is updated. Enable the <a href=\":update-manager\">Update Manager module</a> to update and install modules and themes.','','none'),(8255,_binary 'Here you can find a short overview of your site\'s parameters as well as any problems detected with your installation. It may be useful to copy and paste this information into support requests filed on Drupal.org\'s support forums and project issue queues. Before filing a support request, ensure that your web server meets the <a href=\":system-requirements\">system requirements.</a>','','none'),(8256,_binary 'Configure your <a href=\":user-edit\">account time zone setting</a>.','','none'),(8257,_binary 'The minimum version of Apache needed to run Drupal without mod_rewrite enabled is 2.2.16. See the <a href=\":link\">enabling clean URLs</a> page for more information on mod_rewrite.','','none'),(8258,_binary 'Your server is capable of using clean URLs, but it is not enabled. Using clean URLs gives an improved user experience and is recommended. <a href=\":link\">Enable clean URLs</a>','','none'),(8259,_binary 'The phpinfo() function has been disabled for security reasons. To see your server\'s phpinfo() information, change your PHP settings or contact your server administrator. For more information, <a href=\":phpinfo\">Enabling and disabling phpinfo()</a> handbook page.','','none'),(8260,_binary 'Drupal requires you to enable the PHP extensions in the following list (see the <a href=\":system_requirements\">system requirements page</a> for more information):','','none'),(8261,_binary 'Your web server does not appear to support PDO (PHP Data Objects). Ask your hosting provider if they support the native PDO extension. See the <a href=\":link\">system requirements</a> page for more information.','','none'),(8262,_binary 'Your web server does not appear to support any common PDO database extensions. Check with your hosting provider to see if they support PDO (PHP Data Objects) and offer any databases that <a href=\":drupal-databases\">Drupal supports</a>.','','none'),(8263,_binary 'Your web server seems to have the wrong version of PDO installed. Drupal requires the PDO extension from PHP core. This system has the older PECL version. See the <a href=\":link\">system requirements</a> page for more information.','','none'),(8264,_binary 'For more information, see the online handbook entry for <a href=\":memory-limit\">increasing the PHP memory limit</a>.','','none'),(8265,_binary 'An automated attempt to create this directory failed, possibly due to a permissions problem. To proceed with the installation, either create the directory and modify its permissions manually or ensure that the installer has the permissions to create it automatically. For more information, see INSTALL.txt or the <a href=\":handbook_url\">online handbook</a>.','','none'),(8266,_binary 'Some modules have database schema updates to install. You should run the <a href=\":update\">database update script</a> immediately.','','none'),(8267,_binary 'Update notifications are not enabled. It is <strong>highly recommended</strong> that you enable the Update Manager module from the <a href=\":module\">module administration page</a> in order to stay up-to-date on new releases. For more information, <a href=\":update\">Update status handbook page</a>.','','none'),(8268,_binary 'The trusted_host_patterns setting is not configured in settings.php. This can lead to security vulnerabilities. It is <strong>highly recommended</strong> that you configure this. See <a href=\":url\">Protecting against HTTP HOST Header attacks</a> for more information.','','none'),(8269,_binary 'Block module is not enabled so site branding elements, which have been converted to a block, are not visible anymore.','','none'),(8270,_binary 'Because your site has custom theme(s) installed, we had to set the branding block into the content region. Please manually review the block configuration and remove the site name, slogan, and logo variables from your templates.','','none'),(8271,_binary 'Block module is not enabled. The page title has been converted to a block, but default page title markup will still display at the top of the main content area.','','none'),(8272,_binary 'Because your site has custom theme(s) installed, we have placed the page title block in the content region. Please manually review the block configuration and remove the page title variables from your page templates.','','none'),(8273,_binary 'Put your site into <a href=\":url\">maintenance mode</a>.','','none'),(8274,_binary 'All errors have been <a href=\":url\">logged</a>.','','none'),(8275,_binary 'Updates were attempted. If you see no failures below, you may proceed happily back to your <a href=\":url\">site</a>. Otherwise, you may need to update your database manually.','','none'),(8276,_binary 'Screenshot for @theme theme','','none'),(8277,_binary 'Settings for @theme theme','','none'),(8278,_binary 'Uninstall @theme theme','','none'),(8279,_binary 'Set @theme as default theme','','none'),(8280,_binary 'Install @theme theme','','none'),(8281,_binary 'Install @theme as default theme','','none'),(8282,_binary 'The phpinfo() function has been disabled for security reasons. For more information, visit <a href=\":phpinfo\">Enabling and disabling phpinfo()</a> handbook page.','','none'),(8283,_binary 'This version is not compatible with Drupal @core_version and should be replaced.','','none'),(8284,_binary 'This module requires PHP version @php_required and is incompatible with PHP version @php_version.','','none'),(8285,_binary '<strong class=\"error\">Set up the <a href=\":file-system\">public files directory</a> to make these optimizations available.</strong>','','none'),(8286,_binary 'Defined on the <a href=\":appearance\">Appearance Settings</a> or <a href=\":theme\">Theme Settings</a> page.','','none'),(8287,_binary 'Defined on the <a href=\":information\">Site Information</a> page.','','none'),(8288,_binary 'Powered by <a href=\":poweredby\">Drupal</a>','','none'),(8289,_binary 'Installation tasks','','none'),(8290,_binary 'The Taxonomy module allows users who have permission to create and edit content to categorize (tag) content of that type. Users who have the <em>Administer vocabularies and terms</em> <a href=\":permissions\" title=\"Taxonomy module permissions\">permission</a> can add <em>vocabularies</em> that contain a set of related <em>terms</em>. The terms in a vocabulary can either be pre-set by an administrator or built gradually as content is added and edited. Terms may be organized hierarchically if desired.','','none'),(8291,_binary 'For more information, see the <a href=\":taxonomy\">online documentation for the Taxonomy module</a>.','','none'),(8292,_binary 'Users who have the <em>Administer vocabularies and terms</em> permission can add and edit vocabularies from the <a href=\":taxonomy_admin\">Taxonomy administration page</a>. Vocabularies can be deleted from their <em>Edit vocabulary</em> page. Users with the <em>Taxonomy term: Administer fields</em> permission may add additional fields for terms in that vocabulary using the <a href=\":field_ui\">Field UI module</a>.','','none'),(8293,_binary 'Users who have the <em>Administer vocabularies and terms</em> permission or the <em>Edit terms</em> permission for a particular vocabulary can add, edit, and organize the terms in a vocabulary from a vocabulary\'s term listing page, which can be accessed by going to the <a href=\":taxonomy_admin\">Taxonomy administration page</a> and clicking <em>List terms</em> in the <em>Operations</em> column. Users must have the <em>Administer vocabularies and terms</em> permission or the <em>Delete terms</em> permission for a particular vocabulary to delete terms.','','none'),(8294,_binary 'A user with the <em>Administer fields</em> permission for a certain entity type may add <em>Taxonomy term</em> reference fields to the entity type, which will allow entities to be classified using taxonomy terms. See the <a href=\":entity_reference\">Entity Reference help</a> for more information about reference fields. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them.','','none'),(8295,_binary 'See the <a href=\":entity_reference\">Entity Reference help</a> page for the field widgets and formatters that can be configured for any reference field on the <em>Manage display</em> and <em>Manage form display</em> pages. Taxonomy additionally provides an <em>RSS category</em> formatter that displays nothing when the entity item is displayed as HTML, but displays an RSS category instead of a list when the entity item is displayed in an RSS feed.','','none'),(8296,_binary 'No vocabularies available. <a href=\":link\">Add vocabulary</a>.','','none'),(8297,_binary 'No terms available. <a href=\":link\">Add term</a>.','','none'),(8298,_binary 'Format of the term description.','','none'),(8299,_binary 'Module responsible for the vocabulary.','','none'),(8300,_binary 'The Telephone module allows you to create fields that contain telephone numbers. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":telephone_documentation\">online documentation for the Telephone module</a>.','','none'),(8301,_binary 'The <em>settings</em> and the <em>display</em> of the telephone field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(8302,_binary 'The Text module allows you to create short and long text fields with optional summaries. See the <a href=\":field\">Field module help</a> and the <a href=\":field_ui\">Field UI help</a> pages for general information on fields and how to create and manage them. For more information, see the <a href=\":text_documentation\">online documentation for the Text module</a>.','','none'),(8303,_binary 'The <em>settings</em> and <em>display</em> of the text field can be configured separately. See the <a href=\":field_ui\">Field UI help</a> for more information on how to manage fields and their display.','','none'),(8304,_binary 'If you choose <em>Text (plain)</em> or <em>Text (plain, long)</em> you restrict the input to <em>Plain text</em> only. If you choose <em>Text (formatted)</em>, <em>Text (formatted, long)</em>, or <em>Text (formatted, long with summary)</em> you allow users to write formatted text. Which options are available to individual users depends on the settings on the <a href=\":formats\">Text formats and editors page</a>.','','none'),(8305,_binary 'Number of summary rows: @rows','','none'),(8306,_binary 'The Toolbar module provides a toolbar for site administrators, which displays tabs and trays provided by the Toolbar module itself and other modules. For more information, see the <a href=\":toolbar_docs\">online documentation for the Toolbar module</a>.','','none'),(8307,_binary 'The Tour module provides users with guided tours of the site interface. Each tour consists of several tips that highlight elements of the user interface, guide the user through a workflow, or explain key concepts of the website. For more information, see the <a href=\':tour\'>online documentation for the Tour module</a>.','','none'),(8308,_binary 'Tours can be written as YAML-documents with a text editor, or using the contributed <a href=\':tour_ui\'>Tour UI</a> module. For more information, see <a href=\':doc_url\'>the online documentation for writing tours</a>.','','none'),(8309,_binary '@tour_item of @total','','none'),(8310,_binary 'The Activity Tracker module displays the most recently added and updated content on your site, and allows you to follow new content created by each user. This module has no configuration options. For more information, see the <a href=\":tracker\">online documentation for the Activity Tracker module</a>.','','none'),(8311,_binary 'The <a href=\":recent\">Recent content</a> page shows new and updated content in reverse chronological order, listing the content type, title, author\'s name, number of comments, and time of last update. Content is considered updated when changes occur in the text, or when new comments are added. The <em>My recent content</em> tab limits the list to the currently logged-in user.','','none'),(8312,_binary 'The {node}.nid this record tracks.','','none'),(8313,_binary 'Boolean indicating whether the node is published.','','none'),(8314,_binary 'The Unix timestamp when the node was most recently saved or commented on.','','none'),(8315,_binary 'The {user}.nid this record tracks.','','none'),(8316,_binary 'The {users}.uid of the node author or commenter.','','none'),(8317,_binary 'The Unix timestamp when the user was most recently saved or commented on.','','none'),(8318,_binary 'Uninstalled modules','','none'),(8319,_binary 'Uninstalled themes','','none'),(8320,_binary 'The Update Manager module periodically checks for new versions of your site\'s software (including contributed modules and themes), and alerts administrators to available updates. The Update Manager system is also used by some other modules to manage updates and downloads; for example, the Interface Translation module uses the Update Manager to download translations from the localization server. Note that whenever the Update Manager system is used, anonymous usage statistics are sent to Drupal.org. If desired, you may disable the Update Manager module from the <a href=\":modules\">Extend page</a>; if you do so, functionality that depends on the Update Manager system will not work. For more information, see the <a href=\":update\">online documentation for the Update Manager module</a>.','','none'),(8321,_binary 'The <a href=\":update-report\">Available updates report</a> displays core, contributed modules, and themes for which there are new releases available for download. On the report page, you can also check manually for updates. You can configure the frequency of update checks, which are performed during cron runs, and whether notifications are sent on the <a href=\":update-settings\">Update Manager settings page</a>.','','none'),(8322,_binary 'The Update Manager module allows administrators to perform updates directly from the <a href=\":update-page\">Update page</a>. It lists all available updates, and you can confirm whether you want to download them. If you don\'t have sufficient access rights to your web server, you could be prompted for your FTP/SSH password. Afterwards the files are transferred into your site installation, overwriting your old files. Direct links to the Update page are also displayed on the <a href=\":modules_page\">Extend page</a> and the <a href=\":themes_page\">Appearance page</a>.','','none'),(8323,_binary 'You can also install new modules and themes in the same fashion, through the <a href=\":install\">Install page</a>, or by clicking the <em>Install new module/theme</em> links at the top of the <a href=\":modules_page\">Extend page</a> and the <a href=\":themes_page\">Appearance page</a>. In this case, you are prompted to provide either the URL to the download, or to upload a packaged release file from your local computer.','','none'),(8324,_binary 'Regularly review and install <a href=\":updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\":update-php\">update script</a> each time a module is updated.','','none'),(8325,_binary 'Regularly review <a href=\":updates\">available updates</a> to maintain a secure and current site. Always run the <a href=\":update-php\">update script</a> each time a module is updated.','','none'),(8326,_binary 'New release(s) available for @site_name','','none'),(8327,_binary 'Your site is currently configured to send these emails when any updates are available. To get notified only for security updates, @url.','','none'),(8328,_binary 'Your site is currently configured to send these emails only when security updates are available. To get notified for any available updates, @url.','','none'),(8329,_binary 'There was a problem checking <a href=\":update-report\">available updates</a> for Drupal.','','none'),(8330,_binary 'There was a problem checking <a href=\":update-report\">available updates</a> for your modules or themes.','','none'),(8331,_binary 'Automatic updating of Drupal core is not supported. See the <a href=\":upgrade-guide\">upgrade guide</a> for information on how to update Drupal core manually.','','none'),(8332,_binary '%archive_file contains a version of %names that is not compatible with Drupal @version.%archive_file contains versions of modules or themes that are not compatible with Drupal @version: %names','','none'),(8333,_binary 'See the <a href=\":available_updates\">available updates</a> page for more information and to install your missing updates.','','none'),(8334,_binary 'See the <a href=\":available_updates\">available updates</a> page for more information.','','none'),(8335,_binary 'Update Manager settings','','none'),(8336,_binary 'Check for updates of uninstalled modules and themes','','none'),(8337,_binary 'You can choose to send email only if a security update is available, or to be notified about all newer versions. If there are updates available of Drupal core or any of your installed modules and themes, your site will always print a message on the <a href=\":status_report\">status report</a> page, and will also display an error message on administration pages if there is a security update.','','none'),(8338,_binary 'You can find <a href=\":module_url\">modules</a> and <a href=\":theme_url\">themes</a> on <a href=\":drupal_org_url\">drupal.org</a>. The following file extensions are supported: %extensions.','','none'),(8339,_binary 'Back up your database and site before you continue. <a href=\":backup_url\">Learn how</a>.','','none'),(8340,_binary 'Deprecated: Use account-name or display-name instead.','','none'),(8341,_binary 'The display name of the user account.','','none'),(8342,_binary 'The User module allows users to register, log in, and log out. It also allows users with proper permissions to manage user roles and permissions. For more information, see the <a href=\":user_docs\">online documentation for the User module</a>.','','none'),(8343,_binary 'Through the <a href=\":people\">People administration page</a> you can add and cancel user accounts and assign users to roles. By editing one particular user you can change their username, email address, password, and information in other fields.','','none'),(8344,_binary '<em>Roles</em> are used to group and classify users; each user can be assigned one or more roles. Typically there are two pre-defined roles: <em>Anonymous user</em> (users that are not logged in), and <em>Authenticated user</em> (users that are registered and logged in). Depending on how your site was set up, an <em>Administrator</em> role may also be available: users with this role will automatically be assigned any new permissions whenever a module is enabled. You can create additional roles on the <a href=\":roles\">Roles administration page</a>.','','none'),(8345,_binary 'After creating roles, you can set permissions for each role on the <a href=\":permissions_user\">Permissions page</a>. Granting a permission allows users who have been assigned a particular role to perform an action on the site, such as viewing content, editing or creating  a particular type of content, administering settings for a particular module, or using a particular function of the site (such as search).','','none'),(8346,_binary 'The <a href=\":accounts\">Account settings page</a> allows you to manage settings for the displayed name of the Anonymous user role, personal contact forms, user registration settings, and account cancellation settings. On this page you can also manage settings for account personalization, and adapt the text for the email messages that users receive when they register or request a password recovery. You may also set which role is automatically assigned new permissions whenever a module is enabled (the Administrator role).','','none'),(8347,_binary 'Because User accounts are an entity type, you can extend them by adding fields through the Manage fields tab on the <a href=\":accounts\">Account settings page</a>. By adding fields for e.g., a picture, a biography, or address, you can a create a custom profile for the users of the website. For background information on entities and fields, see the <a href=\":field_help\">Field module help page</a>.','','none'),(8348,_binary 'Permissions let you control what users can do and see on your site. You can define a specific set of permissions for each role. (See the <a href=\":role\">Roles</a> page to create a role.) Any permissions granted to the Authenticated user role will be given to any user who is logged in to your site. From the <a href=\":settings\">Account settings</a> page, you can make any role into an Administrator role for the site, meaning that role will be granted all new permissions automatically. You should be careful to ensure that only trusted users are given this access and level of control of your site.','','none'),(8349,_binary 'A role defines a group of users that have certain privileges. These privileges are defined on the <a href=\":permissions\">Permissions page</a>. Here, you can define the names and the display sort order of the roles on your site. It is recommended to order roles from least permissive (for example, Anonymous user) to most permissive (for example, Administrator user). Users who are not logged in have the Anonymous user role. Users who are logged in have the Authenticated user role, plus any other roles granted to their user account.','','none'),(8350,_binary 'The new user <a href=\":url\">%name</a> was created without an email address, so no welcome message was sent.','','none'),(8351,_binary 'A welcome message with further instructions has been emailed to the new user <a href=\":url\">%name</a>.','','none'),(8352,_binary 'Password reset instructions will be sent to your registered email address.','','none'),(8353,_binary 'Send password reset instructions via email.','','none'),(8354,_binary 'Also known as:','','none'),(8355,_binary '@label (@name:@column)','','none'),(8356,_binary '@label:@column','','none'),(8357,_binary '@label (@name:delta)','','none'),(8358,_binary 'For more information, see the <a href=\":views\">online documentation for the Views module</a>.','','none'),(8359,_binary 'In order to create and modify your own views using the administration and configuration user interface, you will need to enable either the Views UI module in core or a contributed module that provides a user interface for Views. See the <a href=\":views-ui\">Views UI module help page</a> for more information.','','none'),(8360,_binary 'Contributed projects that support the Views module can be found in the <a href=\":node\">online documentation for Views-related contributed modules</a>.','','none'),(8361,_binary 'Changing the title here means it cannot be dynamically altered anymore. (Try changing it directly in <a href=\":url\">@name</a>.)','','none'),(8362,_binary 'This link is provided by the Views module. The path can be changed by editing the view <a href=\":url\">@label</a>','','none'),(8363,_binary '@type language selected for page','','none'),(8364,_binary 'Will not be accessible.','','none'),(8365,_binary '@code (@title)','','none'),(8366,_binary 'The following tokens are available. You may use Twig syntax in this field.','','none'),(8367,_binary 'Override the view and other argument titles. You may use Twig syntax in this field as well as the \"arguments\" and \"raw_arguments\" arrays.','','none'),(8368,_binary 'Override the view and other argument titles. You may use Twig syntax in this field.','','none'),(8369,_binary 'The category this block will appear under on the <a href=\":href\">blocks placement page</a>.','','none'),(8370,_binary 'Separate multiple classes by spaces.','','none'),(8371,_binary 'You may also adjust the @settings for the currently selected access restriction.','','none'),(8372,_binary 'You may also adjust the @settings for the currently selected cache mechanism.','','none'),(8373,_binary 'You may also adjust the @settings for the currently selected style.','','none'),(8374,_binary 'You may also adjust the @settings for the currently selected row style.','','none'),(8375,_binary 'The following tokens are available for this link. You may use Twig syntax in this field.','','none'),(8376,_binary 'You may also adjust the @settings for the currently selected pager.','','none'),(8377,_binary 'The text to display for this field. You may include HTML or <a href=\":url\">Twig</a>. You may enter data from this view as per the \"Replacement patterns\" below.','','none'),(8378,_binary 'An offset from the current time such as \"@example1\" or \"@example2\"','','none'),(8379,_binary 'The Views UI module provides an interface for managing views for the <a href=\":views\">Views module</a>. For more information, see the <a href=\":handbook\">online documentation for the Views UI module</a>.','','none'),(8380,_binary 'Views can be enabled or disabled from the <a href=\":list\">Views list page</a>. To enable a view, find the view within the \"Disabled\" list and select the \"Enable\" operation. To disable a view find the view within the \"Enabled\" list and select the \"Disable\" operation.','','none'),(8381,_binary 'Views can be exported and imported as configuration files by using the <a href=\":config\">Configuration Manager module</a>.','','none'),(8382,_binary 'Advanced Views settings','','none'),(8383,_binary 'This view is being edited by user @user, and is therefore locked from editing by others. This lock is @age old. Click here to <a href=\":url\">break this lock</a>.','','none'),(8384,_binary 'View @display_title','','none'),(8385,_binary 'Duplicate as @type','','none'),(8386,_binary 'Add @display','','none'),(8387,_binary 'By breaking this lock, any unsaved changes made by @user will be lost.','','none'),(8388,_binary 'You must select a language to continue the installation.','','none'),(8389,_binary '@display \'@id\': Component \'@name\' was disabled because its settings depend on removed dependencies.','','none'),(8390,_binary 'No widget available for: %type.','','none'),(8391,_binary 'This value is not valid.','','none'),(8392,_binary 'Create tasks that the system can execute.','','none'),(8393,_binary 'The URL to which the user should be redirected. This can be an internal URL like /node/1234 or an external URL like @url.','','none'),(8394,_binary 'Add feeds or import OPMLs to gather external content and configure how often they are updated.','','none'),(8395,_binary 'The Automated Cron module runs cron operations for your site using normal browser/page requests instead of having to set up a separate cron job. The Automated Cron module checks at the end of each server response when cron operation was last ran and, if it has been too long since last run, it executes the cron tasks after sending a server response. For more information, see the <a href=\":automated_cron-documentation\">online documentation for the Automated Cron module</a>.','','none'),(8396,_binary 'Configuring Automated Cron','','none'),(8397,_binary 'On the <a href=\":cron-settings\">Cron page</a>, you can set the frequency (time interval) for running cron jobs.','','none'),(8398,_binary 'Disabling Automated Cron','','none'),(8399,_binary 'To disable automated cron, the recommended method is to uninstall the module, to reduce site overhead. If you only want to disable it temporarily, you can set the frequency to Never on the Cron page, and then change the frequency back when you want to start it up again.','','none'),(8400,_binary 'Automated Cron','','none'),(8401,_binary 'Automated cron settings','','none'),(8402,_binary 'Ban visits from specific IP addresses.','','none'),(8403,_binary 'You can place a new block in a region by selecting <em>Place block</em> on the <a href=\":blocks\">Block layout page</a>. Once a block is placed, it can be moved to a different region by drag-and-drop or by using the <em>Region</em> drop-down list, and then clicking <em>Save blocks</em>.','','none'),(8404,_binary 'Block placement is specific to each theme on your site. Changes will not be saved until you click <em>Save blocks</em> at the bottom of the page.','','none'),(8405,_binary 'Adding comment types','','none'),(8406,_binary 'Additional <em>comment types</em> can be created per entity sub-type and added on the <a href=\":field\">Comment types page</a>. If there are multiple comment types available you can select the appropriate one after adding a <em>Comments field</em>.','','none'),(8407,_binary 'Compare the configuration uploaded to your sync directory with the active configuration before completing the import.','','none'),(8408,_binary 'Upload a full site configuration archive to the sync directory. It can then be compared and imported on the Synchronize page.','','none'),(8409,_binary 'The Database Logging module logs system events in the Drupal database. Monitor your site or debug site problems on this page.','','none'),(8410,_binary 'The Internal Dynamic Page Cache module caches pages for all users in the database, handling dynamic content correctly. For more information, see the <a href=\":dynamic_page_cache-documentation\">online documentation for the Internal Dynamic Page Cache module</a>.','','none'),(8411,_binary 'The module requires no configuration. Every part of the page contains metadata that allows Internal Dynamic Page Cache to figure this out on its own.','','none'),(8412,_binary 'Deprecated. All the functionality has been moved to Core.','','none'),(8413,_binary 'All field storage configuration objects re-saved.','','none'),(8414,_binary 'Selection handler for entity reference fields have been adjusted.','','none'),(8415,_binary '<strong>Entity Reference</strong> fields allow you to create fields that contain links to other entities (such as content items, taxonomy terms, etc.) within the site. This allows you, for example, to include a link to a user within a content item. For more information, see <a href=\":er_do\">the online documentation for the Entity Reference module</a>.','','none'),(8416,_binary 'Enable custom storage','','none'),(8417,_binary 'An instance-specific widget type','','none'),(8418,_binary 'Widget types @types are used in Drupal 6 field instances: widget type @selected_type applied to the Drupal 8 base field','','none'),(8419,_binary 'The Filter module allows administrators to configure text formats. Text formats change how HTML tags and other text will be <em>processed and displayed</em> in the site. They are used to transform text, and also help to defend your web site against potentially damaging input from malicious users. Visual text editors can be associated with text formats by using the <a href=\":editor_help\">Text Editor module</a>. For more information, see the <a href=\":filter_do\">online documentation for the Filter module</a>.','','none'),(8420,_binary 'You can define which users will be able to use each text format by selecting roles. To ensure security, anonymous and untrusted users should only have access to text formats that restrict them to either plain text or a safe set of HTML tags. This is because HTML tags can allow embedding malicious links or scripts in text. More trusted registered users may be granted permission to use less restrictive text formats in order to create rich text. <strong>Improper text format configuration is a security risk.</strong>','','none'),(8421,_binary 'Each text format uses filters that add, remove, or transform elements within user-entered text. For example, one filter removes unapproved HTML tags, while another transforms URLs into clickable links. Filters are applied in a specific order. They do not change the <em>stored</em> content: they define how it is processed and displayed.','','none'),(8422,_binary 'Text formats define how text is filtered for output and how HTML tags and other text is displayed, replaced, or removed. <strong>Improper text format configuration is a security risk.</strong> Learn more on the <a href=\":filter_help\">Filter module help page</a>.','','none'),(8423,_binary 'A text format contains filters that change the display of user input; for example, stripping out malicious HTML or making URLs clickable. Filters are executed from top to bottom and the order is important, since one filter may prevent another filter from doing its job. For example, when URLs are converted into links before disallowed HTML tags are removed, all links may be removed. When this happens, the order of filters may need to be rearranged.','','none'),(8424,_binary 'Configure how content is filtered when displayed, including which HTML tags are rendered, and enable module-provided filters.','','none'),(8425,_binary 'A list of HTML tags that can be used. By default only the <em>lang</em> and <em>dir</em> attributes are allowed for all HTML tags. Each HTML tag may have attributes which are treated as allowed attribute names for that HTML tag. Each attribute may allow all values, or only allow specific values. Attribute names or values may be written as a prefix and wildcard like <em>jump-*</em>. JavaScript event attributes, JavaScript URLs, and CSS are always stripped.','','none'),(8426,_binary 'Overriding default English strings','','none'),(8427,_binary 'If translation is enabled for English, you can <em>override</em> the default English interface text strings in your site with other English text strings on the <a href=\":translate\">User interface translation</a> page. Translation is off by default for English, but you can turn it on by visiting the <em>Edit language</em> page for <em>English</em> from the <a href=\":languages\">Languages</a> page.','','none'),(8428,_binary '<q>Log in</q> for anonymous users','','none'),(8429,_binary 'Revert to earlier revision of a translation','','none'),(8430,_binary '@langname revisions for %title','','none'),(8431,_binary 'Are you sure you want to revert @language translation to the revision from %revision-date?','','none'),(8432,_binary 'Revert content shared among translations','','none'),(8433,_binary 'Network problem!','','none'),(8434,_binary '- None (original image) -','','none'),(8435,_binary 'Only items in the index will appear in search results. To build and maintain the index, a correctly configured <a href=\":cron\">cron maintenance task</a> is required.','','none'),(8436,_binary 'The maximum number of items indexed in each run of the <a href=\":cron\">cron maintenance task</a>. If necessary, reduce the number of items to prevent timeouts and memory errors while indexing. Some search page types may have their own setting for this.','','none'),(8437,_binary 'The minimum character length for a word to be added to the index. Searches must include a keyword of at least this length.','','none'),(8438,_binary 'Run tests against the site\'s core code and enabled modules to review your code.','','none'),(8439,_binary 'Configure the logging of content statistics.','','none'),(8440,_binary 'Configuration dependencies recalculated','','none'),(8441,_binary 'Checking site status','','none'),(8442,_binary 'The <a href=\":status\">Status report</a> provides an overview of the configuration, status, and health of your site. Review this report to make sure there are not any problems to address, and to find information about the software your site and web server are using.','','none'),(8443,_binary 'In order for the site and its modules to continue to operate well, a set of routine administrative operations must run on a regular basis; these operations are known as <em>cron</em> tasks. On the <a href=\":cron\">Cron page</a>, you can configure cron to run periodically as part of server responses by installing the <em>Automated Cron</em> module, or you can turn this off and trigger cron from an outside process on your web server. You can verify the status of cron tasks by visiting the <a href=\":status\">Status report page</a>. For more information, see the <a href=\":handbook\">online documentation for configuring cron jobs</a>.','','none'),(8444,_binary 'Enable the <em>Automated Cron</em> module to allow cron execution at the end of a server response.','','none'),(8445,_binary 'The following reason prevents @module.module_name from being uninstalled:The following reasons prevent @module.module_name from being uninstalled:','','none'),(8446,_binary 'Too many failed login attempts from your IP address. This IP address is temporarily blocked. Try again later or <a href=\":url\">request a new password</a>.','','none'),(8447,_binary 'There has been more than one failed login attempt for this account. It is temporarily blocked. Try again later or <a href=\":url\">request a new password</a>.There have been more than @count failed login attempts for this account. It is temporarily blocked. Try again later or <a href=\":url\">request a new password</a>.','','none'),(8448,_binary '%name is not recognized as a username or an email address.','','none'),(8449,_binary 'Cache maximum age','','none'),(8450,_binary 'Creating and managing views','','none'),(8451,_binary 'Enabling and disabling views','','none'),(8452,_binary 'Exporting and importing views','','none'),(8453,_binary 'Stable','','none'),(8454,_binary 'The language code.','','none'),(8455,_binary 'Delete %label','','none'),(8456,_binary 'Allow user to display all items','','none'),(8457,_binary 'Resolve all issues below to continue the installation. For help configuring your database server, see the <a href=\"https://www.drupal.org/getting-started/install\">installation handbook</a>, or contact your hosting provider.','','none'),(8458,_binary 'Aggregator RSS feed','','none'),(8459,_binary 'Aggregator sources','','none'),(8460,_binary 'Find and manage custom blocks.','','none'),(8461,_binary 'Recent comments.','','none'),(8462,_binary 'Find and manage files.','','none'),(8463,_binary 'Editing languages','','none'),(8464,_binary 'All content, by month.','','none'),(8465,_binary 'Recent content.','','none'),(8466,_binary 'All content promoted to the front page.','','none'),(8467,_binary 'All content, by letter.','','none'),(8468,_binary 'Content belonging to a certain taxonomy term.','','none'),(8469,_binary 'Shows a list of the newest user accounts on the site.','','none'),(8470,_binary 'Who\'s online block','','none'),(8471,_binary 'Shows the user names of the most recently active users, and the total number of active users.','','none'),(8472,_binary 'View edit page','','none'),(8473,_binary 'Max 1300x1300','','none'),(8474,_binary 'Max 2600x2600','','none'),(8475,_binary 'Max 325x325','','none'),(8476,_binary 'Max 650x650','','none'),(8477,_binary 'Narrow','','none'),(8478,_binary 'Config override test','','none'),(8479,_binary 'Files overview','','none'),(8480,_binary 'File usage information for {{ arguments.fid }}','','none'),(8481,_binary '<p>This page provides the ability to add common languages to your site.</p><p>If the desired language is not available, you can add a custom language.</p>','','none'),(8482,_binary '<p>Choose a language from the list, or choose \"Custom language...\" at the end of the list.</p><p>Click the \"Add language\" button when you are done choosing your language.</p><p>When adding a custom language, you will get an additional form where you can provide the name, code, and direction of the language.</p>','','none'),(8483,_binary 'Continuing on','','none'),(8484,_binary '<p>This page provides the ability to edit a language on your site, including custom languages.</p>','','none'),(8485,_binary '<p>You cannot change the code of a language on the site, since it is used by the system to keep track of the language.</p>','','none'),(8486,_binary '<p>The language name is used throughout the site for all users and is written in English. Names of built-in languages can be translated using the Interface Translation module, and names of both built-in and custom languages can be translated using the Configuration Translation module.</p>','','none'),(8487,_binary '<p>Choose if the language is a \"Left to right\" or \"Right to left\" language.</p><p>Note that not all themes support \"Right to left\" layouts, so test your theme if you are using \"Right to left\".</p>','','none'),(8488,_binary '<p>The \"Languages\" page allows you to add, edit, delete, and reorder languages for the site.</p>','','none'),(8489,_binary '<p>To add more languages to your site, click the \"Add language\" button.</p><p>Added languages will be displayed in the language list and can then be edited or deleted.</p>','','none'),(8490,_binary 'Reordering languages','','none'),(8491,_binary '<p>To reorder the languages on your site, use the drag icons next to each language.</p><p>The order shown here is the display order for language lists on the site such as in the language switcher blocks provided by the Interface Translation and Content Translation modules.</p><p>When you are done with reordering the languages, click the \"Save configuration\" button for the changes to take effect.</p>','','none'),(8492,_binary 'Set a language as default','','none'),(8493,_binary '<p>You can change the default language of the site by choosing one of your configured languages as default. The site will use the default language in situations where no choice is made but a language should be set, for example as the language of the displayed interface.</p>','','none'),(8494,_binary 'Modifying languages','','none'),(8495,_binary '<p>Operations are provided for editing and deleting your languages.</p><p>You can edit the name and the direction of the language.</p><p>Deleted languages can be added back at a later time. Deleting a language will remove all interface translations associated with it, and content in this language will be set to be language neutral. Note that you cannot delete the default language of the site.</p>','','none'),(8496,_binary 'Choose the language you want to translate.','','none'),(8497,_binary 'Enter the specific word or sentence you want to translate, you can also write just a part of a word.','','none'),(8498,_binary 'Filter the search','','none'),(8499,_binary 'You can search for untranslated strings if you want to translate something that isn\'t translated yet. If you want to modify an existing translation, you might want to search only for translated strings.','','none'),(8500,_binary 'Apply your search criteria','','none'),(8501,_binary 'To apply your search criteria, click on the <em>Filter</em> button.','','none'),(8502,_binary 'You can write your own translation in the text fields of the right column. Try to figure out in which context the text will be used in order to translate it in the appropriate way.','','none'),(8503,_binary 'Validate the translation','','none'),(8504,_binary 'When you have finished your translations, click on the <em>Save translations</em> button. You must save your translations, each time before changing the page or making a new searc