ilizado para ordenar los resultados de búsqueda. Un número más alto significa que el factor correspondiente tiene más influencia en los resultados de búsqueda; cero significa que el factor se ignora. La modificación de estos números no requiere que el índice de búsqueda sea reconstruido. Los cambios surten efecto inmediatamente.','es',1),(6370,_binary 'Buscar el tipo de página','es',1),(6371,_binary '- Seleccionar el tipo de página -','es',1),(6372,_binary 'No se ha configurado ninguna página de búsqueda.','es',1),(6373,_binary 'Usted debe seleccionar un nuevo tipo de página de búsqueda.','es',1),(6374,_binary 'Editar la página de búsqueda %label','es',1),(6375,_binary 'La página de búsqueda %label se ha activado.','es',1),(6376,_binary 'La página de búsqueda %label se ha desactivado.','es',1),(6377,_binary 'La página de búsqueda predeterminada es ahora %label. Asegúrese de comprobar el orden de sus páginas de búsqueda.','es',1),(6378,_binary 'La página de búsqueda %label se ha añadido.','es',1),(6379,_binary 'Guardar la página de búsqueda','es',1),(6380,_binary 'La página de búsqueda %label se ha actualizado.','es',1),(6381,_binary 'La etiqueta para esta página de búsqueda.','es',1),(6382,_binary 'La ruta de la página de búsqueda debe ser única.','es',1),(6383,_binary 'Administrar y mostrar los campos de texto','es',1),(6384,_binary 'Creando campos de texto cortos.','es',1),(6385,_binary 'Creando campos de texto largos.','es',1),(6386,_binary 'Recortando la longitud del texto','es',1),(6387,_binary 'En la página <em>Gestionar visualización</em> puede elegir mostrar una versión recortada del texto, y en ese caso, dónde cortar el texto.','es',1),(6388,_binary 'Mostrar resúmenes en lugar del texto recortado','es',1),(6389,_binary 'Usando formatos de textos y editores','es',1),(6390,_binary 'Esta vista se mostrará al visitar esta ruta en su sitio. Puede utilizar \"%\" en la URL para representar valores que serán utilizados para filtros contextuales: Por ejemplo, \"node/%/feed\". Si es necesario se puede incluso especificar parámetros de ruta nombradas como: taxonomy/term/%taxonomy_term','es',1),(6391,_binary 'Izquierda','es',1),(6392,_binary 'Centrado','es',1),(6393,_binary 'Derecha','es',1),(6394,_binary 'Etiqueta de estado','es',1),(6395,_binary '%name: no puede ser mayor que de @max los caracteres.','es',1),(6396,_binary 'Integración <abbr title=\"Outline Processor Markup Language\">OPML</abbr>','es',1),(6397,_binary 'Un punto de interrupción separa la altura o la anchura de las ventanas gráficas (pantallas, impresoras y otros tipos de salida de los medios de comunicación) en pasos. Por ejemplo, un punto de interrupción con anchura de 40em crea dos pasos: uno para anchos de hasta 40em y uno para anchos anteriores 40em. Los puntos de interrupción se pueden utilizar para definir cuándo los diseños deben cambiar de una forma a otra, cuando las imágenes deben cambiar de tamaño y otros cambios que se necesitan para responder a los cambios en la altura o anchura de la ventana gráfica.','es',1),(6398,_binary 'Multiplicador de resolución','es',1),(6399,_binary 'Los Multiplicadores de resolución son una medida de la resolución de la ventana del dispositivo, que se define como la relación entre el tamaño de pixel físico del dispositivo activo y el <a href=\"http://en.wikipedia.org/wiki/Device_independent_pixel\"> pixel independiente del tamaño de dispositivo </a>. El módulo Breakpoint define multiplicadores de 1, 1,5 y 2; al definir puntos de interrupción, los módulos y los temas pueden definir qué multiplicadores se aplican a cada punto de interrupción.','es',1),(6400,_binary 'Definiendo saltos de pantalla (breakpoint) y grupos de saltos de pantalla','es',1),(6401,_binary 'Los módulos y temas pueden usar el API provisto por el módulo Breakpoint para definir breakpoints y grupos de breakpoint, así como asignar multiplicadores de resolución a breakpoints.','es',1),(6402,_binary 'Nombre del autor del comentario\r\nen contexto: Validación','es',1),(6403,_binary 'Cambiar el formato de texto a %text_format eliminará permanentemente el contenido que no está permitido en ese formato de texto.<br><br>Guarde sus datos antes de cambiar el formato de texto para evitar perder datos.','es',1),(6404,_binary '¿Cambiar el formato de texto?','es',1),(6405,_binary 'Gestionando y visualizando los campos de referencia de la entidad','es',1),(6406,_binary 'Seleccionando tipo de referencia','es',1),(6407,_binary 'En las configuraciones de campo puede seleccionar a qué tipo de entidad usted desea crear una referencia.','es',1),(6408,_binary 'Filtrando y ordenando los campos de referencia','es',1),(6409,_binary 'Dependiendo del tipo de entidad elegida, el filtrado adicional y las opciones de ordenación están disponibles para la lista de entidades a las que se puede hacer referencia, en las configuraciones del campo. Por ejemplo, la lista de usuarios puede filtrarse por roles y ordenarse por nombre o ID.','es',1),(6410,_binary 'Mostrar una referencia','es',1),(6411,_binary 'Una entidad de referencia puede ser mostrada como una etiqueta simple con o sin un enlace a la entidad. Alternativamente, la entidad referenciada puede ser mostrada como un resumen (o cualquier otro modo de vista disponible) dentro de la entidad referenciada.','es',1),(6412,_binary 'Administrando formatos de texto','es',1),(6413,_binary 'Asignando roles a los formatos de texto','es',1),(6414,_binary 'Filtros seleccionados','es',1),(6415,_binary 'Cada filtro puede tener opciones de configuración adicionales. Por ejemplo, para el filtro \"Límite de etiquetas HTML permitidas\" se necesita definir la lista de etiquetas HTML que el filtro deja en el texto.','es',1),(6416,_binary 'Cuando estés creando o editando datos en un campo que tiene formatos de texto activados, los usuarios pueden seleccionar el formato bajo el campo desde la lista de selección de formato de texto.','es',1),(6417,_binary 'Comportamiento al importar','es',1),(6418,_binary 'Las palabras