ede traducir una entidad de contenido a través de la pestaña Traducir (o el enlace Traducir). La página de Traducciones de una entidad de contenido ofrece una visión general del estado de la traducción para el contenido actual y le permite añadir, editar y borrar sus traducciones. Este proceso es similar para todas las entidades de contenido traducible en su sitio.','es',1),(7026,_binary 'Cambiando el idioma de origen de una traducción','es',1),(7027,_binary 'Cuando se añade una nueva traducción, el texto original que se está traduciendo aparece en el formulario de edición como el <em>origen</em>. Si existe al menos una traducción del contenido original cuando se añade una nueva traducción, se puede elegir entre el contenido original (por defecto) o una de las otras traducciones como origen, utilizando la lista de selección en la sección  origen del idioma. Después de guardar la traducción, el idioma de origen elegido aparecerá en la pestaña de traducción del contenido.','es',1),(7028,_binary 'Estableciendo el estado de las traducciones','es',1),(7029,_binary 'Si edita la traducción en un idioma, quizá desee establecer el estado de las demás traducciones como <em>obsoleto</em>. Puede establecer este estado marcando la casilla <em>Marcar las demás traducciones como obsoletas</em> en la sección de traducción del formulario de edición del contenido. El estado será visible en la página de traducciones.','es',1),(7030,_binary 'Gestionando y mostrando campos de fecha','es',1),(7031,_binary 'Mostrando fechas','es',1),(7032,_binary 'Ene','es',1),(7033,_binary 'Feb','es',1),(7034,_binary 'Mar','es',1),(7035,_binary 'Abr','es',1),(7036,_binary 'May','es',1),(7037,_binary 'Jun','es',1),(7038,_binary 'Jul','es',1),(7039,_binary 'Ago','es',1),(7040,_binary 'Sep','es',1),(7041,_binary 'Oct','es',1),(7042,_binary 'Nov','es',1),(7043,_binary 'Dic','es',1),(7044,_binary 'Dom','es',1),(7045,_binary 'Lun','es',1),(7046,_binary 'Mar','es',1),(7047,_binary 'Mié','es',1),(7048,_binary 'J