sados por los módulos para determinar el idioma de un usuario. También se puede usar para los textos de la interfaz, si el método <em>Usuario</em> está activado como un método <em>Detección y selección</em> (Vease más abajo). Los usuarios administrativos pueden escoger un <em>Idioma de páginas de administración</em> separado para el texto de la interfaz en páginas de administración. Esta configuración sólo está disponible en la página de perfil del usuario si el método <em>Páginas de cuentas de administración</em> está activado (véase más abajo).','es',1),(7082,_binary '<em>URL</em> establece el idioma de la interfaz en base al prefijo de la ruta o el dominio (por ejemplo, si se especifica <em>de</em> para alemán, se obtendrán URL como <em>example.com/de/contact</em>). El idioma predeterminado no necesita un prefijo de ruta, pero se le puede asignar uno. Si la detección de idioma se realiza por el nombre de dominio, hay que especificar un dominio para cada idioma.','es',1),(7083,_binary '<em>Sesión</em> determina el idioma de la interfaz mediante una solicitud o parámetro de sesión (por ejemplo, <em>example.com?language=de</em> establecería el idioma de la interfaz en alemán, basándose en el uso de <em>de</em> como parámetro de <em>idioma</em>).','es',1),(7084,_binary '<em>Usuario</em> adopta la configuración de idioma establecida en la página del perfil del usuario.','es',1),(7085,_binary '<em>Idioma seleccionado</em> le permite especificar el idioma predeterminado del sitio o un idioma específico como idioma de respaldo. Este método se debe colocar al final de la lista.','es',1),(7086,_binary 'La dirección email del autor del comentario del formulario de comentarios, si el usuario es anónimo y la opción \'Usuarios anónimos pueden/deben dejar sus información de contacto\' está activado.','es',1),(7087,_binary 'Lista separada con comas de las direcciones de correo electrónico de destino.','es',1),(7088,_binary 'Bloque de suscripción','es',1),(7089,_binary 'Edición in situ del contenido','es',1),(7090,_binary 'Una vez el modo edición rápida está activado, será capaz de editar los campo inviduales de su contenido. En el tema predeterminado, con un navegador con Javascript activado y un ratón, la salida de los diferentes campos de su contenido se rodeará con un linea en azul, un mensaje emergente le da el nombre del campo cuando pase el ratón sobre la salida del campo y haciendo en el campo se activará el editor. Cerrando la ventana emergente finaliza el modo de edición rápida.','es',1),(7091,_binary 'Configuración de Diff','es',1),(7092,_binary 'Número de líneas principales en un diff','es',1),(7093,_binary 'Número de lineas arrastras en un diff','es',1),(7094,_binary 'Bloque de la marca','es',1),(7095,_binary 'Usar el logotipo del sitio','es',1),(7096,_binary 'El tema actual no es @theme','es',1),(7097,_binary 'El tema actual es @theme','es',1),(7098,_binary 'No devolver verdadero en las siguientes páginas: @pages','es',1),(7099,_binary 'Devolver verdadero en las siguientes páginas: @pages','es',1),(7100,_binary 'Ruta de solicitud','es',1),(7101,_binary 'Nombre de usuario o correo electrónico','es',1),(7102,_binary 'Direcciones de correo electrónico a las que notificar las actualizaciones disponibles','es',1),(7103,_binary 'Umbral de notificaciones por correo electrónico','es',1),(7104,_binary 'Cada vez que su sitio compruebe si hay nuevas actualizaciones disponibles y encuentre nuevas versiones, puede notificar a una lista de usuarios a traves de correo electrónico. Coloque cada dirección en una línea separada. Si lo deja en blanco, no se enviará ningun correo.','es',1),(7105,_binary '%email no es un correo electrónico válido.','es',1),(7106,_binary '%emails no son direcciones de correo electrónico válidas.','es',1),(7107,_binary 'Configurando roles de usuario','es',1),(7108,_binary 'Configurando permisos','es',1),(7109,_binary 'Gestionando configuración de cuenta','es',1),(7110,_binary 'Esta página web permite a los administr