n de acuerdo con las directrices de HTML5.','es',1),(7369,_binary 'Opciones del campo OPML','es',1),(7370,_binary 'Prueba de multilenguaje','es',1),(7371,_binary 'Perfil de instalación ḿínimo para lanzar pruebas con un instalador multilenguaje,','es',1),(7372,_binary 'Silenciado','es',1),(7373,_binary 'Este bloque está deteriorado o desaparecido. Puede que esté perdiendo contenido. Es posible que tenga que activar el módulo original.','es',1),(7374,_binary 'Roto/Desaparecido','es',1),(7375,_binary 'Referencia de entidad hace referencia a acceso en contexto: Validación','es',1),(7376,_binary 'Usted no posee acceso a la entidad referenciada (%type: %id).','es',1),(7377,_binary 'Correo electrónico','es',1),(7378,_binary 'Muchos sitios publican sus titulares y mensajes en canales, utilizando un número de formatos basados en XML estandarizado. El agregador soporta <a href=\"http://en.wikipedia.org/wiki/Rss\">RSS</a>, <a href=\"http://en.wikipedia.org/wiki/Resource_Description_Framework\">RDF</a>, y <a href=\"http://en.wikipedia.org/wiki/Atom_%28standard%29\">Atom</a>.','es',1),(7379,_binary 'Editor de texto con formato, campo !label','es',1),(7380,_binary 'Los comentarios son respuestas al contenido.','es',1),(7381,_binary 'Nombre del archivo: %name','es',1),(7382,_binary 'Nombre de usuario del destinatario','es',1),(7383,_binary 'Puede alinear imágenes (<code>data-align=\"center\"</code>) pero también videos, citas, y demás.','es',1),(7384,_binary 'No sólo puede subtitular imágenes (<code>data-caption=\"Text\"</code>), sino también videos, blockquotes, y mucho más.','es',1),(7385,_binary 'Para la accesibilidad y la optimización de los motores de búsqueda, todas las imágenes que tienen un significado en los sitios web deben tener un texto alternativo. Drupal también permite la entrada de texto del título para las imágenes, pero puede llevar a la confusión para los usuarios con lectores de pantalla y no se recomienda su uso. Los campos de imagen se pueden configurar de modo que los campos se alternan y el título de texto están activados o desactivados; si está activado, los campos se pueden configurar para ser requerido. La configuración recomendada es permitir y requerir texto alternativo y desactivar el texto del título.','es',1),(7386,_binary 'Se recomienda hacer este campo obligatorio.','es',1),(7387,_binary 'El atributo título se usa como información adicional cuando el ratón pasa por encima de la imagen. No se recomienda activar este campo, ya que puede causar problema con los lectores de pantalla.','es',1),(7388,_binary 'Ha fallado la conversión utilizando la herramienta %toolkit en %path (%mimetype)','es',1),(7389,_binary 'Convierte una imagen a otra extensión (por ejemplo, de PNG a JPEG).','es',1),(7390,_binary 'El dominio no puede dejarse en blanco para %language.','es',1),(7391,_binary '¿Salir de la vista previa?','es',1),(7392,_binary 'Salir de la vista previa','es',1),(7393,_binary 'La salida de la vista previa provocará la pérdida de los cambios no guardados. ¿Está seguro de que desea abandonar la vista previa?','es',1),(7394,_binary 'CTRL+Clic izquierdo evitará que aparezca este diálogo e irá directamente al enlace pulsado.','es',1),(7395,_binary 'El nombre legible de este tipo de contenido. Este texto aparecerá como parte de los listados en la página <em>Añadir contenido</em>. Debe ser un nombre único.','es',1),(7396,_binary 'Buscar por @keywords','es',1),(7397,_binary 'Ordena a la herramienta que guarde la imagen con una extensión determinada.','es',1),(7398,_binary 'Establecer una imagen nueva','es',1),(7399,_binary 'Crea un nuevo recurso transparente y lo establece para la imagen.','es',1),(7400,_binary 'El texto con el formato de texto aplicado.','es',1),(7401,_binary 'Resumen procesado','es',1),(7402,_binary 'El texto del resumen con el formato de texto aplicado.','es',1),(7403,_binary 'Las pestañas son botones, mostradas en una barra a través de la parte superior de la pantalla. Algunas pestañas ejecutan una acción (Como arrancar el modo de edición), mientras que otras pestañas alternan que bandeja está abierta.','es',1),(7404,_binary 'Bandejas','es',1),(7405,_binary 'Las bandejas son normalmente listas de enlaces, que pueden ser jerárquicas como los menus. Si una bandeja ha sido colocada como abierta, se muestrará o verticalmento o horizontalmente debajor de la barra de pestañas, dependiendo de la anchura del navegador. Solo puede estar abierta una bandeja a la vez. Si hace clic en otra pestaña, esa bandaja reemplazará la bandeja que esté siendo visualizada. En navegadores muy anchos el usuario tiene la abilidad de alternar entre vertical y horizontal usando un enlace en la parte inferior o justo en la pestaña. Los menus jerárquicps solo tienen un comportamiento abierto/cerrado en modo vertical; si muestra una bandeja conteniendo un menú jerárquico horizontalmente, solo los enlaces de nivel superior estarán disponibles.','es',1),(7406,_binary 'Su cuenta ha sido bloqueada y ya no se podrá conectar. Todo su contenido permanecerá atribuido a su nombre se usuario.','es',1),(7407,_binary 'Idioma original de la información de usuario','es',1),(7408,_binary 'Idioma de la traducción de la información de usuario','es',1),(7409,_binary 'Idioma preferido del usuario','es',1),(7410,_binary 'Idioma de administración preferido','es',1),(7411,_binary 'Idioma administrativo preferido por el usuario','es',1),(7412,_binary 'Metadatos de caché.','es',1),(7413,_binary 'Contextos de caché','es',1),(7414,_binary 'La ruta está vacía.','es',1),(7415,_binary 'No se permite consulta.','es',1),(7416,_binary 'Ruta no válida. Los caracteres válidos son, alfanuméricos, así como también \"-\", \".\", \"_\" y \"~\".','es',1),(7417,_binary 'Con clase','es',1),(7418,_binary 'Recorrido','es',1),(7419,_binary 'Recorridos','es',1),(7420,_binary 'Constructor de diseños.','es',1),(7421,_binary 'Seleccionar un valor @context:','es',1),(7422,_binary 'Número de índices plurales en este idioma.','es',1),(7423,_binary 'Dominio a usar para este idioma.','es',1),(7424,_binary 'Dependencias de la entidad de configuración','es',1),(7425,_binary 'Dependencias de la entidad de contenido','es',1),(7426,_binary 'Dependencias de la configuración forzada','es',1),(7427,_binary 'Configuración de cadena de texto (larga)','es',1),(7428,_binary 'Configuración de URI','es',1),(7429,_binary 'Configuración de la fecha de creación','es',1),(7430,_binary 'Configuración de la fecha de modificación','es',1),(7431,_binary 'Si hay más de una aplicación compartiendo esta base de datos, un prefijo de tablas único – como %prefix – evitará conflictos.','es',1),(7432,_binary 'El nombre del autor del comentario.','es',1),(7433,_binary 'botón de enlaces contextuales','es',1),(7434,_binary 'Mapeado de idioma de navegador no disponible.','es',1),(7435,_binary 'La definición del código de idioma del navegador %browser se ha eliminado.','es',1),(7436,_binary 'La detección de mapeo de idioma del navegador para el código de idioma del navegador %browser ha sido borrado.','es',1),(7437,_binary 'El nombre de usuario o autor. Este filtro no comprueba si el usuario existe, y permite coincidencias parciales. No utiliza autocompletado.','es',1),(7438,_binary 'Página @items.current','es',1),(7439,_binary 'El estilo o formato de fila seleccionado no utiliza campos.','es',1),(7440,_binary 'El tipo de visualización seleccionado no utiliza extensiones @type','es',1),(7441,_binary 'El tipo de entidad','es',1),(7442,_binary 'ID del tipo de entidad','es',1),(7443,_binary 'Regex\r\nen contexto: Validación','es',1),(7444,_binary 'Configurar estilos de imagen','es',1),(7445,_binary 'Tamaño de almacenamiento de la Base de datos','es',1),(7446,_binary 'Texto con formato de texto','es',1),(7447,_binary 'Controles de campo','es',1),(7448,_binary 'Control de campo','es',1),(7449,_binary 'Nombre del sistema del tipo de control','es',1),(7450,_binary 'Opciones de formato de presentación del área de texto','es',1),(7451,_binary 'Opciones de formato de presentación del campo de correo electrónico','es',1),(7452,_binary 'Enlace a la entidad','es',1),(7453,_binary 'Sincronizando extensiones: @op @name.','es',1),(7454,_binary 'Enlazado a @entity_label','es',1),(7455,_binary 'Página simple','es',1),(7456,_binary 'Página con bloques','es',1),(7457,_binary 'Ir al primer comentario.','es',1),(7458,_binary 'Ir al primer comentario nuevo.','es',1),(7459,_binary 'Comparte tus ideas y opiniones.','es',1),(7460,_binary 'Ajustes de contenido de la traducción del contenido','es',1),(7461,_binary 'Traducción del contenido activada','es',1),(7462,_binary 'Tipo de fecha predeterminada','es',1),(7463,_binary 'Valor de la fecha predeterminada','es',1),(7464,_binary 'Persiste almacenamiento de campo sin campos','es',1),(7465,_binary 'Agrupar por columna','es',1),(7466,_binary 'Agrupar por columnas','es',1),(7467,_binary 'Reutilizar un campo existente','es',1),(7468,_binary 'Debe seleccionar un tipo de campo o un campo existente.','es',1),(7469,_binary 'Añadir un nuevo campo y reutilizar un campo existente al mismo tiempo no está permitido.','es',1),(7470,_binary 'Proporciona una extensión de filtro que está en uso en el siguiente filtro de formatos: %formats','es',1),(7471,_binary 'Inicie sesión para publicar nuevo contenido en el foro.','es',1),(7472,_binary 'Proporcionando ayuda específica de página','es',1),(7473,_binary 'Configuraciones  de efectos.','es',1),(7474,_binary 'Permitir modificar el idioma','es',1),(7475,_binary 'Influencia de \'@title\'','es',1),(7476,_binary 'Instalando módulos de soporte','es',1),(7477,_binary 'Configuración predeterminada de la indexación','es',1),(7478,_binary '<p>Las páginas de búsqueda que usan un índice puede usar el índice predeterminado proporcionado por el módulo Search o pueden usar un mecanismo de indexado diferente. Estas opciones son para el índice predeterminado.<em>Cambiar esas opciones causará la reconstrucción del índice de búsqueda predeterminado para reflejar las nuevas opciones. Las búsquedas seguirán funcionando, basado en el índice existente, pero el nuevo contenido no será indexado hasta que todo el contenido existente haya sido reindexado.</em></p><p><em>Las opciones predeterminadas deberían ser apropiados para la mayoría de sitios.</em></p>','es',1),(7479,_binary 'El índice de búsqueda predeterminado se reconstruirá.','es',1),(7480,_binary 'Esto re-indexará el contenido en los índices de búsqueda de todas las páginas de búsqueda activas. La búsqueda continuará funcionando, pero el nuevo contenido no será indexado hasta que todo el contenido existente haya sido re-indexado. Esta acción no se puede deshacer.','es',1),(7481,_binary 'Todos los índices de búsqueda se reconstruirán.','es',1),(7482,_binary 'Añadir enlace de acceso directo','es',1),(7483,_binary 'Ajustes del bloque contenido popular','es',1),(7484,_binary 'Número de día\\s más vistos a mostrar','es',1),(7485,_binary 'Estado de publicación','es',1),(7486,_binary 'Si un contenido relativo a un termino es publicado o no.','es',1),(7487,_binary 'Advertencia de actualización importante','es',1),(7488,_binary 'Esta actualización es una actualización a una version superior lo cual quiere decir que puede no ser compatible con su version actual. Es recomendable que lea las notas de lanzamiento y proceda bajo su propio riesgo.','es',1),(7489,_binary 'Campo de datos de usuario','es',1),(7490,_binary 'Solamente los usuarios con el indicador de permiso seleccionado podrán acceder a esta pantalla.','es',1),(7491,_binary 'Solamente los roles releccionados serán capaces de acceder a esta pantalla.','es',1),(7492,_binary 'El texto formateado del área','es',1),(7493,_binary 'El campo correspondiente de la entidad','es',1),(7494,_binary 'La ID de la extensión','es',1),(7495,_binary 'Opciones de fila','es',1),(7496,_binary 'Mostrar opciones del extensor de ajustes','es',1),(7497,_binary 'Ver bloque','es',1),(7498,_binary 'Opciones de presentación del formato de número entero','es',1),(7499,_binary 'Enlace de menu estático anulado','es',1),(7500,_binary 'Existen entidades de tipo %entity_type y %bundle %bundle_label. Estas entidades necesitan ser borradas antes de importar.','es',1),(7501,_binary 'Título de fuente','es',1),(7502,_binary 'Una fuente llamada %value ya existe anteriormente. Introduzca un título único.','es',1),(7503,_binary 'URL de la fuente\r\nen contexto: Validación','es',1),(7504,_binary 'Una fuente con esta URL %value ya existe anteriormente. Introduzca un título único.','es',1),(7505,_binary 'Desactivado en contexto: Plural','es',1),(7506,_binary 'El código de idioma del idioma del comentario en el que está escrito.','es',1),(7507,_binary 'El código de idioma del mensaje.','es',1),(7508,_binary 'El idioma fuente para el que se ha creado esta traducción.','es',1),(7509,_binary 'El autor de esta traducción','es',1),(7510,_binary 'Un tipo de dato lógico indicando si la traducción es visible a los no traductores.','es',1),(7511,_binary 'El timestamp de Unix cuando se creó la traducción.','es',1),(7512,_binary 'El timestamp de Unix cuando la traducción fue guardada más recientemente.','es',1),(7513,_binary 'Se requiere texto alternativo.<br />(Solo en raros casos debería dejarse vacío. Para crear texto alternativo vacío, introduzca <code>\"\"</code> - dos comillas dobles sin ningún contenido).','es',1),(7514,_binary 'Entidades y tipos de entidad','es',1),(7515,_binary 'El contenido y la configuración de la página web se gestiona mediante <em>entidades</em>, que se agrupan en <em>tipos de entidad</em>. <em>Los tipos de entidad de contenido</em> son los tipos de entidad para el contenido del sitio (como el contenido principal del sitio, los comentarios, los bloques personalizados, términos de la taxonomía, y las cuentas de usuario). <em>Los tipos de entidad de configuración</em> se utilizan para almacenar información de configuración de su sitio, como por ejemplo visitas individuales en el módulo de Vistas y la configuración de sus principales tipos de contenido de sitio.','es',1),(7516,_binary 'Subtipos de entidad','es',1),(7517,_binary 'Algunos tipos de entidades de contenidos se agrupan en sub-tipos (por ejemplo, podría tener tipos de artículos y contenido de la página dentro del tipo de entidad del sitio principal, y vocabularios de etiquetas y categorías dentro del tipo de entidad de términos de taxonomía); otros tipos de entidades, como cuentas de usuario, no tienen subtipos. Los programadores utilizan el término <em>bundle</em> para la entidad subtipos.','es',1),(7518,_binary 'Campos y tipos de campo','es',1),(7519,_binary 'Los tipos y subtipos de entidad de contenidos almacenan la mayor parte de su texto, archivos, y otra información en <em>campos</em>. Los campos que se agrupan por <em>tipos de campo</em>; los tipos de campo definen qué tipo de datos se pueden almacenar en ese campo, tales como texto, imágenes o referencias de términos de taxonomía.','es',1),(7520,_binary 'Formatos y modos de vista','es',1),(7521,_binary 'Los tipos y subtipos de entidad de contenido pueden tener uno o más <em>modos de visualización</em>, que se utiliza para la visualización de los elementos de entidad. Por ejemplo, un elemento de contenido puede ser visto en el modo completo en su propia página, modo resumido en una lista, o el modo de RSS en un feed. En cada modo de visualización, cada campo se puede ocultar o mostrar, y si se muestra, se puede elegir y configurar el <em>formateador</em> que se utiliza para mostrar el campo. Por ejemplo, un campo de texto largo puede mostrar recortados o de larga duración, y los campos de referencia plazo taxonomía se pueden visualizar en texto plano o vinculados a la página de término de taxonomía.','es',1),(7522,_binary 'Controles y modos de formulario','es',1),(7523,_binary 'Los tipos y subtipos de entidad de contenido pueden tener uno o más <em>modos de formulario</em>, utilizadas para la edición. Por ejemplo, un elemento de contenido puede ser editado en un formato compacto con sólo algunos campos editables, o un formato completo que permite a todos los campos ser editados. En cada modo de formulario, cada campo se puede ocultar o mostrar, y si se muestra, se puede elegir y configurar el <em>control de</em> que se utiliza para editar el campo. Por ejemplo, un campo de referencia de término de taxonomía se puede editar con una lista de selección, botones de radio, o un control de autocompletado.','es',1),(7524,_binary 'Habilitar tipos de campo, widgets y formatos','es',1),(7525,_binary 'Manejador del campo de entidad de vistas\r\nManejador de la entidad de vista de campo','es',1),(7526,_binary 'Creando un campo','es',1),(7527,_binary 'En la página de <em>Gestión de campos</em> para su tipo o subtipo de entidad, se puede añadir, configurar y eliminar campos para ese tipo o subtipo de entidad. Cada campo tiene un <em>nombre de máquina</em>, que se utiliza internamente para identificar el campo y debe ser único en un tipo de entidad; una vez que se crea un campo, no se puede cambiar el nombre de la máquina. La mayoría de los campos tienen dos tipos de ajustes. Los ajustes a nivel de campo dependen del tipo de campo, y afectan a cómo se almacenan los datos en el campo. Una vez que se establecen, ya no se pueden cambiar; ejemplos incluyen cuántos datos se permiten valores para el campo y donde se almacenan los archivos. Los ajustes de tipo sub-nivel son específicos de cada entidad sub-tipo del campo se utiliza en adelante, y que se pueden cambiar más adelante; ejemplos incluyen la etiqueta del campo, el texto de ayuda, valor predeterminado, y si el campo es obligatorio o no. Puede regresar a esta configuración seleccionando el enlace <em>Editar</em> para el campo de la página <em> Gestión de campos </em>.','es',1),(7528,_binary 'Reusando campos','es',1),(7529,_binary 'Una vez ha creado un campo, puede usarlo de nuevo en otros subtipos del mismo tipo de entidad. Por ejemplo: si crea un campo para el tipo de contenido artículo, puede usarlo para el tipo de contenido de página, pero no puede usarlos en bloques personalizados o en términos de taxonomía. Si hay campos disponibles para ser reutilizados, después de hacer clic en <em>Añadir campo</em> desde la página de <em>Gestión de campos</em>, verá una lista de campos disponibles para ser reutilizados. Después de seleccionar un campo para su reutilización, puede configurar sus opciones a nivel de subtipo.','es',1),(7530,_binary 'Configurar la edición de campos','es',1),(7531,_binary 'En la página de <em>Gestión de presentación de formularios</em> de su tipo o subtipo de entidad, puede configurar el modo en que los datos de campo son editados de forma predeterminada y en cada modo de formulario. Si su tipo de entidad tiene varios modos de formulario (en la mayoría de los sitios, la mayoría de entidades no los tienen), puede alternar entre los modos de formulario en la parte superior de la página, y usted puede cambiar si cada modo de formulario utiliza la configuración predeterminada o la configuración personalizada en la sección <em>Opciones de pantalla personalizado</em>. Para cada campo en cada modo de formulario, puede seleccionar el control a usar para la edición; algunos controles tienen opciones adicionales de configuración, como el tamaño de un campo de texto, y éstas se pueden editar con el botón Editar (que se parece a una rueda). También puede cambiar el orden de los campos del formulario. Puede excluir un campo de un formulario eligiendo <em>Oculto</em> de la lista desplegable de controles o arrastrándolo en la sección <em>Desactivado</em>.','es',1),(7532,_binary 'Configurar la presentación de campos','es',1),(7533,_binary 'En la página <em>Gestión de visualización</em> de su tipo o subtipo de entidad, puede configurar como se visualiza cada campo de forma predeterminada en cada modo de vista. Si su tipo de entidad tiene múltiple modos de vista, puede cambiar entre las opciones predeterminadas o las personalizadas en la sección <em>Opciones de visualización personalizadas</em>. Para cada campo en cada modo de vista, puede escoger si o como visualizar la etiqueta de campo desde la lista desplegable <em>Etiqueta</em>. Puede también seleccionar el formateador que va a utilizar para su visualización; algunos formateadores tiene opciones de configuración, que puede editar usando el botón Editar (el cual parece una rueda). Puede también cambiar el orden de visualización de campos. Puede excluir un campo de un modo de vista específico eligiendo <em>Oculto</em> de la lista desplegable de formateadores o arrastrándolo en la sección <em>Desactivado</em>.','es',1),(7534,_binary 'Configurar vista y modos de formulario','es',1),(7535,_binary 'Listando campos','es',1),(7536,_binary 'Las imágenes debe ser exactamente de <strong>@size</strong> píxeles.','es',1),(7537,_binary 'Las imágenes deben ser más grandes de <strong>@min</strong> pixels. La imágenes más largas de <strong>@max</strong> pixels se ajustarán de tamaño.','es',1),(7538,_binary 'Las imágenes deben ser mayores de <strong>@min</strong> píxeles.','es',1),(7539,_binary 'Las imágenes mayores de <strong>@max</strong> píxeles serán redimensionadas.','es',1),(7540,_binary 'Foro leaf\r\nen su contexto: Validación','es',1),(7541,_binary 'El código de idioma del enlace de menú.','es',1),(7542,_binary 'Nodo autorizado por (uid)','es',1),(7543,_binary 'Revisión autorizada por (uid)','es',1),(7544,_binary 'Conceder  acceso a la vista de contenido','es',1),(7545,_binary 'La localización a la que este acceso directo apunta','es',1),(7546,_binary 'No se puede instalar @extension, %config_names ya existe en la configuración activa.No se puede instalar @extension, %config_names ya existe en la configuración activa.','es',1),(7547,_binary 'No tiene acceso para ejecutar %action en el %entity_label @entity_type_label.','es',1),(7548,_binary 'estrecho','es',1),(7549,_binary 'No se encuentra la referencia a la vista %view_name.','es',1),(7550,_binary 'Habilitado','es',1),(7551,_binary 'Rastro de menu activo','es',1),(7552,_binary 'Actualizaciones de la configuración','es',1),(7553,_binary 'Se actualizará la configuración detallada.','es',1),(7554,_binary 'Un campo de entidad conteniendo un valor de contraseña.','es',1),(7555,_binary 'Un campo de texto de autorrellenado con capacidad de etiquetado.','es',1),(7556,_binary 'La fuente %label ha sido borrada.','es',1),(7557,_binary 'Revisión de contenido de bloques es un historial de cambios  al contenido de bloques.','es',1),(7558,_binary 'Obtiene contenido del bloque actual desde una revisión de contenido de bloque.','es',1),(7559,_binary 'El módulo Color guarda una copia modificada de hojas de estilo específicas del tema en el directorio de archivos. Si realiza cambios manuales de estilo de su tema, <em>debe guardar los ajustes de color de nuevo, incluso si no ha cambiado los colores</em>. Este paso es necesario porque las hojas de estilo de módulo en el directorio de archivos necesitan ser recreados para reflejar los cambios.','es',1),(7560,_binary 'Estilo de imagen adaptable %label guardado.','es',1),(7561,_binary 'Información de campo, controles y formateadores','es',1),(7562,_binary 'Proporcionado por módulos','es',1),(7563,_binary 'Aquí tiene una lista actualizada de los módulos activados de campo, formateadores y de control:','es',1),(7564,_binary 'Proporcionado por el core de Drupal.','es',1),(7565,_binary 'Tal y como se mencionó anteriormente, alguno tipos de campos, controls y formateadores son proporcionados por el core de Drupal. Aquí tiene algunas notas en como usar algunas de ellas:','es',1),(7566,_binary '<strong>Los campos numéricos</strong>: Cuando se agrega un campo numérico se puede elegir entre tres tipos: <em>decimal</em>, <em>float</em> y <em>entero</em>. El tipo de campo numérico <em> decimal</em> permite a los usuarios introducir valores exactos decimales, con un número fijo de decimales. El tipo de campo numérico <em>float</em>permite a los usuarios introducir valores decimales aproximados. El tipo de campo numérico <em>entero</em> permite a los usuarios introducir números enteros, como el año (por ejemplo, 2012) o valores completos (por ejemplo, 1, 2, 5, 305). No permite decimales.','es',1),(7567,_binary 'Definir estilos de imágenes','es',1),(7568,_binary 'Nombrando estilos de imágenes','es',1),(7569,_binary 'Cuando defina un estilo de imagen, tendrá que elegir un nombre que se muestre y un nombre de máquina. El nombre que se muestra aparece en las páginas administrativas, y el nombre de la máquina se utiliza para generar la URL con la que acceder a una imagen procesada en ese estilo. Hay dos enfoques comunes para nombrar estilos de imagen: ya sea a partir de los efectos que se aplican (por ejemplo, <em>Cuadro 85x85</em>), o en función de donde se va a utilizar (por ejemplo, <em>Foto de perfil</em>).','es',1),(7570,_binary 'Configurando campos de imagen','es',1),(7571,_binary 'Algunas de las opciones para los campos de imagen son definidas una vez cuando se crea el campo y no pueden ser cambiadas más tarde; estos incluyen la elección de almacenaje publica o privada y el número de imágenes que pueden ser guardados en el campo. El resto de las opciones pueden ser editadas más tarde, esas opciones incluyen la etiqueta de campo, el texto de ayuda, las extensiones de archivo permitidas, las restricciones de resolución de imagen y el subdirectorio de almacenado público o privado de archivos. Las opciones editables pueden también tener diferentes valores para diferentes subtipo de entidad, por ejemplo: si su campo de imagen es usado en los tipos de contenido Página y Artículo, puede almacenar los archivos en un subdirectorio diferente para los dos tipos de contenido.','es',1),(7572,_binary 'El tamaño máximo de archivo que se puede cargar está limitado por la configuración PHP del servidor, pero se puede restringir aún más ajustando un <em>tamaño máximo de carga<em> en los ajustes del campo (este ajuste se puede cambiar más adelante). El tamaño máximo de archivo, ya sea desde la configuración PHP del servidor o la configuración del campo, se muestra automáticamente a los usuarios en el texto de ayuda del campo de imagen.','es',1),(7573,_binary 'También puede configurar una imagen predeterminada que se utilizará si no hay imagen se carga en un campo de imagen. Este defecto se puede definir para todas las instancias del campo en la configuración de almacenamiento de campo al crear un campo, y el ajuste se puede anular para cada entidad sub-tipo que utiliza el campo.','es',1),(7574,_binary 'Configurando presentación y visualización de formularios','es',1),(7575,_binary 'En la página <em>Administrar visualización</em>, usted puede elegir el formato de imagen, que determina el estilo de imagen que se utiliza para mostrar la imagen en cada modo de visualización y si desea o no mostrar la imagen como un enlace. En la página de <em>Administrar forma de visualización</em>, puede configurar el widget de carga de imágenes, incluyendo la configuración del estilo de la imagen de vista previa que aparece en la forma de edición de la entidad.','es',1),(7576,_binary 'Configuración de idioma seleccionado','es',1),(7577,_binary 'El idioma predeterminado seleccionado ya no existe.','es',1),(7578,_binary 'Configuración de la detección de idioma guardado.','es',1),(7579,_binary 'Códigos de idiomas u otro texto personalizado a usar como prefijo de ruta para detección de idioma de URL. Para el idioma de fallback seleccionado, este valor puede dejarse en blanco. <strong>Modificar este valor puede estropear URLs existentes. Úsese con precaución en un entorno de producción.</strong> Ejemplo: Especificar \"deutsch\" como código de prefijo de ruta para el aléman resultará en URLs como \"example.com/deutsch/contact\".','es',1),(7580,_binary 'Rutas introducidas manualmente deberían empezar con /, ? o #.','es',1),(7581,_binary 'Empiece tecleando el título del contenido para seleccionarlo. Puede también introducir un ruta interna como %add-node o una URL externa como %url. Introduce %front para enlazar a la página principal.','es',1),(7582,_binary 'Enlace URI puede ser accedido por el usuario.\r\nEn contexto: Validación','es',1),(7583,_binary 'La ruta \'@uri\' es inaccesible.','es',1),(7584,_binary 'La ruta \'@uri\' es inválida.','es',1),(7585,_binary 'La ubicación a la que este enlace de menú apunta.','es',1),(7586,_binary '@title [%language traducción]','es',1),(7587,_binary 'El nombre de usuario del autor del contenido.','es',1),(7588,_binary 'Definiendo estilos adaptables para la imagen.','es',1),(7589,_binary 'Utilizando estilos adaptables para la imagen en los campos imagen.','es',1),(7590,_binary 'Un estilo de imagen adaptable que asocia un estilo de imagen con cada punto de ruptura definido por su tema.','es',1),(7591,_binary 'Estilos adaptables de la imagen.','es',1),(7592,_binary 'Editar el estilo adaptable de la  imagen.','es',1),(7593,_binary 'Duplicar el estilo adaptable de la imagen','es',1),(7594,_binary 'Añadir el estilo adaptable a la imagen','es',1),(7595,_binary 'Estilo adaptable de la imagen.','es',1),(7596,_binary 'Mapeos del estilo de imagen','es',1),(7597,_binary 'Mapeo de estilo de imagen.','es',1),(7598,_binary 'Tipo de mapeo para imagen adaptable.','es',1),(7599,_binary 'Tamaño de atributos.','es',1),(7600,_binary 'Estilos de imagen para ser utilizados cuando se utiliza el atributo \'tamaños\'.','es',1),(7601,_binary '<em>Duplicar estilo de imagen adaptable</em> @label','es',1),(7602,_binary '<em>Editar estilo de imagen adaptable </em> @label','es',1),(7603,_binary 'Estilo de imagen adaptable @label guardado,','es',1),(7604,_binary 'Estilo de imagen adaptable: @responsive_image_style','es',1),(7605,_binary 'Seleccionar un estilo de imagen adaptable.','es',1),(7606,_binary 'La interfaz de usuario de arrastrar y soltar para la ordenación de tablas en la interfaz administrativa presenta un reto para algunos usuarios, incluyendo los usuarios de lectores de pantalla y otras tecnologías de asistencia. La interfaz de arratrar y soltar puede desactivarse en una tabla haciendo clic en un enlace etiquetado \"Mostrar peso de las filas\" encima de las tablas. La interfaz de reemplazo permite a los usuarios ordenar la tabla escogiendo pesos numéricos en lugar de arrastrar filas de tablas.','es',1),(7607,_binary 'Utilizando el modo de mantenimiento','es',1),(7608,_binary 'Configurando el sistema de archivos','es',1),(7609,_binary 'Configurando el conjunto de herramientas para imagen','es',1),(7610,_binary '¿Está usted seguro de que desea eliminar el formato %name : %format?','es',1),(7611,_binary 'Administrando vocabularios','es',1),(7612,_binary 'Administrando términos','es',1),(7613,_binary 'Clasificando contenido de entidad','es',1),(7614,_binary 'Añadiendo nuevos términos durante la creación de contenido','es',1),(7615,_binary 'Correo electrónico del usuario requerido \r\nen el contexto: Validación','es',1),(7616,_binary 'La entidad objetivo','es',1),(7617,_binary 'Adjuntar una cadena consulta de destino a los enlaces de operaciones.','es',1),(7618,_binary 'Provee enlaces para llevar a cabo operaciones de entidad.','es',1),(7619,_binary 'Idioma del contenido de la fila de la vista','es',1),(7620,_binary 'Idioma original del contenido en la fila de la vista','es',1),(7621,_binary 'ID @entity_type_label','es',1),(7622,_binary 'Idioma de visualización','es',1),(7623,_binary 'Todo el contenido que permita traducciones será mostrado en el idioma seleccionado.','es',1),(7624,_binary 'Los valores de filtros contextuales son proporcionados por la URL.','es',1),(7625,_binary 'Las siguientes cadenas de reemplazo están disponibles para este campo. Vea que debido al orden de visualización, usted no puede utilizar campos que se muestren después de este campo; si usted necesita un campo que no está listado aquí, reorganice sus campos.','es',1),(7626,_binary '@label (@id)','es',1),(7627,_binary 'Configuración de almacenamiento del campo referencia de entidad','es',1),(7628,_binary 'Configuración de campo referencia a entidad','es',1),(7629,_binary 'Configuración de la extensión de selección de referencia a entidad','es',1),(7630,_binary 'Presentación en el idioma nativo','es',1),(7631,_binary 'Cookies HTTP','es',1),(7632,_binary 'Cabeceras HTTP','es',1),(7633,_binary 'Es superusuario','es',1),(7634,_binary 'Argumentos de la consulta','es',1),(7635,_binary 'Formato de petición','es',1),(7636,_binary 'Opciones del campo (@on_label / @off_label)','es',1),(7637,_binary '@on_label / @off_label','es',1),(7638,_binary 'Visualizado en el idioma nativo','es',1),(7639,_binary 'Subido por @username el @datetime','es',1),(7640,_binary 'Por @author hace @time','es',1),(7641,_binary 'Con múltiples idiomas configurados, los usuarios registrados pueden seleccionar su idioma preferido y los autores pueden asignar un idioma específico a su contenido.','es',1),(7642,_binary 'Esta página proporciona un resumen del avance en la traducción de la interfaz del sitio para cada idioma configurado.','es',1),(7643,_binary 'Si el módulo Interface Translation está activado, esta página proporcionará un resumen del avance en la traducción de la interfaz del sitio para cada idioma configurado.','es',1),(7644,_binary 'Dependiendo de las características de su sitio, los módulos adicionales que puede que quiera activar son:','es',1),(7645,_binary 'Esto debe ser una URL externa como %url.','es',1),(7646,_binary 'No hay protocolos externos peligrosos\r\nen contexto: Validación','es',1),(7647,_binary 'No hay enlaces internos rotos\r\nen contexto: Validación','es',1),(7648,_binary 'Enviado por @author_name el @date','es',1),(7649,_binary 'La búsqueda se realiza con palabras clave exactas y sin importar la mayúsculas; las palabras clave más cortas que las de longitud mínima son ignoradas','es',1),(7650,_binary 'Utilice OR en mayúsculas para obtener más resultados. Por ejemplo: gato OR perro (contenido que incluya \"gato\" o \"perro\")','es',1),(7651,_binary 'Puede utilizar AND en mayúsculas para incluir todas las palabras, pero será lo mismo que el comportamiento predeterminado. Por ejemplo: gato AND perro (lo mismo que \"gato perro\", contenido debe incluir \"gato\" y \"perro\")','es',1),(7652,_binary 'Utilice comillas para buscar una frase. Por ejemplo: \"El gato come ratones\"','es',1),(7653,_binary 'Puede restringir palabras claves con - para excluirlos; debe todavía tener al menos una palabra clave \"positiva\". Por ejemplo: gato -perro (contenido debe incluir gato pero no puede contener perro)','es',1),(7654,_binary 'El marco de trabajo de pruebas requiere que el directorio %sites-simpletest exista y que se pueda escribir en él para poder ejecutar las pruebas.','es',1),(7655,_binary 'El archivo %file no existe y no puedo ser creado automáticamente, lo que supone un riesgo de seguridad. Asegúrese de que se pueda escribir en el directorio.','es',1),(7656,_binary 'El usuario es administrador','es',1),(7657,_binary 'Incluye el usuario anónimo en las entidades que coinciden.','es',1),(7658,_binary 'Incluya el usuario anónimo.','es',1),(7659,_binary 'Las búsquedas de usuario buscan nombres de usuarios y nombres de usuarios parciales. Ejemplo: mar podría emparejar los nombres de usuario mar, delmar, y maryjane.','es',1),(7660,_binary 'Puede usar * como un comodín. Ejemplo: m*r emparejará los nombres de usuario mar, delmar, y elementary.','es',1),(7661,_binary 'No se encontraron vistas elegibles.','es',1),(7662,_binary 'La vista no está basada en un tipo de entidad traducible o el sitio no es multilenguaje.','es',1),(7663,_binary 'La visualización \"@display\" utiliza un enlace de \"más\" pero no existen visualizaciones a las que se puede enlazar. Usted necesita especificar una URL personalizada.','es',1),(7664,_binary 'Desactivar la reescritura de SQL omitirá todas las etiquetas de consulta, por ejemplo: desactivar el acceso de nodo como así como sobreescribe la implementaciones de hook_query_alter() en otros módulos.','es',1),(7665,_binary 'Sobrescrita la configuración de prueba','es',1),(7666,_binary 'El perfil mínimo para ejecutar pruebas con configuraciones sobreescritas en un perfil.','es',1),(7667,_binary 'Permisos de la cuenta','es',1),(7668,_binary 'La contraseña cifrada','es',1),(7669,_binary 'Contraseña existente','es',1),(7670,_binary 'Salida de filtro para objetos del agregador','es',1),(7671,_binary 'Mostrar el nombre del autor.','es',1),(7672,_binary '¿Está seguro de querer crear un nuevo %name @type?','es',1),(7673,_binary 'Usando el formulario de contacto personal','es',1),(7674,_binary 'Los visitantes del sitio pueden contactar por correo electrónico a los usuarios registrados en su sitio mediante el formulario de contacto personal, sin necesidad de saber o aprender la dirección de correo electrónico del destinatario. Cuando un visitante del sitio está viendo el perfil de usuario, el espectador verá una ficha o enlace <em>Contactar</em>, lo que conduce al formulario de contacto personal. El enlace de contacto personal no se muestra cuando está viendo su propio perfil, y los usuarios deben tener ambos los permisos <em>Ver información de usuario</em> (para ver los perfiles de usuario) y <em>Usar formularios de contacto personal de los usuarios</em> para ver el enlace. El usuario cuyo perfil se está viendo debe tener también su formulario de contacto personal activado (se trata de una opción de la cuenta de usuario); los invitados con el permiso <em>Administrar usuarios</em> puede pasar por alto esta opción.','es',1),(7675,_binary 'Configurando formularios de contacto','es',1),(7676,_binary 'Enlazando a formularios de contacto','es',1),(7677,_binary 'Añadiendo contenido a formularios de contacto','es',1),(7678,_binary '@entity usando @field_name','es',1),(7679,_binary 'Relacionar cada @entity con un @field_name establecido al @label.','es',1),(7680,_binary 'Configurando presentación de formularios','es',1),(7681,_binary 'Los campos de referencia tienen varios controles disponibles en la página <em>Gestión de presentación de formularios</em>:','es',1),(7682,_binary 'El control <em>Casilla de verificación/botones de radio</em> muestra las entidades existentes para el tipo de entidad como casillas de verificación o botones de radio basado en el conjunto de <em>número de valores permitidos</em> para el campo.','es',1),(7683,_binary 'El control <em>Lista de selección</em> muestra las entidades existentes en una lista desplegable o cuadro de lista de desplazamiento basado en el <em>número permitido de valores</em> ajustado para el campo.','es',1),(7684,_binary 'El control <em>Autocompletar</em> muestra campos de texto en el que los usuarios pueden escribir las etiquetas de entidades basadas en el <em>número permitido de valores</em>. El control se puede configurar para mostrar todas las entidades que contienen los caracteres escritos o restringidos para los que empiezan con esos caracteres.','es',1),(7685,_binary 'El control <em>Autocompletar (estilo de etiquetas)</em> muestra un campo multitexto en el que los usuarios puede introducir en una lista separada por comas de etiquetas de entidades.','es',1),(7686,_binary 'Su servidor no es capaz de mostrar el progreso de subida del archivo. El progreso de subidda de archivos requiere un servidor Apache ejecutándo PHP con mod_php o Nginx con PHP-FPM.','es',1),(7687,_binary 'Su servidor no es capaz de mostrar el progreso de subida del archivo. El progreso de subidda de archivos requiere un servidor Apache ejecutándo PHP con mod_php o PHP-FPM y no FastCGI.','es',1),(7688,_binary 'Mostrar ruta de descarga','es',1),(7689,_binary 'Mostrar el filemime como icono','es',1),(7690,_binary 'Detectar tar','es',1),(7691,_binary 'Enlazar este campo a la URL de descarga del archivo','es',1),(7692,_binary 'Enlace de archivo','es',1),(7693,_binary 'Incluir tar en la extensión','es',1),(7694,_binary 'Si la parte del nombre de archivo justo antes de la extensión es \'.tar\', incluirlo en la salida de la extensión','es',1),(7695,_binary 'Mostrar URI del archivo de descarga','es',1),(7696,_binary 'Mostrar un icono','es',1),(7697,_binary 'El icono representa el tipo de archivo, en lugar del texto MIME (como \"image/jpeg\")','es',1),(7698,_binary 'Usando campos de texto con formateo de texto','es',1),(7699,_binary 'Los campos de texto que permiten formateo de texto son aquellos con \"formateado\" en la descripción. Esos son <em>Texto (formateado, largo, con resumen)</em>, <em>Texto (formateado)</em> y <em>Texto (formateado, largo)</em>. No puede cambiar el tipo de campo una el campo ha sido creado.','es',1),(7700,_binary 'Configuración del tipo de enlace permitido.','es',1),(7701,_binary 'En las opciones de campo, puede definir el tipo de enlace permitido, si es <em> Sólo enlaces internos</em>, <em>Sólo enlaces externos</em>, o <em>Tanto enlaces internos como externos</em>. Las opciones <em>Sólo enlaces internos</em> y <em>Tanto enlaces internos como externos</em> activan un control de autocompletado para enlaces internos, así un usuario no tiene que copiar o recordar una URL.','es',1),(7702,_binary 'Las revisiones permiten rastrear las diferencias que hay entre distintas versiones de su contenido, y volver a versiones anteriores.','es',1),(7703,_binary '%title de @type ha sido revertido a la revisión de %revision-date.','es',1),(7704,_binary 'Acelerando su sitio.','es',1),(7705,_binary 'El módulo Shortcut crea un enlace Añadir/Eliminar enlace para cada página de su sitio; el enlace le deja añadir o eliminar la página actual del conjunto de atajos activado en este momento (si su tema lo muestra y tiene los permisos para editar su conjunto de atajos). El tema de administración del núcleo Seven muestra este enlace junto al título de página como un estrella gris o amarilla. Si hace clic en la estrella gris, añadirá esa página a su conjunto de de atajos. Si la página ya forma parte de su conjunto de atajos, el enlace será una estrella amarilla y le permitirá eliminar la página actual de su conjunto de atajos.','es',1),(7706,_binary 'PHP (múltiples sentencias desabilitadas)','es',1),(7707,_binary 'Las versiones de PHP mayores de 5.6.5 o 5.5.21 proporcionan protección contra inyección SQL integrado para bases de datos mysql. Se recomienda actualizar.','es',1),(7708,_binary 'Código de idioma predeterminado del sitio','es',1),(7709,_binary 'Cacheo de página','es',1),(7710,_binary 'Por favor inicie sesión para acceder a esta página.','es',1),(7711,_binary 'Permitir a los usuarios añadir nuevos términos construye gradualmente un vocabulario al mismo tiempo que se añade y edita contenido. Los usuarios pueden añadir nuevos términos si alguno de los dos controles de <em>Autocompletado</em> es elegido para el campo de referencia a términos de taxonomía en la página <em>Gestionar la visualización del formulario</em> para el campo. También necesitará activar la opción <em>Crear entidades referenciadas si no existen</em> y restringir el campo a un vocabulario.','es',1),(7712,_binary 'Si elige <em>Texto (plano)</em> o <em>Texto (formateado)</em> como el tipo de campo en la página de <em>Gestión de campos</em>, entonces se mostrará una única fila. Puede cambiar la longitud máxima del texto en las <em>Opciones de campo</em> cuando configure el campo.','es',1),(7713,_binary 'Si elige <em>Texto (plano, largo)</em>, <em>Texto (formateado, largo)</em> o <em>Texto (formateado, largo, con resumen)</em> en la página de <em>Gestión de campos</em>, entonces los usuarios pueden insertar texto de longitud sín límite. En la página de <em>Gestión de visualización de formularios</em> puede establecer el número de filas que se mostrarán a los usuarios.','es',1),(7714,_binary 'Como alternativa al uso de una versión recortada del texto, puede introducir un resumen separado seleccionando el tipo de campo de <em>texto (formateado, largo, con resumen)</em> en la página de <em>Gestión de campos</em>. Incluso si <em>Resumen de la entrada</em> está activado, y los resúmenes son proporcionados, puede sin embargo mostrar texto <em>recortado</em>, eligiendo el formato apropiado en la página de <em>Gestión de visualización</em>.','es',1),(7715,_binary 'El Administrador de Actualizaciones también permite a los administradores actualizar e instalar módulos y temas a través de la interfaz de administración.','es',1),(7716,_binary 'Realizando actualizaciones a través de la página de Actualización','es',1),(7717,_binary 'Instalando nuevos módulos y temas a través de la página de Instalación','es',1),(7718,_binary 'Enlace al usuario','es',1),(7719,_binary 'Muestra el nombre de usuario o autor.','es',1),(7720,_binary 'Se requiere un contraseña para cambio de campo protegido en contexto: Validación','es',1),(7721,_binary 'Texto para utilizar en esta variante, @count será reemplazado con este valor.','es',1),(7722,_binary 'Texto para utilizar en este formulario singular, @count será reemplazado con este valor.','es',1),(7723,_binary 'Probando  el multiidioma con Inglés','es',1),(7724,_binary 'Contiene solamente caracteres US ASCII','es',1),(7725,_binary 'Pedido completado! Gracias por su compra.','es',1),(7726,_binary 'Resolver contenido faltante','es',1),(7727,_binary 'La siguientes traducciones de la entidad @entity-type se eliminarán:','es',1),(7728,_binary 'Borrar la traduccion @language','es',1),(7729,_binary 'La traducción @entity-type %label @language ha sido borrada.','es',1),(7730,_binary '¿Está seguro que quiere borrar la traducción @language del @entity-type %label?','es',1),(7731,_binary 'La configuración core.extension no existe.','es',1),(7732,_binary 'No se puede instalar el módulo %module ya que no existe.','es',1),(7733,_binary 'No puede desinstalar el módulo %module mientras está instalado el módulo %dependent_module.','es',1),(7734,_binary 'No se puede instalar el tema %theme, ya que no existe.','es',1),(7735,_binary 'No se puede instalar el tema %theme, ya que requiere el tema %required_theme.','es',1),(