e añadir una página a un esquema de libro o crear un nuevo libro.','es',1),(7751,_binary 'Configuración del tipos de contenido para libros','es',1),(7752,_binary 'Enlace para tipo de contenido <em>Añadir página secundaria</em>','es',1),(7753,_binary 'La configuración no puede ser importada porque falló la validación por las siguientes razones:','es',1),(7754,_binary 'Enlace para traducir @entity_type_label','es',1),(7755,_binary 'Proveer un enlace de traducción para @entity_type_label','es',1),(7756,_binary 'El módulo Foro te permitirá crear hilos de discusión con funcionalidad similar a otros sistemas de mensaje. En un foro, los usuarios publican tópicos e hilos en jerarquías anidadas, permitiendo a las discusiones ser categorizadas y agrupadas.','es',1),(7757,_binary 'Un foro es representado por una estructura jerárquica, que consiste en:','es',1),(7758,_binary '<em>Foros</em> (por ejemplo, <em>Recetas para cocinar verduras</em>)','es',1),(7759,_binary '<em> Tópicos de Foro</em> enviados por los usuarios (por ejemplo, <em>Cómo cocinar papas</em>), que inician las discusiones.','es',1),(7760,_binary 'Pila de <em>comentarios</em> presentado por usuarios (por ejemplo, <em>Lave las papas primero y luego...</em>).','es',1),(7761,_binary '<em>Contenedores</em> opcionales, utilizados para agrupar foros similares. Los foros pueden ser colocados dentro de los contenedores, y viceversa.','es',1),(7762,_binary 'Configurando la estructura del foro','es',1),(7763,_binary 'Navegando en el foro','es',1),(7764,_binary 'El dominio para %language sólo puede contener el nombre de dominio, no una barra diagonal, protocolo y/o puerto.','es',1),(7765,_binary 'La traducción de @language de %label de @type ha sido eliminada.','es',1),(7766,_binary 'Configuración de PHP always_populate_raw_post_data','es',1),(7767,_binary 'No se establece en -1.','es',1),(7768,_binary 'Dominio de la relación.','es',1),(7769,_binary 'Configuración de Xdebug','es',1),(7770,_binary 'xdebug.max_nesting_level está establecido a %value.','es',1),(7771,_binary 'Establezca <code>xdebug.max_nesting_level=@level</code> en su configuración de PHP ya que algunas páginas de su sitio Drupal pueden no funcionar cuando este ajuste es demasiado bajo.','es',1),(7772,_binary 'Para más información, consulte el <a href=\"https://www.drupal.org/upgrade\">manual de actualización</a>. Si no está seguro de lo que puedan significar esos términos, tal vez debería contactar su proveedor de hosting.','es',1),(7773,_binary 'Límite recortado','es',1),(7774,_binary 'Si el resumen no se establece, el campo %label recortado terminará en la última frase completa antes de este límite de caracteres.','es',1),(7775,_binary 'Límite recortado: @trim_length caracteres','es',1),(7776,_binary '%name está bloqueado o no ha sido activado aún.','es',1),(7777,_binary 'Trabajando con vistas multiidiomas','es',1),(7778,_binary 'Si su sitio tiene múltiples idiomas y entidades traducidas, cada fila resultado en una vista contendrá una traducción para cada entidad involucrada (una vista puede incluir múltiples entidades si usa relaciones). Puede usar un filtro para restringuir la vista a un idioma: sin filtro, si una entidad tiene tres traducciones, eso añadirá tres filas a los resultados; si filtra por idioma, a lo sumo un resultado se desplegará (puede ser cero si esa entidad en particular no tiene una traducción que coincida con la selección de su filtro de idioma). Si una vista usa relaciones, cada entidad en la relación necesita ser filtrada por separado. Puede filtrar una vista a un idioma definido, como Inglés o Español, o a un idioma seleccionado por la página en la que la vista se está desplegando (el idioma que es seleccionado para la página por las configuraciones de detección de idioma ya sea por la interfaz de Contenido o de Usuario).','es',1),(7779,_binary 'Debido a que cada fila de resultados contiene una traducción específica de cada entidad, los filtros de nivel de campo también están relacionados con estas traducciones de la entidad. Por ejemplo, si su vista tiene un filtro que especifica que el título de la entidad debe contener una palabra en particular en inglés, podrá supuestamente filtrar todas las filas que contienen traducciones al chino, ya que no contienen la palabra en inglés. Si su vista también tiene un segundo filtro que se especifica que el título debe contener una palabra china en particular, y si está utilizando lógica \"And\" para el filtrado, probablemente terminará sin resultados en la vista, ya que probablemente no hay ninguna traducción de entidad que contenga tanto las palabras chinas y en inglés en el título.','es',1),(7780,_binary 'Independientemente del filtrado, puede elegir el idioma visualizado (el idioma utilizado para mostrar las entidades y sus campos) a través de una opción en la visualización. Su elección de idioma son los mismos que las elecciones del filtro de idioma con un opción adicional de \"Idioma de contenido de la vista de fila\" e \"Idioma original del contenido de la vista de fila\", lo que significa que mostrará cada entidad la fila resultante usando el idioma que tenga la entidad o en el cual fue originalmente creado. En teoría, esto le daría la flexibilidad de filtrar traducciones en francés y después mostrar los resultados en español. La elección más usual sería usar el mismo idioma para el idioma de visualización y cada filtro de entidad en la vista o usar la opción de idioma de fila para la visualización.','es',1),(7781,_binary 'Enlace de entidad','es',1),(7782,_binary 'Enlace de eliminación de entidad','es',1),(7783,_binary 'Enlace de edición de entidad','es',1),(7784,_binary 'Enlace a @entity_type_label','es',1),(7785,_binary 'Proporciona un enlace de visualización a @entity_type_label.','es',1),(7786,_binary 'Enlace para editar @entity_type_label','es',1),(7787,_binary 'Proporciona un enlace de edición a @entity_type_label.','es',1),(7788,_binary 'Enlace para eliminar @entity_type_label','es',1),(7789,_binar