bloque.','es',1),(7873,_binary 'Mostrar las pestañas primarias','es',1),(7874,_binary 'Mostrar las pestañas secundarias','es',1),(7875,_binary 'inminentemente','es',1),(7876,_binary 'La dirección IP bloqueada.','es',1),(7877,_binary 'Generando contenido accesible','es',1),(7878,_binary 'Las tablas HTML pueden ser creadas con cabeceras de tablas así como elementos de título/resumen. Se requiere texto alternativo predeterminado en las imágenes añadidas a través de CKEditor (nótese que estos pueden sobrescribirse). Las figuras semánticas de HTML5 o títulos de figuras están disponibles para añadir a las imágenes.','es',1),(7879,_binary 'La hora en que el comentario fue creado, en formato Unix.','es',1),(7880,_binary 'La hora en que el comentario fue editado por su autor, en formato Unix.','es',1),(7881,_binary 'La etiqueta del tipo de comentario','es',1),(7882,_binary 'ID del paquete del tipo de comentario.','es',1),(7883,_binary 'El tipo de nodo al que se adjunta este tipo de comentario','es',1),(7884,_binary 'Modo de comentario predeterminado.','es',1),(7885,_binary 'Número de comentarios visible por página.','es',1),(7886,_binary 'Si se permiten comentarios anónimos.','es',1),(7887,_binary 'Ubicación del formulario de comentarios.','es',1),(7888,_binary 'Si las previsualizaciones están activadas para el tipo de comentario.','es',1),(7889,_binary 'Si un campo de tema está activado para el tipo de comentario.','es',1),(7890,_binary 'El módulo que implementa el tipo de campo.','es',1),(7891,_binary 'El conjunto de entidad.','es',1),(7892,_binary 'El nombre original de máquina del modo de vista.','es',1),(7893,_binary 'La Id del modo de visualización.','es',1),(7894,_binary 'El nombre del formato.','es',1),(7895,_binary 'Si el formato es cacheable.','es',1),(7896,_binary 'Los identificadores de los roles que pueden utilizar el formato.','es',1),(7897,_binary 'Los filtros configurados para el formato.','es',1),(7898,_binary 'El estado del formato','es',1),(7899,_binary 'El peso del formato','es',1),(7900,_binary 'La migración @id está ocupada con otra operación: @status','es',1),(7901,_binary '@label (@type)','es',1),(7902,_binary 'Bandera indicando si el tipo de nodo está activado','es',1),(7903,_binary 'nodo base.','es',1),(7904,_binary 'Grupos de punto de interrupción: dimensión del visor vs dirección de arte','es',1),(7905,_binary 'Opciones de los puntos de interrupción: tamaño vs estilos de imagen','es',1),(7906,_binary 'Campo de tamaños','es',1),(7907,_binary 'Estilos de imagen para tamaños','es',1),(7908,_binary 'Hubo un error en la carga del estilo de imagen adaptable: “@style“ mientras se mostraba la imagen adaptable.','es',1),(7909,_binary 'Dimensionamiento del visor','es',1),(7910,_binary 'Seleccione un grupo de puntos de salto desde los temas instalados y módulos. Debajo puede seleccionar qué puntos de salto usar para este grupo. Puede también seleccionar que estilo de imagen o estilos usar para cada punto de salto que utilice.','es',1),(7911,_binary 'Aviso: si cambia el grupo de puntos de salto, perderá todas las selecciones de estilo de imagen para cada punto de salto.','es',1),(7912,_binary 'Seleccionar un grupo de puntos de ruptura desde los temas y módulos instalados.','es',1),(7913,_binary 'Habilite el módulo Help para más información en los tamaños de atributos.','es',1),(7914,_binary 'Seleccionar múltiples estilos de imágenes y use el atributo de tamaños','es',1),(7915,_binary 'Seleccione un estilo de imagen simple.','es',1),(7916,_binary 'No utilice este punto de ruptura.','es',1),(7917,_binary 'Seleccione los estilos de imagen con ancho comprendido desde la cantidad más pequeñas de espacio que ocupará la imagen en el diseño hasta el más largo, teniendo en cuenta que las pantallas de alta resolución necesitará imágenes entre 1.5 hasta 2 veces más grandes.','es',1),(7918,_binary 'Seleccione el estilo de imagen más pequeño que espera que aparezca en este espacio. El estilo de imagen de respaldo solo aparecerá en el sitio si ocurre un error.','es',1),(7919,_binary 'Módulos experimentales activados','es',1),(7920,_binary 'La configuración system.filter se ha movido a un parámetro contenedor, vea default.services.yml para más información.','es',1),(7921,_binary 'El módulo Block no está activado por lo que las acciones locales y tareas que han sido convertidas a bloques, dejarán de ser visibles.','es',1),(7922,_binary 'Debido a que su sitio tiene tema(s) personalizado(s) instalado(s), tuvimos que establecer acciones locales y tareas de bloques en la región de contenido. Por favor revise manualmente las configuraciones de bloques y retire las variables eliminadas de sus plantillas.','es',1),(7923,_binary 'Pestañas de bloque','es',1),(7924,_binary 'Siempre que se muestren las pestañas primarias','es',1),(7925,_binary 'Siempre que se muestren las pestañas secundarias','es',1),(7926,_binary 'La combinación de nombre/formato existente no se ha modificado.','es',1),(7927,_binary 'Ejecutar actualizaciones de base de datos','es',1),(7928,_binary 'El peso del rol.','es',1),(7929,_binary 'Un título semántico asociado con su tabla para incrementar la accesibilidad.','es',1),(7930,_binary 'Comment_forum','es',1),(7931,_binary 'Campo de comentario predeterminado','es',1),(7932,_binary 'Grande (480×480)','es',1),(7933,_binary 'Medio (220×220)','es',1),(7934,_binary 'Miniatura (100×100)','es',1),(7935,_binary 'Aviso de seguridad: No se pudo modificar archivo .htaccess. Por favor, crease un archivo .htaccess en su directorio %directory en el que contengan las siguientes líneas: <pre><code>@htaccess</code></pre>','es',1),(7936,_binary 'Por favor, continue hasta la <a href=\":error_url\">página del error</a>','es',1),(7937,_binary 'El instalador requiere la creación de un directorio de traducciones como parte del proceso de instalación. Crease el directorio %translations_directory . Más detalles sobre la instalación de Drupal disponibles en <a href=\":install_txt\">INSTALL.txt</a>.','es',1),(7938,_binary 'El instalador requiere permisos de lectura a %translations_directory en todo momento. La sección <a href=\":handbook_url\">webhosting issues</a> de la documentation le ofrece ayuda en este y otros temas.','es',1),(7939,_binary 'El instalador requiere permisos de escritura a %translations_directory en todo momento. La sección <a href=\":handbook_url\">webhosting issues</a> de la documentation le ofrece ayuda en este y otros temas.','es',1),(7940,_binary 'El instalador requiere contactar con el servidor de traducción para descargarse un archivo de traducción. Compruebe su conexión a internet y verifique si su website puede acceder al sevidor de traducción en <a href=\":server_url\">@server_url</a>.','es',1),(7941,_binary 'El archivo de traducción en %language no está disponible en el servidor de traducciones. <a href=\":url\">Escoja un idioma diferente</a> o seleccione English y traduzca su website más tarde.','es',1),(7942,_binary 'El archivo de traducción en %language no se pudo descargar. <a href=\":url\">Elija otro idioma</a> o inglés y traduzca su sitio web en otro momento.','es',1),(7943,_binary 'El instalador @drupal requiere que se cree un archivo %file como parte del proceso de instalación. Copie el archivo %default_file como %file. Más detalles sobre la instalación de Drupal están disponible en <a href=\":install_txt\">INSTALL.txt</a>.','es',1),(7944,_binary '@drupal requiere permisos de lectura a %file en todo momento. La sección sobre <a href=\":handbook_url\">problemas de webhosting</a> de la documentación ofrece ayuda sobre este y otro temas.','es',1),(7945,_binary 'El instalador de @drupal requiere permisos de escritura a %file durante el proceso de instalación. La sección sobre <a href=\":handbook_url\">problemas de webhosting</a> de la documentación ofrece ayuda sobre este y otro temas.','es',1),(7946,_binary 'El instalador @drupal no pudo crear un archivo %file con los permisos y propietarios adecuados. Acceda a sus servidor web, borre el archivo %file existente y crease uno nuevo copiando el archivo %default_file como %file. Más detalles sobre la instalación de Drupal están disponibles en <a href=\":install_txt\">INSTALL.txt</a>. La sección sobre <a href=\":handbook_url\">problemas de webhosting</a> de la documentación ofrece ayuda sobre este y otro temas.','es',1),(7947,_binary 'Compruebe los mensajes y <a href=\":retry\">vuelva a intentarlo</a>, o puede escojer <a href=\":cont\">continuar de todos modos</a>.','es',1),(7948,_binary 'Compruebe los mensajes y <a href=\":url\">vuelva a intentarlo</a>','es',1),(7949,_binary 'Los siguientes módulos son requeridos pero no fueron encontrados. Muevalos en los subdirectorios de módulos adecuados tal como <em>/modules</em>. Módulos faltantes: @modules','es',1),(7950,_binary 'Actualizando @module','es',1),(7951,_binary 'Post-actualizando @module','es',1),(7952,_binary 'Tipo de Entidad no coincide con el renombramiento. @old_type no es igual a @new_type para la configuración existente  @old_name  y la configuración guardada @new_name.','es',1),(7953,_binary 'Renombrar la operación para una configuración sencilla. Configuración existente @old_name  y configuración guardada @new_name.','es',1),(7954,_binary 'Su servidor MySQL y controlador PHP MySQL deben soportar codificación de caracteres utf8mb4. Asegurese de usar un sistema de bases de datos que lo soporte (como MySQL/MariaDB/Percona 5.5.3 y superior) y que el conjunto de caracteres utf8mb4 este integrado. Consulte la <a href=\":documentation\" target=\"_blank\">documentación de MySQL</a> para más información.','es',1),(7955,_binary 'La base de datos %driver debe utilizar codificación %encoding  para trabajar con Drupal. Cree nuevamente la base de datos con codificación %encoding. Ver <a href=\"INSTALL.pgsql.txt\"> INSTALL.pgsql.txt </a> para más detalles.','es',1),(7956,_binary 'La configuración %setting está establecida actualmente a \'%current_value\', pero debe ser \'%needed_value\'. Cambiar esto ejecutando la siguiente consulta: <code>@query</code>','es',1),(7957,_binary 'Fecha (por ejemplo: @format)','es',1),(7958,_binary 'Hora (por ejemplo: @format)','es',1),(7959,_binary '@uri','es',1),(7960,_binary 'Operando en modo de mantenimiento. <a href=\":url\">Volver a conectar</a> el sitio web.','es',1),(7961,_binary 'Tamaño de campo de texto: @size','es',1),(7962,_binary 'Número de filas: @rows','es',1),(7963,_binary 'Tamaño de campo URI: @size','es',1),(7964,_binary 'ADVERTENCIA: No está usando una conexión encriptada, así que su contraseña será enviada como texto plano.<a href=\":https-link\">Saber más</a>.','es',1),(7965,_binary 'Error al conectar con el servidor. El servidor informa del siguiente mensaje: <p class=\"error\">@message</p> Para obtener más ayuda instalando o actualizando el código en su servidor vea el <a href=\":handbook_url\">manual</a>.','es',1),(7966,_binary '@name no puede tener más de %max caracteres pero actualmente tiene %length caracteres.','es',1),(7967,_binary '<ul>\r\n<li>Para iniciar de nuevo, debe limpiar su base de datos existente y copiar <em>default.settings.php</em> a <em>settings.php</em>.</li>\r\n<li>Para actualizar una instalación existente, proceda a <a href=\":update-url\">actualizar script</a>.</li>\r\n<li>Ver tu <a href=\":base-url\"> sitio existente</a>.</li>\r\n</ul>','es',1),(7968,_binary 'Todos los cambios necesarios a %dir y %file han sido realizados, por lo que debería quitar los permisos de escritura a ellos ahora para evitar problemas de seguridad. Si no está seguro de cómo hacerlo, consulte el <a href=\":handbook_url\">manual online</a>.','es',1),(7969,_binary 'El sistema le notificará cuando estén disponibles actualizaciones y rutinas importantes de seguridad para los componentes instalados. Información anónima sobre su sitio es enviado a <a href=\":drupal\">Drupal.org</a>.','es',1),(7970,_binary 'Error en la transferencia de archivos, razón: @reason','es',1),(7971,_binary 'Restricción de campo único','es',1),(7972,_binary 'Ya existe un @entity_type con @field_name %value.','es',1),(7973,_binary 'El módulo Actions proporciona tareas que pueden ser ejecutadas por el sitio tal como despublicar contenidos, enviar mensaje por correo electrónico, o bloquear un usuario. Otros módulos pueden activar estas acciones según sucesos específicos del sistema; por ejemplo: cuando se publica nuevo contenido o cuando un usuario inicia sesión. Otros módulos pueden proporcionar acciones adicionales. Para más información, consulte la <a href=\":documentation\">documentación en pantalla para el módulo Actions</a>.','es',1),(7974,_binary '<em>Acciones simples</em> no requieren configuración y son listados automáticamente como disponibles en la <a href=\":actions\">página de Acciones</a>.','es',1),(7975,_binary '<em>Acciones avanzadas</em> son creados y tienen que ser configurados individualmente. Cree una acción avanzada en la <a href=\":actions\">página de Acciones</a> seleccionando un tipo de acción de la lista desplegable. Después configure su acción, por ejemplo: especificando el recipiente para un mensaje email automático.','es',1),(7976,_binary 'El mensaje que debe enviarse. Puede incluir comodines como [node:title], [user:account-name], [user:display-name] y [comment:body] para representar datos que serán diferentes cada vez que un mensaje se envíe. No todos los comodines estarán disponibles en todos los contextos.','es',1),(7977,_binary 'El mensaje que se mostrará al usuario actual. Puede incluir comodines como [node:title], [user:account-name], [user:display-name] y [comment:body] para representar datos que será diferente cada vez que un mensaje sea enviado. No todos los comodines estarán disponibles en todos los contextos.','es',1),(7978,_binary 'El módulo Aggregator es un sindicador y lector de noticias que reune y muestra contenido fresco con feeds RSS, RDF y Atom disponibles en la web. Miles de sitios (sitios de noticias y blogs) publican sus ultimos titulares en feeds o fuente de noticias, usando un formato estandarizado basado en XML. Para más información, consulte la <a href=\":aggregator-module\">documentación online para el módulo Aggregator</a>.','es',1),(7979,_binary 'Los usuarios ven el contenido del canal en la <a href=\":aggregator\"> pantalla principal de agregador  </a>, o por <a href=\":aggregator-sources\"> sus fuentes</a> (por lo general a través de un lector de canal RSS) . El contenido más reciente en un canal se puede mostrar como un bloque a través de la <a href=\":admin-block\"> página de bloques de administración</a>','es',1),(7980,_binary 'Configurando la presentación de los elementos de la fuente de noticias','es',1),(7981,_binary 'Descartando viejos elementos de la fuente de noticias','es',1),(7982,_binary 'Un <a href=\":aggregator-opml\">archivo OPML legible</a> de todas las fuentes de noticias está disponible. OPML es un formato de archivo basado en XML para compartir información estructurada como una lista de fuentes RSS. Las fuentes de de noticias también pueden ser <a href=\":import-opml\">importados mediante un archivo OPML</a>.','es',1),(7983,_binary 'Una <a href=\":cron\">tarea de mantenimiento de cron</a> en funcionamiento es requerida para actualizar fuentes de noticias automaticamente.','es',1),(7984,_binary 'Fuentes de noticias actuales están listadas a continuación y <a href=\":addfeed\">nuevas fuentes de noticias pueden ser añadidas</a>. Para cada fuente de noticias, el bloque de <em>últimos elementos</em> puede ser activado en la <a href=\":block\">página de administración de bloques</a>.','es',1),(7985,_binary 'Fuente de noticias @title','es',1),(7986,_binary 'No hay fuentes de noticias disponibles. <a href=\":link\">Añadir fuentes</a>.','es',1),(7987,_binary 'La descripción de la página web que viene del elemento @description en la fuente de noticias.','es',1),(7988,_binary 'El periódo de tiempo entre actualizaciones de fuentes de noticias. Requiere una <a href=\":cron\">tarea de mantenimiento de cron</a> configurada correctamente.','es',1),(7989,_binary 'Requiere una <a href=\":cron\">tarea de mantenimiento de cron</a> configurada correctamente.','es',1),(7990,_binary 'El módulo Ban permite a los administradores prohibir visitas a su sitio de direcciones IP individuales. Para más información consulte la <a href=\":url\">documentación online para el módulo Ban</a>.','es',1),(7991,_binary 'Los administradores pueden prohibir la entrada a direcciones IP en la página <a href=\":bans\">direcciones IP prohibidas</a>.','es',1),(7992,_binary 'El módulo HTTP Basic Authentication proporciona un proveedor de <a href=\"http://en.wikipedia.org/wiki/Basic_access_authentication\">autenticación HTTP básica</a> para peticiones de servicio web. Este proveedor autentica las solicitudes utilizando el nombre de usuario y la contraseña de autenticación básica HTTP, como una alternativa al uso de sistema de autenticación basada en cookies estándar de Drupal. Sólo es útil si su sitio ofrece servicios web configurados para utilizar este tipo de autenticación (por ejemplo, el <a href=\":rest_help\">módulo RESTful Web Services</a>). Para obtener más información, consulte la <a href=\":hba_do\">documentación online el módulo HTTP Basic Authentication</a>.','es',1),(7993,_binary 'El módulo Block le permite colocar bloques en las regiones de sus temas instalados y configurar las opciones de esos bloques. Para más información consulte la <a href=\":blocks-documentation\">documentación online para el módulo Block</a>.','es',1),(7994,_binary 'Puede ver donde están las regiones para el tema actual haciendo clic en el enlace <em>Demostrar regiones de bloques</em>en la <a href=\":blocks\">página de Diseño de bloques</a>. Las regiones son específicas de cada tema.','es',1),(7995,_binary 'Para cambiar las opciones de un bloque individual, haga clic en el enlace <em>Configurar</em> en la <a href=\":blocks\">página de Diseño de bloques</a>. Las opciones disponibles varían dependiendo del módulo que proporciona el bloque. Para todos los bloques puede cambiar el título del bloque y cambiar su visualización.','es',1),(7996,_binary 'Puede añadir bloques personalizados, si el módulo <em>Custom Block</em> está instalado. Para más información, consulte la <a href=\":blockcontent-help\">página de ayuda de Custom Block</a>.','es',1),(7997,_binary 'Ajustes de bloque actualizados.','es',1),(7998,_binary 'Editar el tipo de bloque personalizado %label','es',1),(7999,_binary 'El bloque con uuid %uuid no existe. <a href=\":url\">Añadir un bloque personalizado</a>.','es',1),(8000,_binary 'Añadir un <a href=\":url\">bloque personalizado</a>','es',1),(8001,_binary 'El módulo Book se usa para crear contenido estructurado y multi-página, como guía de recursos del sitio, manuales y wikis. Le permite crear contenido estructurado en capítulos, secciones, subsecciones o similares. Activando el módulo, se crea un nuevo tipo de contenido <em>página de libro</em>. Para más información, consulte la <a href=\":book\">documentación online para el módulo Book</a>.','es',1),(8002,_binary 'Puede asignar permisos aparte para <em>crear nuevos libros</em> así como <em>crear</em>, <em>editar</em> y <em>borrar</em> contenido de libros. Los usuarios con el permiso <em>Administrar esquema de libro</em> pueden añadir <em>cualquier</em> tipo de contenido a un libro seleccionando el esquema apropiado de libro mientras se edita el contenido. Se puede también ver una lista de todos los libros y editar y reorganizar los títulos de las secciones en la <a href=\":admin-book\">página Lista de libros</a>.','es',1),(8003,_binary 'El tipo de contenido <em>página de libro</em> el tipo de contenido activado inicialmente para esquemas de libros. En la <a href=\":admin-settings\">página de Opciones de libro</a> puede configurar los tipos de contenido que pueden ser usados en los esquemas de libro.','es',1),(8004,_binary 'Los usuarios con el permiso <em>Añadir contenido páginas secundarias a libros</em> verán un enlace a <em>Añadir página secundaria</em> cuando vea un elemento de contenido que forme parte de un esquema de un libro. Este enlace permitirá a los usuarios crear un nuevo elemento de contenido del tipo de contenido que seleccione en la <a href=\":admin-settings\">página de Opciones de libro</a>. De forma predeterminada, el tipo de contenido es <em>página de libro</em>.','es',1),(8005,_binary 'La página de libro tiene un bloque de navegación predeterminado específico para libros. Ese bloque de navegación contiene enlaces que llevan a las páginas anterior y siguiente del libro y al nivel por encima de la página actual dentro de la estructura del libro. Este bloque puede ser activado en la <a href=\':admin-block\'>página de Diseño de bloques</a>. Para que se muestren las páginas del libro en la navegación del libro, estos deben ser añadidos en el esquema del libro.','es',1),(8006,_binary 'La funcionalidad del esquema le permite incluir páginas en la <a href=\":book\">jerarquía del libro</a>, así como moverlos dentro de la jerarquía o <a href=\":book-admin\">reordenar un libro entero</a>.','es',1),(8007,_binary 'La página principal del libro. La profundidad máxima para un libros y todas sus páginas secundarias es @maxdepth. Algunas páginas en el libro seleccionado podría no estar disponible como principales si al seleccionarlo se excede ese límite.','es',1),(8008,_binary 'El módulo Breakpoint mantiene el seguimiento de los puntos de interrupción de la altura, anchura y resolución cuando un diseño adaptable tiene que cambiar para responder a diferentes dispositivos usados para ver el sitio. Este módulo no tiene interfaz de usuario. Para más información, consulte la <a href=\":docs\">documentación online para el módulo Breakpoint</a>.','es',1),(8009,_binary '<a href=\":w3\">Consultas de medios</a> son un vía formal de codificar puntos de interrupción. Por ejemplo, un punto de interrupción de 40em podría ser escrito como una consulta de medios \"(min-width: 40em)\". Los puntos de interrupción son realmente consultas de medios con algunos metadatos adicionales, tales como nombre y información de multiplicador.','es',1),(8010,_binary 'El módulo CKEditor proporciona un editor de texto visual muy accesible y usable añadiendo una barra de herramientas a los campos de texto. Los usuarios pueden usar botones para formatear el contenido y crear HTML válido y semánticamente correcto. El módulo CKEditor utiliza la estructura que proporciona el <a href=\":text_editor\">módulo Text Editor</a>. Necesita que esté activado JavaScript en el navegador. Para más información, vea la documentación online del módulo CKEditor y el <a href=\":cke_url\">sitio web de CKEditor</a>.','es',1),(8011,_binary 'CKEditor tiene que estar activado y configurado de manera separada para formatos de texto individual desde la <a href=\":formats\">página de Formatos de texto y editores</a> porque las opciones de filtrado para cada texto pueden ser diferentes. Para más información, consulte la <a href=\":text_editor\">página de ayuda de editores de texto</a> y la <a href=\":filter\">página de ayuda de Filtros</a>.','es',1),(8012,_binary 'CKEditor sólo permite a los usuarios formatear contenido acorde a la configuración de los filtros del formato de texto específico. Si un formato de texto excluye algunas etiquetas HTML, los botones de barra de herramientas correspondientes no se muestran a los usuarios cuando editen un campo de texto en este formato. Para más información, consulte la <a href=\":filter\">Página de ayuda de filtros</a>.','es',1),(8013,_binary 'La versión de desarrollo en un editor WYSIWYG (CKEditor) viene con un número de <a href=\":features\">características de accesibilidad</a>. CKEditor viene con una versión con <a href=\":shortcuts\">atajos de teclado</a>, con el que se puede beneficiar tanto usuarios avanzados así como los que solo usen teclado.','es',1),(8014,_binary 'El módulo Color permite a los usuarios con el permiso <em>Administrar configuración del sitio</em> cambiar el esquema de colores (color de enlaces, fondos de pantalla, textos y otros elementos de tema) para temas compatibles. Para más información, consulte la <a href=\":color_do\">documentación online para el módulo Color</a>.','es',1),(8015,_binary 'Para cambiar las opciones de color, seleccione el enlace <em>Opciones</em> para su tema en la página <a href=\":appearance\">Apariencia</a>. Si el selector de color no aparece entonces el tema no es compatible con el módulo Color.','es',1),(8016,_binary 'El módulo Comment permite a los usuarios comentar en contenidos del sitio, establecer comentarios predeterminados, permisos y moderar comentarios. Para más información consulte la <a href=\":comment\">documentación online para el módulo Comment</a>.','es',1),(8017,_binary 'Activando comentarios','es',1),(8018,_binary 'La funcionalidad de comentarios se puede activar para cualquier subtipo de entidad (por ejemplo, un <a href=\":content-type\">tipo de contenido</a>) añadiendo un campo <em>Comentarios</em> en la <em>Página de administración de campos</em>. La adición o eliminación de comentarios para una entidad a través de la interfaz de usuario requiere la activación del módulo  <a href=\":field_ui\">Field UI</a>, aunque la funcionalidad de comentarios funciona sin él. Para saber más sobre los campos y entidades, consulte la <a href=\":field\">página de ayuda del módulo Campo</a>.','es',1),(8019,_binary 'Configurando ajustes de comentarios','es',1),(8020,_binary 'Los ajustes de comentarios se pueden configurar mediante la edición del campo en <em>Comentarios</em> <em>Página de administración de campos</em> de un tipo de entidad si el <em>módulo Field UI</em> está habilitado. La configuración incluye la etiqueta del campo de comentarios, el número de comentarios que se muestre, y si se muestran en la lista. Los comentarios se pueden configurar como: <em>Abrir</em> para permitir nuevos comentarios, <em>Cerrado</em> para ver los comentarios existentes, sino evitar nuevos comentarios o <em> Ocultos</em> para ocultar comentarios existente y prevenir nuevos comentarios. Cambiar esta configuración para un tipo de entidad no va a cambiar los términos de la entidad existentes.','es',1),(8021,_binary 'Los usuarios con los permisos adecuados pueden sobreescribir las opciones predeterminadas de comentarios de un tipo de entidad al crear un elemento de ese tipo.','es',1),(8022,_binary 'Los comentarios de los usuarios que tienen el permiso <em>Saltan la aprobación de comentario</em> y  se publican inmediatamente. Todos los demás comentarios se colocan en la cola de <a href=\":comment-approval\">Comentarios no aprobados</a>, hasta que un usuario que tenga permiso para <em>Administrar comentarios y ajustes de comentario</em> publica o los elimina. Los comentarios publicados pueden ser mejor administrados en la página de administración <a href=\":admin-comment\">Comentarios publicados</a>. Cuando un comentario no tiene respuestas, sigue siendo editable por su autor, siempre y cuando el autor tiene permiso de <em>Editar comentarios propios</em>.','es',1),(8023,_binary 'En respuesta a @parent_title por @parent_username','es',1),(8024,_binary 'Nombre para @anonymous','es',1),(8025,_binary '<a href=\":login\">Inicie sesión</a> o <a href=\":register\">registrese</a> para enviar comentarios','es',1),(8026,_binary '<a href=\":login\">Inicie sesión</a> para enviar comentarios','es',1),(8027,_binary 'Seleccione el tipo comentario para usar en este campo de comentario. Gestione los tipos de comentario desde la <a href=\":url\">página general de administración</a>.','es',1),(8028,_binary 'El módulo Configuration Manager proporciona una interfaz de usuario para importar y exportar cambios de configuración estre instalaciones en su sitio web en diferentes entornos. La configuración se almacena en formato YAML. Para más información, consulte la <a href=\":url\">documentación online para el módulo Configuration Manager</a>.','es',1),(8029,_binary 'Puede crear y descargar un archivo compuesto de las configuraciones de su sitio exportados como archivos <em>*.yml</em> en la página de <a href=\":url\">Exportar</a>','es',1),(8030,_binary 'Puede subir una configuración de un sitio completo desde un archivo en la página <a href=\":url\">Importar</a>. Cuando se importe datos desde un antorno diferente, el sitio y los archivos importados deben coincidir en valores de configuración para el UUID en el elemento de configuración <em>system.site</em>. Eso significa que su otro entorno debería ser inicialmente un clon del sitio objetivo. Las migraciones no están soportadas.','es',1),(8031,_binary 'Puede revisar las diferencias entre la configuración activa y un archivo de configuración importado en la página <a href=\":synchronize\">Sincronizar</a> para asegurarse de que los cambios son los esperados, antes de finalizar la importación. La página Sincronizar también muestra elementos de configuración que podrían ser añadidos o borrados.','es',1),(8032,_binary 'Puede exportar un único elemento de configuración seleccionando un <em>tipo de configuración</em> y un <em>nombre de configuración</em> en la página <a href=\":single-export\">Exportación única</a>. La configuración y sus correspondientes <em>nombres de archivo *.yml</em> se muestran en la página para que pueda copiarlos.','es',1),(8033,_binary 'Puede importar un único elemento de configuración pegándolo en formato YAML en el formulario en la página <a href=\":single-import\">Importación única</a>.','es',1),(8034,_binary 'Exporta y descarga la configuración completa de su sitio como un archivo tar.gz.','es',1),(8035,_binary 'Escoja un elemento de configuración para mostrar su estructura YAML.','es',1),(8036,_binary 'Importa un único elemento de configuración pegando sus estructura YAML en el campo de texto.','es',1),(8037,_binary 'Archivo completo','es',1),(8038,_binary 'Elemento único','es',1),(8039,_binary 'Planificado','es',1),(8040,_binary 'Los siguientes elementos en su configuración han cambiado la última importación que puede perderse en la próxima importación.','es',1),(8041,_binary 'Colección de configuración @collection','es',1),(8042,_binary 'De @source_name a @target_name','es',1),(8043,_binary 'El módulo Configuration Translation le permite traducir texto de configuración, por ejemplo: el nombre del sitio, vocabularios, menús o formatos de fecha. Junto con los módulos <a href=\":language\">Language</a>, <a href=\":content-translation\">Content Translation</a>, e <a href=\":locale\">Interface Translation</a>, le permite construir sitios web multilingües. Para más información, consulte la <a href=\":doc_url\">documentación online para el módulo Configuration Translation</a>.','es',1),(8044,_binary 'Para poder traducir la configuración, el sitio web debe tener al menos dos <a href=\":url\">idiomas</a>.','es',1),(8045,_binary 'Los usuarios con el permiso de <em>configuración de traducciones editadas por el usuario</em> puede acceder al resumen de configuración de traducción , y gestionar las traducciones de idiomas específicos. La página de <a href=\":translation-page\"> configuración de traducción</a> muestra una lista de todos los textos de configuración que se puede traducir, ya sea como elementos individuales o como listas. Después de hacer clic en <em>Traducir</em>, se le proporciona una lista de todos los idiomas. Puede <em> añadir </em> o <em> editar </em> traducciones de un lenguaje específico. Los usuarios con permisos de configuración específicos pueden también <em> editar </em> el texto para el idioma predeterminado del sitio. Para algunos elementos de texto de configuración (por ejemplo para el sitio de información), las páginas específicas de traducción también se puede acceder directamente desde sus páginas de configuración.','es',1),(8046,_binary 'Puede traducir los formatos de fecha en la página <a href=\":translation-page\">Traducción de configuraciones</a>. Esto te permite no solo traducir el texto de la etiqueta, sino que también puede establecer <em>formatos de fecha PHP</em> específicos para cada idioma.','es',1),(8047,_binary '@label <span class=\"visually-hidden\">(@source_language)</span>','es',1),(8048,_binary 'El módulo Contacto le permite a los visitantes contactar con usuarios registrados de tu sitio mediante un formulario de contacto personal, también permite la configuración de formularios de contacto a nivel de sitio. Para más información visite la <a href=\":contact\">documentación en línea del módulo</a>.','es',1),(8049,_binary 'En la <a href=\":contact_admin\">página de formularios de contacto</a> puede configurar los campos y presentación de los formularios de contacto personales y puede establecer uno o más formularios de contacto para el sitio. Cada formulario de contacto del sitio tiene un nombre de máquina, una etiqueta y uno o más recipientes definidos; cuando un visitante del sitio envía el formulario, los valores de los campos son enviados a esos recipientes.','es',1),(8050,_binary 'Un formulario de contacto del sitio puede ser designado como el predeterminado. Si escoge designar un formulario predeterminado, el enlace de menú <em>Contacto</em> en el menú de <em>Pie de página</em> le enlazará en ello. Puede modificar este enlace desde la <a href=\":menu-settings\">página de menús</a> si tiene instalado el módulo Menu UI. Puede también crear enlaces a otros formularios de contacto; la URL para cada formulario establecido tiene el formato <em>contact/machine_name_of_form</em>.','es',1),(8051,_binary 'Desde la <a href=\":contact_admin\">Página de formularios de contacto</a>, puede configurar los campos a mostrar en los formularios de contacto, incluido su rótulo y texto de ayuda. Si necesita mostrar otros contenidos (como textos o imágenes) en un formulario de contacto utilice un bloque. Puede crear o editar bloques en la <a href=\":blocks\">Página de disposición de bloques</a>, si el módulo Bloques está instalado.','es',1),(8052,_binary '[@form] @subject','es',1),(8053,_binary '@sender-name (@sender-url) le ha enviado un mensaje utilizando el formulario de contacto en @form-url.','es',1),(8054,_binary '[@site-name] @subject','es',1),(8055,_binary 'Hola @recipient-name,','es',1),(8056,_binary '@sender-name (@sender-url) te ha enviado un mensaje a través del formulario de contacto en @site-name.','es',1),(8057,_binary 'Si no desea recibir estos emails, puede cambiar sus opciones en @recipient-edit-url.','es',1),(8058,_binary '@name (no verificado)','es',1),(8059,_binary 'El formulario de contacto no se ha configurado. <a href=\":add\">Añada uno o más formularios</a> .','es',1),(8060,_binary 'El módulo Content Translation le permite traducir contenidos, comentarios, bloques personalizados, términos de taxonomía, usuarios y otras <a href=\":field_help\" title=\"Field module help, with background on content entities\">entidades de contenido</a>. junto con los módulos <a href=\":language\">Language</a>, <a href=\":config-trans\">Configuration Translation</a>, e <a href=\":locale\">Interface Translation</a>, le permite construir sitio web multilingües. Para más información, consulte la <a href=\":translation-entity\">documentación online para el módulo Content Translation</a>.','es',1),(8061,_binary 'Para traducir contenidos, el sitio web debe tener al menos dos <a href=\":url\">idiomas</a>. Si ese es el caso, puede activar la traducción para las entidades de contenido deseadas en la página <a href=\":translation-entity\">Idioma del contenido</a>. Cuando active la traducción, puede escoger el idioma predeterminado para los contenidos y decidir si mostrar el campo de selección de idioma en los formularios de edición de contenido.','es',1),(8062,_binary 'Antes de que pueda traducir contenido, debe haber al menos dos idiomas añadidos en la página de <a href=\":url\">administración de idiomas</a>.','es',1),(8063,_binary 'Para configurar la traducción en este campo, <a href=\":language-settings-url\">active el soporte de idiomas</a> para este tipo.','es',1),(8064,_binary '<a href=\":settings_url\">Active la traducción</a> para <em>tipo de contenidos</em>, <em>vocabularios de taxonomías</em>, <em>cuentas</em>, o cualquier otro elemento que desee traducir.','es',1),(8065,_binary 'El módulo Contextual Links proporciona a los usuarios con el permiso <em>Usar enlaces contextuales</em> acceso rápido a tareas asociados con ciertas áreas de páginas de su sitio. Por ejemplo: un menú que se muestra como un bloque tiene enlaces para editar el menú y configurar el bloque. Para más información, consulte la <a href=\":contextual\">documentación online para el módulo Contextual Links</a>.','es',1),(8066,_binary 'Pasando el cursor sobre el área de interés hace visible el botón de los enlaces contextuales (que tiene aspecto de un lápiz en la mayoría de temas y se muestra normalmente en la esquina superior derecha del área). El icono tiene este típicamente este aspecto: @picture','es',1),(8067,_binary 'Si tiene el <a href=\":toolbar\">módulo Toolbar</a> activado, haciendo clic en el botón de los enlaces contextuales en la barra de herramientas (que tiene aspecto de un lápiz) hará visibles todos los botones de enlaces contextuales de la página, Haciendo clic en este botón una vez más lo cambiará de nuevo a invisible.','es',1),(8068,_binary 'El módulo Datetime proporciona un campo de fecha que almacena fechas y horas. También proporciona elementos de <em>horas</em> y <em>fechas</em> de la API Form para su uso en programación de módulos. Consulte las páginas de <a href=\":field\">ayuda del módulo Field</a> y la <a href=\":field_ui\">ayuda del módulo Field UI</a> para información general en campo y en como crearlos y gestionarlos. Para más información, consulte la <a href=\":datetime_do\">documentación online para el módulo Datetime</a>.','es',1),(8069,_binary 'Las <em>opciones</em> y la <em>visualización</em> del campo de fecha puede ser configurado por separado. Consulte la <a href=\":field_ui\">ayuda de Field UI</a> para más información en como gestionar campos y su visualización.','es',1),(8070,_binary 'Las fechas pueden ser visualizadas usando los formateadores <em>Plano</em> o <em>Predeterminado</em>. El formateador <em>Plano</em> muestra la fecha en el formato <a href=\"http://en.wikipedia.org/wiki/ISO_8601\">ISO 8601</a>. Si escoge el formateador <em>Predeterminado</em>, puede escoger un formato de una lista predefinida que puede ser gestionada en la página de <a href=\":date_format_list\">Formatos de fecha y hora</a>.','es',1),(8071,_binary 'Orden de parte de fecha: @order','es',1),(8072,_binary 'Tipo de tiempo:@time_type','es',1),(8073,_binary 'Incrementos de tiempo: @increment','es',1),(8074,_binary 'El módulo Database Logging anota los suceso del sistema en la base de datos de Drupal. Para más información, consulte la <a href=\":dblog\">documentación en pantalla para el módulo Database Logging</a>.','es',1),(8075,_binary 'El módulo Database Logging le permite ver un log de eventos en la página de <a href=\":dblog\">Log de mensajes recientes</a>. El log es una lista cronológica de eventos grabados que contiene datos de uso, datos de rendimientos, errores, avisos e información operacional. Los administradores deberían comprobar el log con regularidad para asegurarse de que su sitio está funcionando adecuadamente.','es',1),(8076,_binary 'En caso de errores o problemas con su sitio, la página de <a href=\":dblog\">Log de mensajes recientes</a> puede ser útil para depuración, dado que muestra la secuencia de sucesos. Los mensajes de registro incluyen información de uso, avisos y errores.','es',1),(8077,_binary 'El número máximo de mensajes a registrar en el log de la base de datos. Requiere un <a href=\":cron\">tarea de mantenimiento del cron</a>.','es',1),(8078,_binary 'Las páginas adecuadas para ser cacheados son guardadas en la caché la primera vez que se realice la petición, entonces la versión cacheada es servida cuando son pedidas. El contenido dinámico se maneja automáticamente para que se mantenga la corrección de la caché y el ratio de aciertos.','es',1),(8079,_binary 'Cache de Páginas Dinámicas Internas','es',1),(8080,_binary 'El módulo Text Editor proporciona una estructura para otros módulos (como el <a href=\":ckeditor\">módulo CKEditor</a>) que pueden proporcionar barras de herramientas y otras funcionalidades que permiten a los usuarios formatear textos más facilmente que escribiendo etiquetas HTML directamente. Para más información, consulte la <a href=\":documentation\">documentación online para el módulo Text Editor</a>.','es',1),(8081,_binary 'El módulo Text Editor proporciona una estructura para gestión de editores. Para usarlo, también necesitas activar un editor de texto. Este puede ser el <a href=\":ckeditor\">módulo CKEditor</a> del core, que puede ser activado en la <a href=\":extend\">página Extender</a> o un módulo contribuido para cualquier otro editor de texto. Cuando se instale un móudlo de editor de texto contribuido, asegurese de comprobar las instrucciones de instalación porque es probable que necesite descargar e instalar una librería externa además del módulo de Drupal.','es',1),(8082,_binary 'En la <a href=\":formats\">página de Formatos de texto y editores</a>, puede ver qué editor de texto está asociado con cada formato de texto. Puede cambiar esto haciendo clic en el enlace <em>Configurar</em> y después escogiendo un editor de texto o <em>ninguno</em> desde la lista desplegable <em>Editor de texto</em>. El editor de texto se mostrará en cualquier campo de texto para el que escogió ese formato de texto.','es',1),(8083,_binary 'Las <em>opciones</em> y la <em>presentación</em> de los campos de referencia de entidad pueden ser configurados de forma separada. Consulte la <a href=\":field_ui\">ayuda del módulo Field UI</a> para más información en cómo gestionar campos y su visualización.','es',1),(8084,_binary 'No se ha encontrado ninguna vista elegible.  <a href=\":create\">Crear una vista</a> con una <em>Referencia de entidad</em>, o añadirla a una <a href=\":existing\">vista existente</a>.','es',1),(8085,_binary 'El módulo Field permite definir campos de datos personalizados para tipos de <em>entidad</em>. El módulo Field se encarga de almacenar, cargar, editar y mostrar datos de campo. La mayoría de usuarios no interaccionarán con el módulo Field directamente, sino que usarán la interfaz de usuario del <a href=\":field-ui-help\">módulo Field UI</a>. Los desarrolladores de módulos puede usar la API Fieldpara hacer nuevos tipos de entidades que se puedan convertir en campos y por tanto haciendo que los campos se unan a ellos. Para más información, consulte la <a href=\":field\">documentación online para el módulo Field</a>.','es',1),(8086,_binary 'El módulo Field proporciona la infraestructura para los campos, los tipos de campos, formateadores y controles proporcionadores por el núcleo de Drupal y los módulos adicionales. Algunos de los módulos son requeridos, los módulos opcionales pueden ser activados desde la <a href=\":modules\">página de administración de extensiones</a>.  Los campos adicionales y formateadores y controles pueden ser proporcionados por módulos contribuidos que puede encontrarse en la <a href=\":contrib\">sección de módulos contribuidos de Drupal.org</a>.','es',1),(8087,_binary 'El módulo Field UI proporciona un interfaz de usuario (UI) administrativo para gestión y visualización de campos. Los campos pueden vincular a la mayoría de subtipos de entidades de contenidos. Los diferentes tipos de campo, controles y formateadores son proporcionados por los módulos activados en su sitio y gestionados por el módulos Field. Para obtener información de base y terminología relacionada con los campos y entidades, consulte la <a href=\":field\">página de ayuda del módulo Field</a>. Para más información sobre el Field UI, consulte la <a href=\":field_ui_docs\">documentación online para el módulo Field UI</a>.','es',1),(8088,_binary 'Puede añadir, editar y borrar modos de visualización para las entidades en la <a href=\":view_modes\">página Modos de Visualización</a>, y puede añadir, editar y borrar modos de formulario para las entidades en la <a href=\":form_modes\">página de Modos de formulario</a>. Una vez haya definido un modo de visualización o modo de formulario para un tipo de entidad, este estará disponible en la página de Gestión o de Gestión de formulario para cada subtipo de cada entidad.','es',1),(8089,_binary 'Hay dos informes disponibles que listan los campos definidos en sus sitio. El informe de <a href=\":entity-list\" title=\"Entities field list report\">Entidades</a> listan todos sus campos, mostrando los nombres máquina de los campos, tipos y tipos de entidods o subtipo que se usan (cada subtipo enlaza con la página de Gestión de campos). Si los módulos <a href=\":views\">Views</a> y <a href=\":views-ui\">Views UI</a> están activados, el informe <a href=\":views-list\" title=\"Used in views field list report\">Usados en vistas</a> lista cada campo que está siendo usado en una vista con un enlace para editar la vista.','es',1),(8090,_binary 'Aún no se han añadido campos. Puede añadir nuevos campos en la página <a href=\":link\">Administrar campos</a>.','es',1),(8091,_binary 'El modo %display_mode ahora usa opciones de visualización personalizado. Tal vez quiera <a href=\":url\">configurarlos</a>.','es',1),(8092,_binary 'Archivo de @field_name','es',1),(8093,_binary 'El módulo File le permite crear campos que contengan archivos. Consulte la <a href=\":field\">ayuda del módulo Field</a> y la <a href=\":field_ui\">ayuda de Field UI</a> para obtener información general en campos y como crear y gestionarlos. Para más información, consulte la <a href=\":file_documentation\">documentación online del módulo File</a>.','es',1),(8094,_binary 'Las <em>opciones</em> y <em>presentación</em> del campo de archivo se pueden configurar por separado. Consulte la <a href=\":field_ui\">ayuda de Field UI</a> para más información sobre su administración y presentación.','es',1),(8095,_binary 'Los archivos subidos pueden ser almacenados como <em>público</em> o <em>privado</em>, dependiendo en las <a href=\":file-system\">Opciones del sistema de archivos</a>.  Para más información. consulte la <a href=\":system-help\">página de ayuda del módulo System</a>.','es',1),(8096,_binary 'El archivo usado en el campo @name puede no estar referenciado.','es',1),(8097,_binary 'El archivo al que hace referencia el campo @name no existe.','es',1),(8098,_binary 'Puede crear y editar formatos de texto en la <a href=\":formats\">página de Formatos de texto</a> (si el módulos Text Editor está activado, la página se llamará Formatos de texto y editores). Un formato de texto es incluído de forma predeterminada: Texto sin formato(lo que elimina todas las etiquetas HTML). Formatos de texto adicionales pueden ser creados durante la instalación. Puede crear un formato de texto haciendo clic en <a href=\":add_format\">Añadir formato de texto</a>\".','es',1),(8099,_binary 'Para más información, consulte las <a href=\":html-specifications\">Especificaciones de HTML</a> del W3C o utilice su motor de búsqueda favorito para encontrar otros sitios que traten sobre HTML.','es',1),(8100,_binary 'Si encuentra problemas, intente usando entidades de caracteres HTML. Un ejemplo común es &amp;amp; para un caracter ampersand &amp;. Para conocer un lista completa de entidades, consulte la página de <a href=\":html-entities\">entidades HTML</a>. Algunos de los caracteres disponibles incluyen:','es',1),(8101,_binary 'Limita las etiquetas HTML permitidas y corrige el HTML incorrecto','es',1),(8102,_binary 'El módulo Forum añade y utiliza un tipo de contenido llamado <em>Tema de foro</em>. Para más información de base en tipos de contenido, consulte la <a href=\":node_help\">página de ayuda del módulo Node</a>.','es',1),(8103,_binary 'Para más información, consulte la <a href=\":forum\">documentación en línea del módulo Forum</a>.','es',1),(8104,_binary 'Visite la <a href=\":forums\">página de Foros</a> para establecer contenedores o foro para mantener temas de discusión.','es',1),(8105,_binary 'El enlace <a href=\":create-topic\">Temas de foro</a> en la página <a href=\":content-add\">Añadir contenido</a> crea el primer post de una nueva discusión o hilo.','es',1),(8106,_binary 'Activar el módulo Forum proporciona un elemento de menú predeterminado <em>Foros</em> en el menú Herramientas que enlaza en la <a href=\":forums\">página de Foros</a>.','es',1),(8107,_binary 'Ajusta la visualización de sus temas de foro. Organice los foros en la <a href=\":forum-structure\">página de estructura del foro</a>.','es',1),(8108,_binary 'Para desinstalar Forum, primero borre los término de vocabulario <a href=\":url\">%vocabulary</a>','es',1),(8109,_binary 'No hay contenedores o foros disponibles. <a href=\":container\">Añadir contenedor</a> o <a href=\":forum\">Añadir foro</a>.','es',1),(8110,_binary '<a href=\":hal_spec\">Hypertext Application Language (HAL)</a> es un formato que soporta el enlazado requerido para APIs hipermedia.','es',1),(8111,_binary 'Este módulo añade soporte para entidades serializadas (como elementos de contenido, términos de taxonomía, etc...) a la versión JSON de HAL. Para más información, consulte la <a href=\":hal_do\">documentación online para el módulo HAL</a>.','es',1),(8112,_binary '<strong>Configure su sitio web</strong>. Una vez iniciado la sesión, visite la <a href=\":admin\">página de Administración</a>, donde puede <a href=\":config\">personalizar y configurar</a> todos los aspectos de su sitio web.','es',1),(8113,_binary '<strong>Active funcionalidades adicionales</strong>. Después, visite la <a href=\":modules\">página de Extender</a> y active los módulos que encajen sus necesidades específicas. Puede encontrar módulos adicionales en la <a href=\":download_modules\">página de módulos de Drupal.org</a>.','es',1),(8114,_binary '<strong>Personalice su diseño del sitio web</strong>. Para cambiar la apariencia de su sitio web, visite la <a href=\":themes\">página de Apariencia</a>. Puede escoger de uno de los temas incluidos o descargar temas adicionales desde la <a href=\":download_themes\">página de temas de Drupal.org</a>.','es',1),(8115,_binary '<strong>Empiece a postear contenido</strong> Finalmente, puede <a href=\":content\">añadir nuevo contenido</a> a su sitio web.','es',1),(8116,_binary 'El módulo Help genera <a href=\":help-page\">páginas de ayuda de referencia</a> para guiarle por el uso y configuración de módulos y proporciona un bloque Ayuda con ayuda a nivel de página. Las páginas de referencia son punto de partida para las páginas de <a href=\":handbook\">documentación online de Drupal.org</a> que contienen información más extensa y actualizada, anotados con comentarios contribuidos por los usuarios y sirven como el punto de referencia definitivo para toda la documentación de Drupal. Para más información, consulte la <a href=\":help\">documentación online para el módulo Help</a>.','es',1),(8117,_binary 'El módulo Ayuda muestra explicaciones para el uso de cada módulo listado en la principal <a href=\":help\">Página de ayuda de referencia</a>.','es',1),(8118,_binary 'Texto de ayuda específico para la página proporcionado por módulos son mostrados en el bloque Ayuda. Este bloque puede ser colocado y configurado en la <a href=\":blocks\">página de Diseño de bloques</a>.','es',1),(8119,_binary 'El módulo History registra qué contenidos ha leído un usuario. Marca el contenido como <em>nuevo</em> o <em>actualizado</em> dependiendo de la última vez que el usuario lo vió. Los régistros del historial que son más antiguos de un messon eliminados durante el cron, lo que implica que los contenidos de hace más un mes siempre se consideran como <em>leído</em>. el módulo History no tiene una interfaz de usuario pero proporcioina un filtro a <a href=\":views-help\">Views</a> para mostrar contenidos nuevos o actualizados. Para más información, consulte la <a href=\":url\">documentación online para el módulo History</a>.','es',1),(8120,_binary 'imagen de @field_name','es',1),(8121,_binary 'El módulo Image le permite crear campos que contengan archivos de imagen y configurar <a href=\":image_styles\">estilos de imagen</a> que puedan ser usados para manipular la visualización de las imágenes. Consulte las páginas de <a href=\":field\">ayuda del módulo Field</a> y la <a href=\":field_ui\">ayuda del módulo Field UI</a> para conocer la terminología e información general sobre las entidades, campor y en cómo crear y gestionar campos. Para más información, consulte la <a href=\":image_documentation\">documentación online para el módulo Image</a>.','es',1),(8122,_binary 'El concepto de estilo de imagen consiste en que puede subir una única imagen para visualizarlo de varias maneras; cada variación de visualización o <em>estilo de imagen</em> es el resultado de aplicar uno o más <em>efectos</em> a la imagen original. Por ejemplo: puede subir una imagen de alta resolución con una relación de aspecto de 4:3 y visualizarlo a menor tamaño, recortado a un cuadrado o en blanco y negro (o cualquier otra combinación de estos efectos). El módulo Image proporciona una manera de hacer esto eficientemente, configurando un estilo de imagen con los efectos deseados en la <a href=\":image\">página de Estilos de imagen</a> y la primera vez que una imagen en particular se pida en ese estilo, los efectos son aplicados. La imagen resultante se guarda y la próxima vez que se pida el mismo estilo, la imagen guardada es utilizado sin necesidad de recalcular los efectos. el núcleo de Drupal proporciona varios efectos que puede utilizar para definir estilo; otros pueden ser proporcionandos por módulos contribuidos.','es',1),(8123,_binary 'Cuando crea un campo de imagen, necesitará escoger si las imágenes subidas serán lamacenadas en el directorio público o el privado definido en el archivo settings.php y que se muestra en la <a href=\":file-system\">página de Sistema de archivo</a>. Esta elección no puede ser cambiada más tarde. Puede también configurar su campo para almacenar archivos en un subdirectorio del diretorio público o privado; esta opción puede ser cambiada más tarde y puede ser diferente para cada subtipo de entidad usando el campo. Para más información en almacenamiento de archivos, consulte la <a href=\":system-help\">página de ayuda del módulo System</a>.','es',1),(8124,_binary 'No hay estilos en estos momentos. <a href=\":url\">Añadir uno nuevo</a>.','es',1),(8125,_binary 'Tanto los valores de altura como de anchura deben ser especificados en el campo @name.','es',1),(8126,_binary 'El identificador primario para un estilo de imágen.','es',1),(8127,_binary 'El nombre máquina del estilo.','es',1),(8128,_binary 'El nombre administrativo del estilo.','es',1),(8129,_binary 'Puede añadir idioma en la página <a href=\":language_list\">Idiomas</a> selccionando <em>Añadir idioma</em> y eligiendo un idioma del menú desplegable. Este idioma se mostrará entonces en la lista de idiomas, donde se podrá configurar en más profundidad. Si el <a href=\":interface\">módulo Interface translation</a> está activado y el <em>servidor de traducción</em> está establecido como fuente de traducciones, entonces la interfaz de traducción para este idioma se descargará automáticamente.','es',1),(8130,_binary 'De manera predeterminada, el contenido se crea en el idioma predeterminado del sitio y no se muestra ningún selector de idioma en las páginas de creación de contenido. En la página <a href=\":content_language\">Idioma del contenido</a> puede personalizar la configuración de idiomas para cualquier entidad de contenido soportado en su sitio (por ejemplo: para tipos de contenido o enlaces de menú). Después de escoger una entidad, se le proporciona un menú desplegable para establecer el dioma predeterminado y una caja de selección para mostrar selectores de idioma.','es',1),(8131,_binary 'Si el módulo Block está activado, entonces puede añadir un bloque para cambiar el idioma en la página de <a href=\":blocks\">Diseño de bloques</a> para permitir a los usuarios cambiar entre idiomas.','es',1),(8132,_binary 'Si el módulo Block está activado, entonces el módulo Language le permite establecer la visibilidad de un bloque basada en idiomas seleccionados en la página de <a href=\":blocks\">Diseño de bloques</a>.','es',1),(8133,_binary 'La página de <a href=\":detection\">Detección y selección</a> proporciona varios métodos para decidir qué idioma es usado al mostrar el texto de la interfaz. Cuando un método detecta y selecciona un idioma de interfaz, entonces los métodos siguientes en la lista no se aplican. Puede ordenarlos por importancia, con su método preferido en lo más alto de la lista, seguido uno o varios métodos de respaldos.','es',1),(8134,_binary '<em>El navegador</em> establece el idioma de la interfaz basado en las opciones de idioma del navegador. Dado que los navegadores usan diferentes códigos de idioma para referirse a los mismos idiomas, puedes añadir y editar códigos de idiomas para los códigos de idiomas del navegador a los <a href=\":language_list\">códigos de idioma</a> usados en su sitio.','es',1),(8135,_binary 'Reordene los idiomas configurados para establecer su orden en el bloque de selección de idioma y, al editar contenido, en la lista de idiomas seleccionables. Este orden no influye en la <a href=\":detection\">detección y selección</a>.','es',1),(8136,_binary 'El idioma predeterminado del sitio puede también ser establecido. No se recomienda cambiar el idioma predeterminado en el sitio en proceso. La opción <a href=\":language-detection\">Configurar el idioma seleccionado</a> en la página de detección y selección permite cambiar el idioma de reserva para la selección de idioma.','es',1),(8137,_binary 'Defina cómo decidir qué idiomas se usan para mostrar elementos de la página (principalmente texto proporcionado por los módulos, como etiquetas de campo y texto de ayuda). Esta decisión se realiza evaluando una serie de métodos de detección para idiomas; el primer método de detección que obtenga un resulta será el que determine qué idioma se usa para ese tipo de texto. Tenga en cuenta que algunos métodos de detección de idiomas son poco fiables en cierta condiciones, como la detección del navegador cuando la caché de página está activada y un usuario no ha iniciado sesión en ese momento. Defina el orden de evaluación de los métodos de detección de idiomas en está página. El idioma predeterminado puede ser cambiado en la <a href=\":admin-change-language\">lista de idiomas</a>.','es',1),(8138,_binary 'Los navegadores utilizan diferentes códigos de idiomas para referirse a los mismos idiomas. Internamente, se realiza un esfuerzo importante para determinar el idioma correcto basado en el código enviado por el navegador. Puede añadir y editar mapeados adicionales desde los códigos de idioma del navagador a los <a href=\":configure-languages\">idiomas del sitio</a>.','es',1),(8139,_binary 'Cambiar el idioma seleccionado aquí (y dejar esta opción como la última en las opciones de detección y selección) es la manera más fácil de cambiar el idioma de respaldo para el sitio web, si necesita cambiar como funciona su sitio de manera predeterminada (por ejemplo: cuando se usa un prefijo de ruta vacío o usando el dominio predeterminado). <a href=\":admin-change-language\">Cambiar el idioma predeterminado del sitio</a> en sí mismo podría tener otros efectos secundarios no deseados.','es',1),(8140,_binary 'Utilice uno de los bloques de selección de idioma para permitir a los visitantes del sitio cambiar entre idiomas. Puede activar estos bloques en la <a href=\":block-admin\">página de administración de bloques</a>.','es',1),(8141,_binary 'Utilice códigos de idioma tal y como están <a href=\":w3ctags\">definidos por la W3C</a> por motivos de interoperabilidad. <em>Ejemplos: \"en\", \"en-gb\" y \"zh-hant\".</em>','es',1),(8142,_binary '%field debe estar en un idioma válido <a href=\":url\">definido por la W3C</a>.','es',1),(8143,_binary 'El prefijo sólo puede ser dejado en blanco para el <a href=\":url\">idioma de respaldo seleccionado de detección.</a>','es',1),(8144,_binary 'El módulo Link le permite crear campos que contengan URLs internas o externas y enlaces opcionales de texto. Consulte las páginas de <a href=\":field\">ayuda del módulo Field</a> y las de <a href=\":field_ui\">ayuda del módulo Field UI</a> para obtener información general sobre los campos, en cómo crearlos y gestionarlos. Para más información, consulte la <a href=\":link_documentation\">documentación online para el módulo Link</a>.','es',1),(8145,_binary 'Las <em>opciones</em> y la <em>visualización</em> del campo de enlace puede ser configurado de forma separada. Consulte la <a href=\":field_ui\">ayuda de Field UI</a> para obtener más información en cómo gestionar campos y su visualización.','es',1),(8146,_binary 'Un archivo de traducción no pudo ser comprobado. <a href=\":url\">Consulte el log</a> para más detalles.@count archivos de traducción no pudieron ser comprobados. <a href=\":url\">Consulte el log</a> para más detalles.','es',1),(8147,_binary '@message (@percent%).','es',1),(8148,_binary 'Un archivo de traducción no puede ser importado. <a href=\":url\">Consulte el log</a> para más detalles.@count archivos de traducción no pudieron ser importados. <a href=\":url\">Consulte el log</a> para más detalles.','es',1),(8149,_binary 'Una cadena de traducción fue omitida debido a HTML mal formado o no permitido. <a href=\":url\">Consulte el log</a> para más detalles.@count cadenas de traducción fueron omitidas debido a HTML mal formado o no permitido. <a href=\":url\">Consulte el log</a> para más detalles.','es',1),(8150,_binary 'El módulo Interface Translation le permite traducir texto de la interfaz (<em>cadenas</em>) en diferentes idiomas y cambiar entre ellos en la visualización del texto de la interfaz. Utiliza la funcionalidad proporcionanada por el <a href=\":language\">módulo Language</a>. Para más información, consulte la <a href=\":doc-url\">documentación online para el módulo Interface Translation</a>.','es',1),(8151,_binary 'Los archivos de traducción con texto de la interfaz traducida son importados automaticamente cuando se añaden idiomas en la página de <a href=\":languages\">Idiomas</a> o cuando se activan módulos o temas. En la página de <a href=\":locale-settings\">Opciones de traducción de la interfaz</a>, la <em>fuente de traducción</em> puede restringirse a solo archivos locales o incluir el <a href=\":server\">servidor de traducción de Drupal</a>. Aunque los módulos y temas no estén completamente traducidos en todos los idiomas, nuevas traducciones se vuelven disponibles con frecuencia. Puede especificar si quiere y con qué frecuencia comprobar las actualizaciones de archivos de traducción y si quiere sobrescribir traducciones existentes en la página de <a href=\":locale-settings\">Opciones de traducción de la interfaz</a>. Puede también importar manualmente un archivo de traducción en la página de  <a href=\":import\">Importar traducción de la interfaz</a>.','es',1),(8152,_binary 'Puede comprobar cuanto de la interfaz de su sitio está traducido en qué idiomas en la página de <a href=\":languages\">Idiomas</a>. En la página de <a href=\":translation-updates\">Actualizaciones de traducción disponibles</a>, puede comprobar si hay disponibles nuevas actualizaciones de traducción de la interfaz en el <a href=\":server\">servidor de traducción de Drupal</a>.','es',1),(8153,_binary 'Puede traducir cadenas individuales directamente en la página de <a href=\":translate\">Traducción de interfaz de usuario</a> o descargar el archivo de traducción usado actualmente para un idioma específico en la página de <a href=\":export\">Exportar traducción de la interfaz</a>. Una vez haya editado el archivo de traducción, puede importarlo de nuevo en la página de <a href=\":import\">Importar traducción de la interfaz</a>.','es',1),(8154,_binary 'Las traducciones de interfaz son importados automáticamente cuando se añade un idioma o cuando se activan nuevos módulos o temas. El informe <a href=\":update\">Actualizaciones de traducciones disponibles</a> muestra el estado. el texto de la interfaz puede ser personalizado en la página de <a href=\":translate\">Traducción de interfaz de usuario</a>.','es',1),(8155,_binary 'Esta página permite a un traductor buscar textos concretos traducidos o sin traducir y se usa para crear o editar traducciones. <strong>Advertencia:</strong> Debido a que las tareas de traducción implican muchas textos, puede ser más conveniente <a title=\"User interface translation export\" href=\":export\">exportarlos</a> para editarlos en un editor de traducción offline de escritorio de tipo Gettext). Las búsquedas pueden limitarse a los textos de un idioma específico.','es',1),(8156,_binary 'Los archivos de traducción son descargados automáticamente e importados cuando <a title=\"Languages\" href=\":language\">idiomas</a> son añadidos cuando módulos o temas son activados.','es',1),(8157,_binary 'Esta página permite a los traductores importar manualmente cadenas traducidas contenidos en un archivo Gettext Portable Object (.po). La importación manual puede ser usado para traducciones personalizadas o para la traducción de módulos y temas personalizados. Para personalizar trauducciones puede descargar un archivo de traducción desde el <a href=\":url\">servidor de traducción de Drupal</a> o <a title=\"User interface translation export\" href=\":export\">exportar</a> traducciones desde el sitio, personalizar las traducciones usando el editor de traducción Gettext e importar el resultado usando esta página.','es',1),(8158,_binary 'El estado de traducción no está disponible. Consulte la página de <a href=\":updates\">Actualizaciones de traducción disponibles</a> para más información.','es',1),(8159,_binary 'Interfaz de configuraciones de traducción','es',1),(8160,_binary 'Exportar traducción de la interfaz','es',1),(8161,_binary 'Seleccione con qué frecuencia quiere comprobar si hay nuevas traducciones de interfaz para sus módulos y temas instalados. <a href=\":url\">Comprobar actualizaciones ahora</a>.','es',1),(8162,_binary 'Los archivos de traducción se almacenan localmente en el directorio %path. Puede cambiar este directorio en la página de configuración <a href=\":url\">Sistema de archivo</a>.','es',1),(8163,_binary 'Los archivos de traducción no se almacenarán localmente. Cambie el directorio de traducción de interfaz en la página de configuración <a href=\":url\">Sistema de archivo</a>.','es',1),(8164,_binary 'Ha seleccionado un fuente local de traducción, pero no ha configurado ningún <a href=\":url\">Directorio de traducción de interfaz</a>.','es',1),(8165,_binary 'No hay disponible ningún idioma traducible. <a href=\":add_language\">Añada un idioma</a> primero.','es',1),(8166,_binary 'El estado de traducción no está disponible. <a href=\":check\">Compruébelo manualmente</a>.','es',1),(8167,_binary 'Se requiere por el módulo Menu UI, que proporciona una interfaz para gestión de menús y enlaces de menus. Para más información, consulte la <a href=\":menu-help\">página de ayuda del módulo Menu UI</a> y la <a href=\":drupal-org-help\">documentación online para el módulo Custom Menu Links</a>.','es',1),(8168,_binary 'Para más información, consulte la <a href=\":drupal-org-help\">documentación online para el módulo Custom Menu Links</a>. si activa el módulo Menu UI, este le proporcionanará una interfaz para la gestión de menus y enlaces de menu.','es',1),(8169,_binary 'El módulo Menu UI proporciona una interfaz para la gestión de menús. Un menú es una colección jerárquica de enlaces, que puede ser interna o externa al sitio, generalmente usado para navegación. Para más información, consulte la <a href=\":menu\">documentación online para el módulo Menu UI</a>.','es',1),(8170,_binary 'Los usuarios con el permiso <em>Administrar menús y elementos de menú</em> pueden añadir, editar y borrar menús personalizado en la <a href=\":menu\">página de Menús</a>. Menús personalizados puede ser menú especiales del sitio, menús de enlaces externos o cualquier combinación de enlaces internos o externos. Puede crear un número ilimitado de menús adicionales, cada uno irá automáticamente con un bloque asociado (si tiene el <a href=\":block_help\">módulo Block</a> instalado). Seleccionado el <em>menú Editar</em>, puede añadir, editar o borrar enlaces para un menú dado. Los enlaces listados en la página proporciona una interfaz de arrastar y soltar para controlar el orden de enlaces y creando una jerarquía dentro del menú.','es',1),(8171,_binary 'Si tiene el módulo Block activado, entonces cada menú que crea se muestra en un bloque que puede activar y colocar en la <a href=\":blocks\">página de Diseño de diseño</a>. En algunos <a href=\":themes\">temas</a>, El menú principal y posiblemente el menú secundario se mostrará automáticamente; podría ser capaz de desactivar este comportamiento en la <a href=\":themes\">página de opciones de tema</a>.','es',1),(8172,_binary 'Puede activar los nuevos bloques creados para este menú en la <a href=\":blocks\">página de Diseño de bloques</a>.','es',1),(8173,_binary 'Cada menú tiene un bloque correspondiente que se gestionan en la <a href=\":blocks\">página de Diseño de bloques</a>.','es',1),(8174,_binary 'Aún no hay enlaces de menú. <a href=\":url\">Añadir enlace</a>.','es',1),(8175,_binary 'El módulo Migrate proporciona un sistema para la migración de datos, normalmente desde una fuente externa hasta sus sitios. No proporciona una interfaz de usuario. Para más información, consulte la <a href=\":migrate\">documentación online para el módulo Migrate</a>.','es',1),(8176,_binary 'La migración ha fallado con la excepción de fuente de extensión: @e','es',1),(8177,_binary 'El uso de memoria es de @usage (@pct% de límite @limit), reclamando memoria.','es',1),(8178,_binary 'El uso de memoria es ahora de @usage (@pct% de límite @limit), no se ha reclamado suficiente, iniciando nuevo lote','es',1),(8179,_binary 'El uso de memoria es ahora de @usage (@pct% de límite @limit), se ha reclamado suficiente, continuando','es',1),(8180,_binary 'El módulo Migrate de Drupal proporciona una estructura basada en el <a href=\":migrate\">módulo Migrate</a> para facilitar la migración desde un sitio de Drupal (6, 7 o 8) hasta su sitio web. No proporciona una interfaz de usuario. Para más información, consulte la <a href=\":migrate_drupal\">documentación online para el módulo Migrate Drupal</a>.','es',1),(8181,_binary 'Los permisos de acceso de contenido necesitan ser reconstruidos. <a href=\":node_access_rebuild\">Reconstruir permisos</a>.','es',1),(8182,_binary 'El módulo Node gestiona la creación, edición, borrado, opciones y visualización de los contenidos del sitio principal. Los objetos de contenido gestionados por el módulo Node son tipicamente mostrados como páginas en su sitio, e incluyen un título, algunos metadatos (autor, fecha de creación, tipo de contenido, etc...) y algunos campos opcionales que contienen texto y otros datos (los campos son gestionados por el <a href=\":field\">módulo Field</a>). Para más información, consulte la <a href=\":node\">documentación online para el módulo Node</a>.','es',1),(8183,_binary 'Cuando se crea nuevo contenido, el módulo Node registra información sobre el contenido, incluyendo el autor, fecha de creación y el <a href=\":content-type\">Tipo de contenido</a>. También gestiona las <em>opciones de publicación</em>, que define si el contenido es publicado, promocionado a la página principal del sitio y/o se mantiene en lo más alto de las listas de contenido. Las opciones predeterminadas pueden ser configurados para cada <a href=\":content-type\">tipo de contenido</a> de su sitio.','es',1),(8184,_binary 'El módulo Node da a los usuarios con el permiso <em>Administrar tipos de contenido</em> la habilidad de <a href=\":content-new\">crear nuevos tipos de contenido</a> además de los predeterminados ya configurados. Crear tipos de contenidos personalizados le da flexibilidad para añadir <a href=\":field\">campos</a> y configurar opciones predeterminadas que encajen las necesidades diferenciadoras de la variedad de contenidos del sitio.','es',1),(8185,_binary 'La página de <a href=\":content\">Contenidos</a> lista su contenido, permitiendole añadir nuevo contenido, filtrarlos, editarlo o borrar contenido existente y realizar operaciones masivas en contenidos existente.','es',1),(8186,_binary 'El módulo Node hace disponible un cierto número de permisos para cada tipo de contenido, que puede ser establecidos por roles en la <a href=\":permissions\">página de permisos</a>.','es',1),(8187,_binary 'Este texto será mostrado en la página <em>Añadir nuevo contenido</em>.','es',1),(8188,_binary 'No hay tipos de contenido disponibles. <a href=\":link\">Añadir tipo de contenido</a>.','es',1),(8189,_binary 'El módulo Options le permite crear campos donde los valores de los datos son seleccionados de un lista fija de opciones. Normalmente estos objetos son introducidos a través de lista de selección, cajas de selección o botones de radio. Consulte las páginas de <a href=\":field\">ayuda del módulo Field</a> y <a href=\":field_ui\">ayuda del módulo Field UI</a> para obtener información general sobre los campos y en cómo crearlos y gestionarlos. Para más información, consulte la <a href=\":options_do\">documentación online para el módulo Options</a>.','es',1),(8190,_binary 'Las <em>opciones</em> y la <em>presentación</em> de los campos de listas se pueden configurar por separado. Consulte la <a href=\":field_ui\">ayuda de Field UI</a> para obtener más información sobre su administración y presentación.','es',1),(8191,_binary 'El módulo Internal Page Cache guarda una caché de las páginas para usuarios anónimos en la base de datos. Para más información, consulte la <a href=\":pagecache-documentation\">documentación online para el módulo Internal Page Cache</a>.','es',1),(8192,_binary 'Las páginas son normalmente identicas para todos los usuarios anónimos, mientras que pueden ser personalizadas para cada usuario registrado. Éste es el motivo por el  que páginas enteras se pueden poner en caché para usuarios anónimos, mientras que tienen que reconstruirse para cada usuario registrado.','es',1),(8193,_binary 'Para aumentar la velocidad de su sitio para usuarios registrados, consulte la <a href=\":dynamic_page_cache-help\">ayuda del módulo Dynamic Page Cache</a>.','es',1),(8194,_binary 'El módulo Path le permite especificar un alias, o URL personalizada, por cualquier ruta interna del sistema existente. Los alias ​​no deben confundirse con las redirecciones de URL, que le permite redirigir una URL cambiada o inactiva a una nueva URL. Además de hacer las URL más legibles, el alias también ayudan a los buscadores a indexar el contenido de manera más efectiva. Múltiples alias pueden ser utilizados para una ruta del sistema interior único. Para automatizar el alias de la ruta, puede instalar el módulo contribuido <a href=\":pathauto\"> Pathauto </a>. Para obtener más información, consulte la <a href=\":path\"> documentación en línea para el módulo Path</a>.','es',1),(8195,_binary 'Si crea o edita un término taxonomía puede agregar un alias (por ejemplo, <em>música/Jazz</em>) en el campo \"URL alias\". Al crear o editar contenido puede agregar un alias (por ejemplo, <em>about-us/equipo</em>), bajo la sección \"configuración de ruta de URL\" en el campo \"URL alias\". Alias ​​para cualquier otra ruta de se pueden añadir a través de la página <a href=\":aliases\">URL alias</a>. Para añadir alias de un usuario necesita el permiso <a href=\":permissions\"> Crear y editar los alias de URL</a>.','es',1),(8196,_binary 'El módulo Path proporciona un manera de buscar y visualizar una <a href=\":aliases\">lista de todos los alias</a> que están en uso en su sitio web. Los alias puede ser añadidos, editados y borrados a través de esta lista.','es',1),(8197,_binary 'No hay alias de URL disponibles. <a href=\":link\">Añadir alias de URL</a>.','es',1),(8198,_binary 'La ruta del sistema interno.','es',1),(8199,_binary 'El alias de la ruta.','es',1),(8200,_binary 'El módulo Quick Edit permite a los usuarios con los permisos <a href=\":quickedit_permission\">Acceso al editor en línea</a> y <a href=\":contextual_permission\">Usar enlaces contextuales</a> editar contenido de los campos sin necesidad de ir a una página separada. Para más información, consulte la <a href=\":handbook_url\">documentación online para el módulo Quick Edit</a>.','es',1),(8201,_binary 'Para editar contenido en el sitio, necesita activar el modo edición rápida para un objeto de contenido. Active el modo edición rápida seleccionando Edición rápida desde los enlaces contextuales para un área en el que se muestre contenido (consulte la <a href=\":contextual\">ayuda del módulo Contextual Links</a> para obtener más información sobre como usar los enlaces contextuales).','es',1),(8202,_binary 'El módulo RDF enriquece su contenido con metadatos para que otras aplicaciones (como por ejemplo: motores de busqueda o agregadores entre otros) comprendan mejor sus relaciones y atributos. Esta salida enriquecida, legible por la máquina para su sitio web utiliza la <a href=\":rdfa\">especificación RDFa</a>, que le permite a los datos RDF incrustarse en el código HTML. Otros módulos pueden definir mapeados de sus datos a términos RDF y el módulo RDF hace disponible los datos RDF al tema. Los módulos del núcleo define los mapeados RDF para sus modelos de datos y los temas del núcleo producen a la salida esta información de metadatos RDF junto con información visual legible para humanos. Para más información, consulte la <a href=\":rdf\">documentación online para el módulo RDF</a>.','es',1),(8203,_binary 'El módulo Responsive Image proporciona un formateador de imagen que permite a los navegadores seleccionar que archivo de imagen mostrar basado en consultas de medios o qué tipo de archivo de imagen soporta el navegador, usando las imagenes de HTML5 y elementos de la fuente y/o los tamaños, srcset y atributos de tipos. Para más información, consulte la <a href=\":responsive_image\">documentación online para el módulo Responsive Image</a>.','es',1),(8204,_binary 'Creando estilos de imagen adaptables, define qué opciones el navegador tiene seleccionando que archivos de imagenes mostrar. En muchos casos esto significa proporcionar diferentes tamaños de imágenes basados en el tamaño de la ventana. En la página de <a href=\":responsive_image_style\">estilos de imagen adaptables</a>, haga clic en <em>añadir estilo de imagen adaptable</em> para crear un nuevo estilo. Primero escoja una etiqueta, un estilo de imagen de reserva y un grupo de punto de interrupción y haga clic en Guardar.','es',1),(8205,_binary 'Los grupos de puntos de interrupción típicamente sólo necesitan un único punto de interrupción con una consulta de medios vacía para el <em>dimensionamiento del visor.</em> Múltiples puntos de interrupción son usados para cambiar el recorte o la relación de aspecto de la imágenes en diferentes tamaños del visor, lo que refiere a menudo como <em>dirección de arte.</em> Una vez haya seleccionado un grupo de puntos de interrupción, puede escoger que puntos de interrupción usar para el estilo de imagen adaptable. De manera predeterminada, la opción <em>no usar este punto de interrupción</em> está seleccionada para cada punto de interrupción. Consulte la <a href=\":breakpoint_help\">página de ayuda del módulo Breakpoint</a> para obtener más información.','es',1),(8206,_binary 'Debajo del campo Tamaño puede escoger múltiples estilos de imagen para que el navegador pueda escoger el mejor tamaño de archivo de imagen para rellenar el espacio definido en el campo Tamaño. Tipicamente querrá usar estilo de imagen que cambiar el tamaño de su imagen para tener opciones que oscilan desde el ancho mínimo de píxeles posible para el espacio donde aparecerá la imagen hasta la anchura más grande de píxeles posibles con una variedad de ancho en medio. Puede querer proporcionar estilos de imagen con ancho que sean entre 1.5 a 2 veces el tamaño disponible en el diseño que consideran las pantallas de alta resolución. Los estilos de imagen puede ser definidos en la <a href=\":image_styles\">página de Estilos de imagen</a> que son proporcionados por el <a href=\":image_help\">módulo Image</a>.','es',1),(8207,_binary 'Después de definir los estilos de imagen adaptable, puede usarlos en las opciones de visualización para sus campos de Imagen para que así el sitio muestre imágenes adaptables usando la etiqueta de imagen HTML5. Abra la página de Gestión de visualización para el tipo de entidad (tipo de contenido, vocabulario de taxonomía, etc...) donde el campo de imagen esté vinculado. Escoja el formato <em>Imagen Adaptable</em>, haga clic en el icono Editar y seleccionar uno de los estilos de imágenes adaptables que haya creado. Para obterner información general en como manejar campos y su visualización, consulte la <a href=\":field_ui\">página de ayuda del módulo Field UI</a>. Para obtener información de fondo sobre entidades y campos, consulte la <a href=\":field_help\">página de ayuda del módulo Field/a>.','es',1),(8208,_binary 'Ver la <a href=\":responsive_image_help\">página de ayuda de Imágenes Adaptables</a> para información acerca del atributo de tamaño.','es',1),(8209,_binary 'Configurar estilos de imágenes adaptables','es',1),(8210,_binary 'Para usar REST en un sitio web, necesita instalar módulos que proporcionen los servicios de serialización y autenticación. Puede usar el módulo del núcleo <a href=\":hal\">HAL</a> para la serialización y el módulo <a href=\":basic_auth\">HTTP Basic Authentication</a> para la autenticación, o instalar un módulo contribuido o personalizado.','es',1),(8211,_binary 'El módulo Search proporciona la habilidad de establecer páginas de búsqueda basadas en extensiones proporcionados por otros módulos. En el núcleo de Drupal, hay dos tipos de páginas extensiones: El tipo de página Contenido proporciona búsqueda por palabras clave para contenido gestionado por el módulo Node y el tipo de página Usuarios proporciona búsqueda por palabras clave para usuarios registrados. Algunos módulos contribuidos pueden proporcionar otros tipos de páginas por extensiones. Para más información, consulte la <a href=\":search-module\">documentación online para el módulo Search</a>.','es',1),(8212,_binary 'Para configurar la páginas de búsqueda, visite la <a href=\":search-settings\">página Páginas de búsqueda</a>. En la sección Páginas de búsqueda, puede añadir una nueva página de búsqueda, editar la configuración de páginas de búsqueda existentes, activar y desactivar páginas de búsqueda y escoger la página de búsqueda predeterminada. Cada página de búsqueda activada tiene una ruta de URL de inicio con <em>buscar</em>, y cada uno aparecerá con una pestaña o enlace de tarea de local en la <a href=\":search-url\">página de búsqueda</a>; puede configurar el texto que se mostrará en la pestaña. Además, algunas extensiones de página de búsqueda tienen opciones adicionales que puede configurar para cada página de búsqueda.','es',1),(8213,_binary 'Algunas extensiones de página de búsqueda, como la página del núcleo Contenido, indexa texto usando el índice de búsqueda del núcleo de Drupal y no funcionará a no ser que el contenido esté indexado. La indexación se realiza durante la ejecución del <em>cron</em>, por lo que se requiere establecer una <a href=\":cron\">tarea del mantenimiento del cron</a>. Hay también varias opciones que afectan al indexado que pueden ser configurados en la <a href=\":search-settings\">página de Páginas de búsqueda</a>: El numero de objetos a indexar por ejecución del cron, la mínima longitud de palabra para indexar y como manejar los caracteres en chino, japonés y coreano.','es',1),(8214,_binary 'Los módulos que proporcionan extensiones de páginas de búsqueda general aseguran que las acciones relacionadas con el contenido de su sitio (crear, editar o eliminar contenido y comentarios) hacen que los elementos de contenido afectados sean marcados para la indexación o reindexación automáticamente en la próxima ejecución de cron. Cuando el contenido está marcado para reindexar, el contenido anterior permanece en el índice hasta que se ejecuta el cron, momento en el que se sustituye por el nuevo contenido. Sin embargo, hay algunas acciones relacionadas con la estructura de su sitio que no hacen que el contenido afectado sea marcado para reindexar. Ejemplos de acciones relacionadas con la estructura que afectan el contenido incluyen la eliminación o edición de términos de taxonomía, la activación o desactivación de módulos que añaden el texto al contenido (como los módulo Taxonomy, Comment, y módulos de campo), y la modificación de los campos o parámetros de visualización de sus tipos de contenido. Si realiza una de estas acciones y quiere asegurarse de que el índice de búsqueda se actualiza para reflejar la estructura del sitio cambiado, puede marcar todos los contenidos de reindexing haciendo clic en el botón \"Reindexar sitio\" en la página de <a href=\":search-settings\">Páginas de búsqueda</a>. Si tiene una gran cantidad de contenido en su sitio, puede tardar varias ejecuciones de cron para que el contenido sea re-indexada.','es',1),(8215,_binary 'El módulo Search incluye un bloque que puede ser activado y configurado en la <a href=\":blocks\">página de Diseño de bloques</a>, si tiene el módulo Block activado; el título de bloque predeterminado es Buscar, y es el bloque de formulario Buscar en la categoría Formularios, si desea añadir otra instancia. El bloque está disponibles a los usuarios con el permiso <a href=\":search_permission\">Usar búsqueda</a>, y realiza una búsqueda usando la página de búsqueda configurada de manera predeterminada.','es',1),(8216,_binary 'Los usuarios con el permiso <a href=\":search_permission\">Usar búsqueda</a> pueden usar el bloque Búscar y la <a href=\":search\">página Buscar</a>. Los usuarios con el permiso <a href=\":node_permission\">Ver contenido publicado</a> pueden usar las páginas de búsqueda configurados del tipo de Contenido para buscar el contenido con las palabras clave exactas; además, los usuarios con el permiso <a href=\":search_permission\">Usar búsqueda avanzada</a> pueden usar filtrado más complejo. Los usuarios con el permiso <a href=\":user_permission\">Ver información de usuario</a> puede usario la página configuradas de búsqueda de tipo <em>Usuarios</em> para buscar usarios activos que contengan la palabra clave en cualquier para del nombre de usuario, los usuarios con el permiso <a href=\":user_permission\">Administrar usuarios</a> puede buscar usuarios activo y bloqueados, por dirección de email o palabra clave de nombre de usuario.','es',1),(8217,_binary 'De manera predeterminada, el módulo Search solo soporta palabras clave exactas en la búsquedas de contenido. Puede modificar este comportamiento instalando un módulo de derivación de términos específicos para su idioma (como por ejemplo: <a href=\":porterstemmer_url\">Porter Stemmer</a> para el inglés americano), lo que permite el uso de palabras en inglés como walk, walking y walked puede mostrarse en el módulo Search. Otra aproximación es usar una tecnología de búsqueda de terceros, con derivación de palabras completas o parciales integrado como por ejemplo: <a href=\":solr_url\">Apache Solr</a> o <a href=\":sphinx_url\">Sphinx</a>. También hay módulos contribuido que proporcionan páginas de búsqueda adicionales. Estos y otros <a href=\":contrib-search\">módulos contribuidos relacionados con búsquedas</a> pueden ser descargados visitando Drupal.org.','es',1),(8218,_binary '… @excerpt … @excerpt …','es',1),(8219,_binary 'Este módulo no tiene interfaz de usuario. Es usado por otros módulos que necesitan serializar datos, como <a href=\":rest\">REST</a>.','es',1),(8220,_binary 'Para más información, vea la <a href=\":doc_url\">documentación en línea para el módulo de Serialización</a>.','es',1),(8221,_binary 'El módulo Shortcut permite a los usuarios crear conjuntos de <em>atajos</em> que enlazan a las páginas más comunmente visitadas del sitio. Los atajos están contenidos en <em>conjuntos</em>. Cada usario con el permiso <em>Seleccionar cualquier conjunto de atajos</em> puede seleccionar un conjunto de atajos creados por cualquiera en el sitio. Para más información, consulte la <a href=\":shortcut\">documentación online para el módulo Shortcut</a>.','es',1),(8222,_binary 'Los usuarios con el permiso <em>Administrar atajos</em> puede gestionar conjuntos de atajos y editar los atajos dentro de los conjuntos desde la <a href=\":shortcuts\">página de Administración de atajos</a>.','es',1),(8223,_binary 'Puede visualizar sus atajos activando el bloque <em>Atajos</em> en la <a href=\":blocks\">página de Administración de bloques</a>. Algunos módulos administrativos también muestran sus atajos; por ejemplo: el <a href=\":toolbar-help\">módulo Toolbar</a> del núcleo proporciona un elemento de menú correspondiente.','es',1),(8224,_binary 'Definir qué conjunto de atajos se usarán en la <a href=\"@shortcut-link\">solapa de atajos</a> de su página de usuario.','es',1),(8225,_binary 'No hay accesos directos disponibles. <a href=\":link\">Añadir un enlace directo</a>','es',1),(8226,_binary 'Ahora puede usar el nuevo conjunto de atajos %set_name. Puede editarlo desde esta página o <a href=\":switch-url\">cambiar a uno diferente.</a>','es',1),(8227,_binary 'La llave primaria menu.mlid para este elemento de menú (= enlace de acceso directo).','es',1),(8228,_binary 'El menu_name (= nombre de conjunto) para este enlace de acceso directo.','es',1),(8229,_binary 'El enlace para este acceso directo.','es',1),(8230,_binary 'El título para este enlace directo.','es',1),(8231,_binary 'El peso para este enlace directo','es',1),(8232,_binary 'El nombre bajo el cual el conjunto de enlaces es almacenado.','es',1),(8233,_binary 'El título del conjunto.','es',1),(8234,_binary 'El users.uid para este conjunto.','es',1),(8235,_binary 'El shortcut_set.set_name que será mostrado para este usuario.','es',1),(8236,_binary 'El módulo Testing proporciona una estructura para la ejecución de pruebas automatizadas. Puede ser utilizado para comprobar el estado de funcionamiento de Drupal antes y después de cualquier cambio de código o como un medio para desarrolladores de escribir y ejecutar pruebas para sus módulos. Para más información, consulte la <a href=\":simpletest\">documentación online para el módulo Testing</a>.','es',1),(8237,_binary 'Visite la <a href=\":admin-simpletest\">página de Pruebas</a> para visualizar una lista con las pruebas disponibles. Para que las pruebas sean comprensibles, seleccione <em>todas</em> las pruebas, o seleccione pruebas individualmente para pruebas más focalizadas. Tenga en cuenta que podría tomar varios minutos completar todas las pruebas.','es',1),(8238,_binary 'El marco de trabajo de pruebas requiere que el límite de memoria de PHP sea al menos %memory_minimum_limit. El valor actual es %memory_limit. <a href=\":url\">Siga estos pasos para continuar</a>.','es',1),(8239,_binary 'El módulo Statistics le muestra la frecuencia con que el contenido es visualizado. Esto es muy útil para determinar qué páginas de su sitio son los más populares. Para más información, consulte la <a href=\":statistics_do\">documentación online para el módulo Statistics</a>.','es',1),(8240,_binary 'El módulo incluye un bloque nombrado <em>Contenidos populares</em> que muestra las páginas más vistas hoy y de todos los tiempos. Para usar el bloque, active <em>Contar visitas al contenido</em> en la <a href=\":statistics-settings\">página de Estadísticas</a>, y después puede activar y configurar el bloque en la <a href=\":blocks\">Página de diseño de bloques</a>.','es',1),(8241,_binary 'El módulo Statistics incluye un contador para cada página que se incrementa cada vez que se visualiza una página. Para usar el contador, active <em>Contar visitas al contenido</em> en la <a href=\":statistics-settings\">Página de estadísticas</a>, y establezca los <a href=\":permissions\">permisos necesarios </a> (<em>Ver accesos al contenido</em>) para que el contador sea visible para los usuarios.','es',1),(8242,_binary 'Cuanto tiempo debe ser cacheada cualquier estadística, es decir, el intervalo de refresco','es',1),(8243,_binary 'Este tema requiere la versión de PHP @php_required y es incompatible con la versión de PHP @php_version.','es',1),(8244,_binary 'El módulo System es integral para el sitio: proporciona interfaces de usuario para muchos de los sistemas y opciones del núcleo, así como la estructura básica de menú administrativo. Para más información, consulte la <a href=\":system\">documentación online del módulo System</a>.','es',1),(8245,_binary 'Los usuarios con los permisos apropiados pueden instalar y desinstalar módulos desde la <a href=\":modules\">página Extender</a>. Dependiendo de la distribución o perfil de instalación que haya elegido cuando instaló su sitio, varios módulos son instalados y otros son proporcionados pero no instalados. Cada módulo proporciona un conjunto discreto de características; los módulo pueden ser instalados o desinstalados dependiendo de las necesidades del sitio. Muchos módulos adicionales contribuidos por los miembros de la comunidad de Drupal están disponibles desde la <a href=\":drupal-modules\">página de módulos de Drupal.org</a>. Tenga en cuenta que desinstalar un módulo es una acción destructiva: cuando desinstale un módulo, perderá de forma permanente todos los datos conectados al módulo.','es',1),(8246,_binary 'Los usuarios con los permisos apropiados pueden instalar y desinstalar temas en la <a href=\":themes\">página Apariencia</a>. Los temas determinan el diseño y presentación de sus sitio. Dependiendo de que distribución o perfil de instalación haya elegido durante la instalación de su sitio, un tema predeterminado es instalado, y posiblemente un tema diferente para páginas de administración. Otros temas son proporcionados pero no instalados, y temas adicionales contribuidos están disponibles en la <a href=\":drupal-themes\">página de temas de Drupal.org</a>.','es',1),(8247,_binary 'Cuando esté realizando un mantenimiento del sitio, puede prevenir a los usuarios no-administrativos (incluyendo visitantes anónimos) de visualizar su sitio poniendolo en <a href=\":maintenance-mode\">Modo de Mantenimiento</a>. Esto evitará a los usuarios no autorizados de realizar cambios en el sitio mientras realice el mantenimiento, o de ver un sitio roto mientra las actualizaciones estén en progreso.','es',1),(8248,_binary 'En la <a href=\":performance-page\">página Rendimiento</a>, el sitio puede ser configurado para agregar archivos CSS y JavaScript, haciendo el tamaño total de la petición más pequeño. Tenga en cuenta que para sitios web de pequeño a mediano tamaño, el <a href=\":page-cache\">módulo Internal Page Cache</a> debería estar instalado para que las páginas estén cacheadas eficientemente y reutilizadas para usuarios anónimos. Finalmente, para sitios web de todos los tamaños, el <a href=\":dynamic-page-cache\">módulo Dynamic Page Cache</a> también debería estar instalado para que las partes no personalizadas de las páginas sean eficientemente cacheadas (para todos los usuarios).','es',1),(8249,_binary 'Su sitio tiene varios directorios de archivos, que son usados para almacenar y procesar los archivos subidos y generados. El directorio de archivos <em>public</em>, que está configurado en su archivo settings.php, es el lugar predeterminado para almacenar los archivos. Los enlaces a los archivos en este directorio contiene la URL directa del archivo, para que cuando los archivos son solicitados, el servidor web los enviará directamente sin recurrir al código del sitio. Esto significa que los archivos pueden ser descargados por cualquiera con la URL del archivo, por lo que las solicitudes de acceso no son controlados pero son eficientes. El directorio de archivo <em>private</em>, también configurados en su archivo settings.php e idealmente localizado fuera de la raíz del sitio web, su acceso sí es controlado. Los enlaces a los archivos en este directorio no son directos, por lo que las solicitudes de acceso a esos archivos son mediados por el código de su sitio. Esto significa que su sitio puede comprobar los permisos de acceso a los archivos para cada uno de ellos antes de decidir de conceder la solicitud, por lo que son más seguras, pero menos eficientes. Debería usar el almacenamiento privado solo para archivos que necesiten control de acceso, no para archivos como el logo de sitio o la imágenes de fondo usadas en cada página. El directorio de archivos <em>temporary</em> se usa internamente en el código de sus sitio para varias operaciones y se configura en la página <a href=\":file-system\">Opciones del sistema de archivos</a>. También puede ver los directorios de archivos configurados públicos y privados en esta página y elegir si el almacenamiento predeterminado de archivos subidos debería ser público o privado.','es',1),(8250,_binary 'En la <a href=\":toolkit\">página de Juego de herramientas de imágenes</a>, puede seleccionar y configurar el juego de herramientas PHP usado para manipular imágenes. Dependiendo de qué distribución o perfil de instalación escoja cuando instale su sitio, el juego de herramientas GD2 y posiblemente otros estén incluidos; otros juegos de herramientas pueden ser proporcionados por los módulos contribuidos.','es',1),(8251,_binary 'Establezca y configure el tema predeterminado para su sitio. <a href=\":themes\">Temas</a> alternativos están disponibles.','es',1),(8252,_binary 'Puede situar bloques para cada tema en la página <a href=\":blocks\">diposición de bloques</a>.','es',1),(8253,_binary 'Descargar <a href=\":modules\">módulos contribuidos</a> adicionales para extender la funcionalidad del sitio.','es',1),(8254,_binary 'Compruebe regularmente la actualizaciones disponibles para mantener un sitio seguro y actualizado. Ejecute siempre el <a href=\":update-php\">script de actualización</a> cada vez que se actualice un módulo. Active el <a href=\":update-manager\">módulo Update Manager</a> para actualizar e instalar módulos y temas.','es',1),(8255,_binary 'Aquí puede encontrar un breve resumen de los parámetros de sus sitio así como cualquier problema detectado en su instalación. Podría serle útil copiar y pegar esta información en las solicitudes de soporte archivadas en los foros de soporte de Drupal.org y en la colas de problemas del proyecto. Antes de archivar una solicitud de soporte, asegúrese de que su servidor web cumple los <a href=\":system-requirements\">requisitos del sistema.</a>','es',1),(8256,_binary 'Configure la <a href=\":user-edit\">zona horaria</a> para su cuenta.','es',1),(8257,_binary 'La versión mínima necesaria de Apache para correr Drupal sin mod_rewrite activado es 2.2.16. Ver la página <a href=\":link\">Habilitar URLs limpias</a> para más información acerca de mod_rewrite.','es',1),(8258,_binary 'Su servidor es capaz de utilizar URLs limpias, pero no están activadas. Usar URLs limpias ofrece una mejor experiencia de usuario y es recomendado. <a href=\":link\">Habilitar URLs limpias</a>','es',1),(8259,_binary 'La función phpinfo() ha sido desactivada por razones de seguridad. Para ver información de su servidor usando phpinfo(), cambie sus configuraciones de PHP o contáctese con su administrador de servidor. Para más información, vea la página del Manual <a href=\":phpinfo\">Activar y desactivar phpinfo()</a>.','es',1),(8260,_binary 'Drupal necesita activar las extensiones PHP de la siguiente lista (consulte la <a href=\":system_requirements\">página de requisitos del sistema</a> para más información):','es',1),(8261,_binary 'Su servidor web no parece que soporte PDO (PHP Data Objects). Pregunte a su proveedor de hosting por el soporte nativo de la extensión PDO. Consulte la página de <a href=\":link\">requerimientos del sistema</a> para obtener más información.','es',1),(8262,_binary 'Su servidor web parece que no admite ninguna extensión de base de datos común de PDO. Compruébelo con su proveedor de alojamiento para ver si admite PDO (PHP Data Objects) y si ofrecen alguna base de datos que <a href=\":drupal-databases\">funcione con Drupal</a>.','es',1),(8263,_binary 'Su servidor web parece tener la versión errónea de PDO instalada. Drupal requiere la extensión PDO del núcleo de PHP. Este sistema tiene una versión de PECL más antigua. Consulte la página de <a href=\":link\">requerimientos del sistema</a> para más información.','es',1),(8264,_binary 'Para más información, consulte la entrada del manual online para <a href=\":memory-limit\">incrementar el limite del memoria de PHP</a>.','es',1),(8265,_binary 'Un intento automatizado de crear este directorio ha fallado, posiblemente debido a problemas con los permisos. Para continuar con la instalación, puede o bien crear el directorio y modificar sus permisos manualmente, o bien asegurarse de que el instalador tiene los permisos para crearlo automáticamente. Para más información, consulte INSTALL.txt o <a href=\":handbook_url\">el manual online</a>.','es',1),(8266,_binary 'Algunos módulos tienen actualizaciones que instalar en el esquema de la base de datos. Debe ejecutar el  <a href=\":update\">script de actualización de la base de datos</a> inmediatamente.','es',1),(8267,_binary 'Las notificaciones de actualizaciones no están activadas. Se le <strong>recomienda encarecidamente</strong> que active el módulo Update Manager desde la <a href=\":module\">página de administración de módulos</a> para mantenerse actualizado con las últimas versiones. Para más información, consulte la <a href=\":update\">página del manual sobre el estado de las actualizaciones</a>.','es',1),(8268,_binary 'La opción trusted_host_patterns no está configurada en settings.php. Esto podría llevar a vulnerabilidades de seguridad. Se <strong>recomienda encarecidamente</strong> configurarlo. Para más información, consulte <a href=\":url\">Protegiéndose contra ataques HTTP HOST Header</a>.','es',1),(8269,_binary 'El módulo Block no está activado por lo que los elementos de marca del sitio, que han sido convertido a un bloque ya no son visibles.','es',1),(8270,_binary 'Debido a que su sitio tiene instalados temas personalizados , tuvimos que establecer los bloques de marca en las regiones de contenido. Por favor, compruebe manualmente la configuración de los bloques y elimine el nombre del sitio, eslogan y variables de logo de sus plantillas.','es',1),(8271,_binary 'El módulo Bloque no está activado. El título de la página se haconvertido en bloque, pero el diseño de página predeterminado del título continuará mostrándose en la parte superior del área de contenido principal.','es',1),(8272,_binary 'Debido a que su sitio tiene instalados tema(s) personalizado(s), hemos colocado el bloque de título de la página en la región de contenido. Por favor, compruebe manualmente la configuración de bloque y elimine las variables de título de página de las plantillas de sus páginas.','es',1),(8273,_binary 'Pone su sitio en el <a href=\":url\">modo de mantenimiento</a>.','es',1),(8274,_binary 'Todos los errores han sido <a href=\":url\">registrados</a>.','es',1),(8275,_binary 'Se intentó actualizar. Si no ve fallos a continuación, puede proceder felizmente a su <a href=\":url\">sitio</a>. De lo contrario, puede que tenga que actualizar su base de datos manualmente.','es',1),(8276,_binary 'Captura de pantalla para el tema @theme','es',1),(8277,_binary 'Configuraciones para el tema @theme','es',1),(8278,_binary 'Desinstalar el tema @theme','es',1),(8279,_binary 'Establecer @theme como tema predeterminado','es',1),(8280,_binary 'Instalar el tema @theme','es',1),(8281,_binary 'Instalar el tema @theme como tema principal','es',1),(8282,_binary 'La función phpinfo() se ha desactivado por razones de seguridad. Para más información, visite  la página del manual <a href=\":phpinfo\">Activar y desactivar phpinfo()</a>.','es',1),(8283,_binary 'Esta versión no es compatible con Drupal @core_version y debería ser reemplazada.','es',1),(8284,_binary 'Este módulo requiere la versión de PHP @php_required y es incompatible con la versión de PHP @php_version.','es',1),(8285,_binary '<strong class=\"error\">Configure el <a href=\":file-system\">directorio de archivos públicos</a> para activar estas optimizaciones.</strong>','es',1),(8286,_binary 'Definido en la página de <a href=\":appearance\">Configuraciones de Apariencia</a> o <a href=\":theme\">Configuraciones de Tema</a>.','es',1),(8287,_binary 'Definido en la página de <a href=\":information\">Información del Sitio</a>.','es',1),(8288,_binary 'Funciona con <a href=\":poweredby\">Drupal</a>','es',1),(8289,_binary 'Tareas de instalación','es',1),(8290,_binary 'El módulo Taxonomy permite a los usuarios que tienen permiso para crear y editar contenido, categorizar (etiquetar) contenido de ese tipo. Los usuarios que tienen el <a href=\":permissions\" title=\"permisos del módulo Taxonomy\">permiso</a> <em>Administrar vocabularios y términos</em> pueden añadir <em>vocabularios</em> que contengan un conjunto de <em>términos</em>. Los términos en un vocabulario pueden ser preestablecidos por un administrador o bien construidos gradualmente cuando el contenido es añadido o editado. Los términos pueden estar organizados jerárquicamente si lo desea.','es',1),(8291,_binary 'Para información adicional, vea la <a href=\":taxonomy\">documentación en línea para el módulo Taxonomy</a>.','es',1),(8292,_binary 'Los usuarios que tienen el permiso <em>Administrar vocabularios y términos</em> pueden añadir y editar vocabularios desde la <a href=\":taxonomy_admin\">página de administración de Taxonomía</a>. Los vocabularios pueden ser borrados desde su página <em>Editar vocabulario</em>. Los usuarios con el permiso <em>Términos de Taxonomía: administrar campos</em> pueden añadir campos adicionales para los términos de ese vocabulario usando el <a href=\":field_ui\">módulo Field UI</a>.','es',1),(8293,_binary 'Los usuario que tienen el permiso <em>Administrar vocabularios y términos</em> o <em>Editar Términos</em> para un vocabulario particular pueden añadir, editar y organizar los términos en un vocabulario desde la página de listado de términos del vocabulario, que pueden ser accedidos yendo a la <a href=\":taxonomy_admin\">página de Administración de Taxonomía</a> y haciendo clic en <em>Listar términos</em> en la columna <em>Operaciones</em>. Los usuarios deben tener el permiso <em>Administrar vocabularios y términos</em> o <em>Borrar términos</em> en un vocabulario particular para borrar términos.','es',1),(8294,_binary 'Un usuario con el permiso <em>Administrar campos</em> para un cierto tipo de entidad puede añadir campos de referencia <em>Términos de taxonomía</em> al tipo de entidad, lo que permite a las entidades ser clasificadas usando términos de taxonomía. Consulte la <a href=\":entity_reference\">ayuda del módulo Entity Reference</a> para obtener más información sobre los campos de referencia. Consulte las páginas de <a href=\":field\">ayuda del módulo Field</a> y la <a href=\":field_ui\">ayuda del módulo Field UI</a> para obtener información general sobre los campos y como crearlos y gestionarlos.','es',1),(8295,_binary 'Consulte la página de <a href=\":entity_reference\">ayuda del módulo Entity Reference</a> para obtener información sobre los controles de campos y formateadores que pueden ser configurados para cualquier campo de referencia en las páginas <em>Gestionar presentación</em> y <em>Gestionar la visualización del formulario</em>. El módulo Taxonomy adicionalmente proporciona un formateador <em>categoría RSS</em> que no muestra nada cuando el objeto de entidad se muestra como HTML, pero muestra una categoría RSS en lugar de una lista cuando el objeto de entidad se muestra en un feed RSS.','es',1),(8296,_binary 'No hay vocabularios disponibles. <a href=\":link\">Añadir vocabulario</a>.','es',1),(8297,_binary 'No hay términos disponibles. <a href=\":link\">Añadir término</a>.','es',1),(8298,_binary 'Formato de la descripción del término.','es',1),(8299,_binary 'Módulo responsable del vocabulario.','es',1),(8300,_binary 'El módulo Telephone le permite crear campos que contengan números de teléfono. Consulte las páginas de <a href=\":field\">ayuda del módulo Field</a> y la <a href=\":field_ui\">ayuda del módulo Field UI</a> para obtener información general sobre los campos y sobre cómo crearlos y gestionarlos. Para más información, consulte la <a href=\":telephone_documentation\">documentación online para el módulo Telephone</a>.','es',1),(8301,_binary 'Las <em>opciones</em> y <em>visualización</em> del campo teléfono puede ser configurado de manera separada. Consulte la <a href=\":field_ui\">ayuda del módulo Field UI</a> para obtener más información en como gestionar campo y su visualización.','es',1),(8302,_binary 'El módulo Text permite crear campos de texto cortos y largos con resumenes opcionales. Consulte la <a href=\":field\">ayuda del módulo Field</a> y la <a href=\":field_ui\">ayuda del módulo Field UI</a> para saber más sobre los campos, su creación y gestión. Para más información, consulte la <a href=\":text_documentation\">documentación en pantalla del módulo Text</a>.','es',1),(8303,_binary 'Las <em>opciones</em> y <em>visualización</em> del campo de texto se pueden configurar por separado. Consulte la <a href=\":field_ui\">ayuda del módulo Field UI</a> para obtener más información sobre cómo gestionar el campo y su visualización.','es',1),(8304,_binary 'Si elige <em>Texto (plano)</em> o <em>Texto (plano, largo)</em>, está restringiendo la entrada a solo <em>Texto plano</em>. Si elige <em>Texto (formateado)</em>, <em>Texto (formateado, largo)</em> o <em>Texto (formateado, lardo, con resumen)</em> permitirá a los usuarios escribir texto formateado. Las opciones que estén disponibles a los usuarios individuales dependen de las opciones en la <a href=\":formats\">página de Formatos de texto y editores</a>.','es',1),(8305,_binary 'Cantidad de filas del resumen: @rows','es',1),(8306,_binary 'El módulo Barra de herramientas proporciona una barra de herramientas para los administradores del sitio, el cual muestra las pestañas y bandejas proporcionadas por el propio módulo Toolbar y los demás módulos. Para más información, consulte la <a href=\":toolbar_docs\">documentación online para el módulo Toolbar</a>.','es',1),(8307,_binary 'El módulo Tour proporciona a los usuarios recorridos o visitas guiadas a la interfaz del sitio. Cada recorrido consiste en varias pistas que destacan elementos de la interfaz de usuario, guiando al usuario por el flujo de trabajo o explicando conceptos clave del sitio web. Para más información, consulte la <a href=\':tour\'>documentación online para el módulo Recorrido</a>.','es',1),(8308,_binary 'Los Recorridos se pueden escribir como documentos YAML con un editor de texto o usando el módulo contribuido <a href=\':tour_ui\'>IU de Recorrido</a>. Para más información, consulte la <a href=\':doc_url\'>documentación en pantalla para escribir recorridos</a>.','es',1),(8309,_binary '@tour_item de @total','es',1),(8310,_binary 'El módulo Seguimiento de actividad muestra el contenido añadido o actualizado más reciente de su sitio y le permite seguir los contenidos nuevos creados por cada usuario. Este módulo no tiene opciones de configuración. Para más información, consulte la <a href=\":tracker\">documentación online para el módulo Activity Tracker</a>.','es',1),(8311,_binary 'La página <a href=\":recent\">Contenido reciente</a> muestra los contenidos nuevos y actualizados en orden cronológico inverso, listando el tipo de contenido, título, nombre del autor, número de comentarios y tiempo desde la última actualización. El contenido se considera actualizado cuando se hay cambios en el texto o se añaden nuevos comentarios. La pestaña <em>Mi contenido reciente</em> limita la lista al usuario en sesión en ese momento.','es',1),(8312,_binary 'El {node}.nid que este historial registra.','es',1),(8313,_binary 'Booleano que indica si el nodo está publicado.','es',1),(8314,_binary 'El sello temporal Unix de cuando el nodo se guardó o comentó por última vez.','es',1),(8315,_binary 'El {user}.nid que este historial registra.','es',1),(8316,_binary 'El {users}.uid del autor o comentador del nodo.','es',1),(8317,_binary 'La marca de tiempo Unix de cuando el usuario fue más recientemente guardado o comentado.','es',1),(8318,_binary 'Módulos desinstalados','es',1),(8319,_binary 'Temas desinstalados','es',1),(8320,_binary 'El módulo Update Manager comprueba periodicamente si hay nuevas versiones del software de su sitio (incluidos los módulos contribuidos y temas), y avisa a los administradores de las actualizaciones disponibles. El sistema de Update Manager también es usado por otros módulos para gestionar actualizaciones y descargas; por ejemplo: el módulo Interface Translation usa Update Manager para descargar las traducciones desde el servidor de localización. Tenga en cuenta que cuando el sistema de Update Manager es usado, las estadísticas de uso anónimas son enviadas a Drupal.org. Si lo desea, puede desactivar el módulo Update Manager desde la <a href=\":modules\">página Extender</a>; si así lo hace, la funcionalidad que depende del sistema de Update Manager no funcionará. Para más información, consulte la <a href=\":update\">documentación online para el módulo Update Manager</a>.','es',1),(8321,_binary 'El <a href=\":update-report\">informe de Actualizaciones disponibles</a> muestra los módulos del núcleo y contribuidos y lso temas para el hay nuevas versiones disponibles para descargar. En la página del informe, puede también comprobar manualmente si hay actualizaciones. Puede configurar la frecuencia de las comprobaciones que se realizarán durante las ejecuciones del cron, y la de los envíos de notificaciones en la <a href=\":update-settings\">página de opciones del Gestor de actualizaciones</a>.','es',1),(8322,_binary 'El módulo Update Manager permite a los administradores para realizar actualizaciones directamente desde la <a href=\":update-page\">página de Actualizar</a>. Este lista todas las actualizaciones disponibles y puede confirmar si se quiere descarlos. Si no tiene suficiente derechos de acceso a su servidor web se los puede solicitar su contraseña FTP/SSH. Después, los archivos se transfieren a la instalación de su sitio, sobrescribiendo los archivos antiguos. Los enlaces directos a las página Actualizar también son mostradas en la <a href=\":modules_page\">página Extender</a> y en la <a href=\":themes_page\">página Apariencia</a>.','es',1),(8323,_binary 'Puede también instalar nuevos módulos y temas de la misma manera a través de la <a href=\":install\">página Instalar</a> o haciendo clic en los enlaces <em>Instalar nuevos módulos/temas</em> en lo más alto de la <a href=\":modules_page\">página Extender</a> y la <a href=\":themes_page\">página Apariencia</a>. En este caso, se le solicitará proporcionar o la URL de descarga o subir el archivo empaquetado desde su computadora local.','es',1),(8324,_binary 'Regularmente revise e instale las <a href=\":updates\">actualizaciones disponibles</a> para mantener seguro y actualizado su sitio. Siempre ejecute el <a href=\":update-php\">script de actualización</a> cada vez que un módulo es actualizado.','es',1),(8325,_binary 'Examine regularmente las <a href=\":updates\">actualizaciones disponibles</a> para mantener seguro y actualizado su sitio. Siempre ejecute el <a href=\":update-php\">script de actualización</a> cada vez que un módulo es actualizado.','es',1),(8326,_binary 'Nueva(s) versión(es) disponible(s) para @site_name','es',1),(8327,_binary 'Su sitio está actualmente configurado para enviar estos correos electrónicos cuando alguna actualización se encuentre disponible. Para ser notificado solamente para actualización de seguridad, @url.','es',1),(8328,_binary 'Su sitio está actualmente configurado para enviar estos correos electrónicos cuando existan actualizaciones de seguridad. Para ser notificado cualquiera de las actualizaciones disponibles, @url.','es',1),(8329,_binary 'Hubo un problema comprobando <a href=\":update-report\">actualizaciones disponibles</a> para Drupal.','es',1),(8330,_binary 'Hubo un problema comprobando <a href=\":update-report\">actualizaciones disponibles</a> para sus módulos o temas.','es',1),(8331,_binary 'La actualización automática del núcleo de Drupal no está soportada. Vea la <a href=\":upgrade-guide\">guía de actualización</a> para información sobre como actualizar el núcleo de Drupal manualmente.','es',1),(8332,_binary '%archive_file contiene una versión de %names que no es compatible con Drupal @version.%archive_file contiene versiones de módulos o temas que no son compatibles con Drupal @version: %names','es',1),(8333,_binary 'Consulte la página <a href=\":available_updates\">actualizaciones disponibles</a> para más información e instalar las actualizaciones pendientes.','es',1),(8334,_binary 'Vea la página de <a href=\":available_updates\">actualizaciones disponibles</a> para más información.','es',1),(8335,_binary 'Actualice configuraciones de Administración','es',1),(8336,_binary 'Verificar actualizaciones o módulos y temas desinstalados.','es',1),(8337,_binary 'Puede elegir enviar emails solo si está disponible una actualización de seguridad o ser notificados sobre nuevas versiones. Si hay actualizaciones disponibles de núcleo de Drupal o de cualquiera de los módulos y temas instalados, su sitio mostrará siempre un mensaje en la página de <a href=\":status_report\">informe de estado</a> y también mostrará un mensaje de error en las páginas de administración si hay una actualización de seguridad.','es',1),(8338,_binary 'Puede encontrar <a href=\":module_url\">módulos</a> y <a href=\":theme_url\">temas</a> en <a href=\":drupal_org_url\">drupal.org</a>. Las siguientes extensiones están soportadas: %extensions.','es',1),(8339,_binary 'Respalde su base de datos y su sitio antes de continuar. <a href=\":backup_url\">Aprenda como</a>.','es',1),(8340,_binary 'Obsoleto: Utilice nombre de la cuenta o nombre para mostrar.','es',1),(8341,_binary 'El nombre mostrado de la cuenta de usuario.','es',1),(8342,_binary 'El módulo User permite a los usuarios registrarse, iniciar y finalizar sesión. También permite a los usuarios con los permisos adecuados gestionar los roles y permisos de usuarios. Para más información, consulte la <a href=\":user_docs\">documentación online del módulo User</a>.','es',1),(8343,_binary 'A través de la <a href=\":people\">página de administración de la gente</a> puede añadir y cancelar cuentas de usuario y asignar roles a usuarios. Editando un usuario en particular, puede cambiar su nombre de usuario, dirección de correo electrónico, contraseña e información en otros campos.','es',1),(8344,_binary 'Los <em>roles</em> son usados para agrupar y clasificar usuarios; cada usuario puede ser asignado a uno o más roles. Típicamente hay dos roles predefinidos: <em>Usuario anónimo</em> (usuarios que no han iniciado sesión) y <em>Usuario registrado</em> (usuario que están registrados y que han iniciado sesión). Dependiendo de está configurado su sitio , un rol de <em>Administrador</em> también puede estar disponible: usuarios con este rol se les asignará automáticamente cualquier permiso nuevo en el momento que se active un módulo. Puede crear roles adicionales en la <a href=\":roles\">página de adimnistración de roles</a>.','es',1),(8345,_binary 'Después de crear roles, puede establecer permisos para cada rol en la <a href=\":permissions_user\">página de Permisos</a>. Conceder un permiso permite a los usuarios a los que se les ha asignado un rol en particular realizar un acción en el sitio, como ver contenidos, editar o crear un tipo particular de contenido, administrar la opciones de un módulo en particular o usar una función particular del sitio (como las búsquedas).','es',1),(8346,_binary 'La <a href=\":accounts\">página de Opciones de la cuenta</a> le permite gestionar las opciones para el nombre mostrado del rol de usuario anónimo, los formularios de contacto personales, las opciones de registro de usuario y las opciones de cancelación de la cuenta. En esta página puede también gestionar las opciones de personalización de la cuenta y adaptar el texto para los mensajes de email que los uusarios reciben cuando se registren o soliciten una contraseña de recuperación. Puede también establecer el rol con los permisos que se asignarán automáticamente en el momento que un módulo se active (el rol de administrador).','es',1),(8347,_binary 'Como las cuentas de usuario son un tipo de entidad, se pueden ampliar añadiendoes campos a través de la pestaña Gestionar campos en la <a href=\":accounts\">página de Opciones de la cuenta</a>. Añadiendo campos como, por ejemplo, una imagen, una biografía o una dirección, puede crear un perfil personalizado para los usuarios del sitio. Para más información sobre entidades y campos, consulte la <a href=\":field_help\">página de ayuda del módulo Field</a>.','es',1),(8348,_binary 'Los permisos le permiten controlar lo que los usuarios pueden hacer y ver en su sitio. Puede definir un conjunto específico de permisos para cada rol. (Consulte la página <a href=\":role\">Roles</a> para crear un rol.) Cualquier permiso concedido al rol de usuario registrado será dado a cualquier usuario que haya iniciado sesión en su sitio. Desde la página <a href=\":settings\">Opciones de la cuenta</a>, puede cambiar cualquier rol en un rol de Administrador para el sitio, lo que significa que  pueden conceder nuevos permisos automáticamente. Debería tener cuidado de asegurar que solo los usuarios en los que confíe se le conceda este acceso y nivel de control de su sitio.','es',1),(8349,_binary 'Un rol define un define un grupo de usuarios que tienen ciertos privilegios. Esos privilegios son definidos en la <a href=\":permissions\">página de Permisos</a>. Aquí, puede definir los nombres y orden de visualización de los roles en sus sitio. Se recomienda ordenar los roles de menos permisivos (por ejemplo: usuarios anónimos) a más permisivos (por ejemplo: usuarios administrativos). Los usuarios que no hayan iniciado sesión tienen el rol de usuario anónimo. Los usuarios que hayan iniciado sesión tienen el rol de usuario registrado además de otro roles concedidos a sus cuentas de usuarios.','es',1),(8350,_binary 'El nuevo usuario <a href=\":url\">%name</a> ha sido creado sin una dirección de correo electrónico, debido a ello no será enviado un mensaje de bienvenida.','es',1),(8351,_binary 'Un mensaje de bienvenida con instrucciones adicionales ha sido enviado al nuevo usuario <a href=\":url\">%name</a>.','es',1),(8352,_binary 'Las instrucciones para restablecer la clave se enviarán a la dirección de correo electrónico con la que se registró como usuario.','es',1),(8353,_binary 'Enviadas instrucciones de reestablecimiento de contraseña por correo.','es',1),(8354,_binary 'También conocido como:','es',1),(8355,_binary '@label (@name:@column)','es',1),(8356,_binary '@label:@column','es',1),(8357,_binary '@label (@name:delta)','es',1),(8358,_binary 'Para más información, vea la <a href=\":views\">documentación en línea para el módulo Views</a>.','es',1),(8359,_binary 'Para crear o modificar sus nuevas vistas usando la interfaz de usuario de administración y configuración, necesitará activar o bien el módulo VIews UI en el núcleo o un módulo contribuido que proporcione una interfaz de usuario para Views. Consulte la <a href=\":views-ui\">página de ayuda del módulo Views UI</a> para obtener más información.','es',1),(8360,_binary 'Proyecto contribuidos con soporte del módulo Views pueden encontrarse en la <a href=\":node\">documentación online para módulos contribuidos relacionados con Views</a>.','es',1),(8361,_binary 'Cambiar el título aquí significa que no puede ser alterado dinámicamente nunca más. (Intente cambiarlo directamente en  <a href=\":url\">@name</a>.)','es',1),(8362,_binary 'Este enlace es proporcionado por el módulo Views. La ruta puede ser cambiada editando la vista <a href=\":url\">@label</a>','es',1),(8363,_binary 'Idioma @type seleccionado para la página','es',1),(8364,_binary 'No será accesible','es',1),(8365,_binary '@code (@title)','es',1),(8366,_binary 'Las siguientes cadenas de reemplazo están disponibles. Puede utilizar sintaxis Twig en este campo.','es',1),(8367,_binary 'Sobreescribe la vista y otros títulos de argumentos. Usted puede utilizar sintaxis de Twig en este campo así como los vectores \"arguments\" y \"raw_arguments\".','es',1),(8368,_binary 'Sobreescribe la vista y otros argumentos de título. Usted puede utilizar sintaxis de Twig en este campo.','es',1),(8369,_binary 'La categoría de este bloque aparecerá en la <a href=\":href\">página de colocación de bloques</a>.','es',1),(8370,_binary 'Separe múltiples clases con espacios','es',1),(8371,_binary 'Usted también puede ajustar el @settings para la restricción de acceso seleccionada actualmente.','es',1),(8372,_binary 'Usted también puede ajustar el @settings para el mecanismo de cache seleccionado actualmente.','es',1),(8373,_binary 'Usted también puede ajustar el @settings para el estilo seleccionado actualmente.','es',1),(8374,_binary 'Usted también puede ajustar el @settings para el estilo de fila seleccionado actualmente.','es',1),(8375,_binary 'Las siguientes cadenas de reemplazo están disponibles para este enlace. Usted puede utilizar sintaxis de Twig en este campo.','es',1),(8376,_binary 'Puede también ajustar @settings para el paginador seleccionado actualmente.','es',1),(8377,_binary 'El texto que se muestra para este campo. Puede incluir HTML o <a href=\":url\">Twig</a>. Puede introducir datos de esta vista como \"Patrones de reemplazo\" más abajo.','es',1),(8378,_binary 'Un desplazamiento desde el tiempo actual tal como \"@example1\" o \"@example2\"','es',1),(8379,_binary 'El módulo  Views IU proporciona una interfaz para la gestión de vista para el módulo <a href=\":views\">Views</a>. Para obtener más información, consulte la <a href=\":handbook\"> documentación en línea para el módulo  Views IU</a>.','es',1),(8380,_binary 'Las vistas se pueden activar o desactivar desde la <a href=\":list\">Página con el listado de Vistas</a>. Para activar una vista, encuentre la vista dentro de la lista \"Desactivado\" y seleccione la operación \"Activar\". Para desactivar una vista encuentre la vista dentro de la lista \"Activado\" y seleccionar la operación \"Desactivar\".','es',1),(8381,_binary 'Las vistas pueden se pueden exportar e importar  como archivos de configuración usando el <a href=\":config\">Módulo Administración de Configuraciones</a>.','es',1),(8382,_binary 'Configuraciones de Vistas avanzadas','es',1),(8383,_binary 'Esta vista está siendo editada por el usuario @user , y por lo tanto está bloqueada la edición por otros. Este bloqueo tiene @age de antigüedad. Haga clic aquí para <a href=\":url\"> romper este bloqueo</a>.','es',1),(8384,_binary 'Vista @display_title','es',1),(8385,_binary 'Duplicado como @type','es',1),(8386,_binary 'Añadir @display','es',1),(8387,_binary 'Rompiendo este bloqueo, cualquier cambio no salvado realizado por @user se perderá.','es',1),(8388,_binary 'Debe seleccionar un idioma para continuar con la instalación.','es',1),(8389,_binary '@display \'@id\': El componente \'@name\' ha sido desactivado porque sus ajustes dependen de dependencias eliminadas.','es',1),(8390,_binary 'No widget disponible para: %type.','es',1),(8391,_binary 'Este valor no es válido','es',1),(8392,_binary 'Crear tareas que el sistema pueda ejecutar.','es',1),(8393,_binary 'La URL hacia el cual el usuario debería ser redireccionado. Este puede ser una URL interna como /node/1234 o una URL externa como @url.','es',1),(8394,_binary 'Añada fuentes o importe OPMLs para reunir contenido y configurar con que frecuencia se actualizan.','es',1),(8395,_binary 'El módulo Automated Cron ejecuta operaciones para su sitio usando peticiones normales a la página o navegador en lugar de tener que programar una tarea de cron separada. El módulo Automated Cron comprueba al final de cada respuesta de servidor cuando una operación de cron fue ejecutado por última vez y, si ha pasado mucho tiempo desde la útlima ejecución, este ejecuta tareas de cron después de enviar una respuesta de servidor. Para más información, consulte la <a href=\":automated_cron-documentation\">documentación online para el módulo Automated Cron</a>.','es',1),(8396,_binary 'Configurando Automated Cron','es',1),(8397,_binary 'En la <a href=\":cron-settings\">página de Cron</a>, puede programar la frecuencia (intervalo de tiempo) de ejecución de tareas de cron.','es',1),(8398,_binary 'Desactivando Automated Cron','es',1),(8399,_binary 'Para desactivar Automated Cron. el método recomendado es desinstalar el módulo, para reducir la sobrecarga del sitio. Si sólo quiere desactivarlo temporalmente, puede programar la frecuencia a Nunca en la página de Cron y después cambiar la frecuencia de nuevo cuando quiera iniciarlo de nuevo.','es',1),(8400,_binary 'Automated Cron','es',1),(8401,_binary 'Opciones de Automated cron','es',1),(8402,_binary 'Prohibir visitas desde una dirección IP concreta.','es',1),(8403,_binary 'Puede colocar un nuevo bloque en una región seleccionando <em>Colocar bloque</em> en la <a href=\":blocks\">página de Diseño de bloques</a>. Una vez un bloque ha sido colocado, puede ser movido en una region diferente arrastrandolo con el ratón o usando la lista desplegable <em>Región</em> y después haciendo clic en <em>Guardar bloques</em>.','es',1),(8404,_binary 'La colocación de bloques es específica de cada tema en su sitio. Los cambios no serán guardados hasta que haga clic en <em>Guardar bloques</em> en la parte inferior de la página.','es',1),(8405,_binary 'Añadiendo tipos de comentario','es',1),(8406,_binary 'Se pueden crear <em>tipos de comentarios</em> adicionales por sub-tipos de entidad en la <a href=\":field\">Página de tipos de comentarios</a>. Si existen varios tipos de comentarios podrá seleccionar el adecuado al agregar un <em>campo de Comentarios</em>.','es',1),(8407,_binary 'Compare la configuración subida al directorio sincronizado con la configuración activa antes de completar la importación.','es',1),(8408,_binary 'Sube un archivo de configuración de un sitio completo al directorio sincronizado. Puede entonces ser comparado e importado en la página Sincronizar.','es',1),(8409,_binary 'El módulo Database Logging registra un log de sucesos del sistema en la base de datos de Drupal. Vigile su sitio o depure problemas del sitio en esta página.','es',1),(8410,_binary 'El módulo Internal Dynamic Page Cache guarda en la caché páginas para todos los usuarios de la base de datos, manejando el contenido de manera correctamente dinámica. Para más información, consulte la <a href=\":dynamic_page_cache-documentation\">documentación online para el módulo Internal Dynamic Page Cache</a>.','es',1),(8411,_binary 'El módulo no requiere configuración. Cada parte de la página contiene metadatos que permite al módulo Internal Dynamic Page Cache saber como manejarlos por sí mismo.','es',1),(8412,_binary 'Obsoleto. Toda la funcionalidad se ha movido al núcleo.','es',1),(8413,_binary 'Toda la configuración de los objetos de almacenamiento de campo han sido regrabados.','es',1),(8414,_binary 'Manejador de selección para campos de referencia de entidad han sido ajustadas.','es',1),(8415,_binary 'Los campos de <strong>Referencia de entidad</strong> le permite crear campos que contiene enlaces a otras entidades (como elementos de contenido, términos de taxonomía, etc...) dentro del sitio. Esto le permite, por ejemplo, incluir un enlace a un usuario dentro de un elemento de contenido. Para más información, consulte la <a href=\":er_do\">documentación online para el módulo Entity Reference</a>.','es',1),(8416,_binary 'Activar almacenamiento personalizado','es',1),(8417,_binary 'Un tipo de específico de instancia de control','es',1),(8418,_binary 'Los tipos de controles @types son usados en instancias de campo de Drupal 6: El tipo de control @selected_type ha sido aplicado al campo base de Drupal 8','es',1),(8419,_binary 'El módulo Filter permite a los administradores configurar formatos de texto. Los formatos de texto cambian serán <em>procesados y visualizados</em> en el sitio las etiquetas HTML y otros textos. Se usan para transforman texto y también ayudan a proteger su sitio web contra entradas potencialmente dañinas de usuarios maliciosos. El editores de texto visuales pueden ser asociados con formatos de texto usando el <a href=\":editor_help\">módulo Text Editor</a>. Para más información, consulte la <a href=\":filter_do\">documentación online para el módulo Filter</a>.','es',1),(8420,_binary 'Puede definir qué usuarios podrán usar cada formato de texto seleccionando sus roles. Para garantizar la seguridad, los usuarios no identificados, que no son de confianza, deberían solo tener acceso a formatos de texto y restringirlos a texto sin formato o un conjunto seguro de etiquetas HTML. Eso es debido a que las etiquetas HTML pueden permitir enlazar a sistio maliciosos o scripts en texto. Los usuarios registrados más confiable se le puede conceder permisos para usar formatos de texto menos restrictivos para crear texto más rico. <strong>La inadecuada configuración de formatos de textos es un riesgo de seguridad.</strong>','es',1),(8421,_binary 'Cada formato de texto utiliza filtros que añaden, eliminan o transforman elementos dentro del texto introducido por el usuario. Por ejemplo: un filtro elimina etiquetas HTML no aprobadas, mientras que otro transforma URLs en enlaces sobre los que se pueden hacer clic. Los filtros son aplicados en un orden específico. No cambian el contenido <em>almacenado</em>, definen como se procesan y muestran en pantalla.','es',1),(8422,_binary 'Los formatos de texto definen como se filtran el texto a la salida y como las etiquetas HTML y otros texto se muestran, reemplazar o eliminan. <strong>La inadecuada configuración de formatos de textos es un riesgo de seguridad</strong>. Para saber más, consulte la <a href=\":filter_help\">página de ayuda del módulo Filter</a>.','es',1),(8423,_binary 'Un formato de texto contiene filtros que cambian la visualización de la entrada del usuario, por ejemplo: eliminando parte HTML maliciosas o haciendo que se pueda hacer clic sobre las URLs.Los filtros son ejecutados de arriba a abajo el orden es importante, dado que un filtro puede prevenir que otro filtro cumpla con su función. Por ejemplo: cuando las URLS se convierten en enlaces antes de borrar etiquetas HTML no permitidas, todas esos enlaces se borrarán. Cuando esto pasa el orden de los filtros podría necesitar ser reordenado.','es',1),(8424,_binary 'Configura cómo se filtra el contenido cuando se muestra en pantalla, incluyendo qué etiquetas HTML se utilizan y activan filtros proporcionados por el módulo.','es',1),(8425,_binary 'Una lista de etiquetas HTML que pueden ser usados. De manera predeterminada, los atributos <em>lang</em> y <em>dir</em> están permitidos todas las etiquetas HTML. Cada etiqueta HTML puede tener atributos que han sido tratados como nombre de atributo permitidos para esa etiqueta HTML. Cada atributo puede permitir todos los valores o solo permitir algunos valores específicos. Los nombre de atributos o los valores pueden ser escritos como prefijo y comodin como <em>jump-*</em>. Los atributos de eventos Javascript, URL de Javascript y CSS siempre están restringidos.','es',1),(8426,_binary 'Sobreescribiendo las cadenas en Inglés por defecto','es',1),(8427,_binary 'Si la traducción está activada para el inglés, puede <em>sobreescribir</em> las cadenas de texto de la interfaz en inglés de manera predeterminada de su sitio con otras cadenas de texto en inglés en la página de <a href=\":translate\">Traducción de la interfaz de usuario</a>. La traducción está desactivado de manera predeterminada para el inglés, pero puede activarlo visitando la página <em>Editar idioma</em> para el inglés desde la página de <a href=\":languages\">Idiomas</a>.','es',1),(8428,_binary '<q>Autenticación</q> para usuarios anónimos','es',1),(8429,_binary 'Revertir a una revisión anterior de la traducción','es',1),(8430,_binary '@langname revisión para %title','es',1),(8431,_binary '¿Está seguro que desea revertir la traducción de @language a la revisión de %revision-date?','es',1),(8432,_binary 'Revertir contenido compartido entre traducciones','es',1),(8433,_binary 'Problema de red!','es',1),(8434,_binary '- Ninguno (imagen original) -','es',1),(8435,_binary 'Solo los objetos del índice aparecerán en los resultados de búsqueda. Para construir y mantener el índice, se requiere una <a href=\":cron\">tarea de mantenimiento de cron</a> correctamente configurada.','es',1),(8436,_binary 'El máximo número de objetos indexados en cada ejecución de la <a href=\":cron\">tarea de mantenimiento de cron</a>. Si es necesario, reduzca el número de objetos para prevenir los tiempos muertos y los errores de memoria mientras se indexe. Algunos tipos de páginas de búsqueda podrían tener sus propias opciones para esto.','es',1),(8437,_binary 'La longitud mínima de carácter para que una palabra sea añadida al índice. Las búsquedas deben incluir una palabra clave de al menos esta longitud.','es',1),(8438,_binary 'Realiza pruebas del código del núcleo del sitio y activa módulos para revisar su código.','es',1),(8439,_binary 'Configurar el registro de las estadísticas de contenido.','es',1),(8440,_binary 'Configuración de dependencias recalculada','es',1),(8441,_binary 'Verificando el estado del sitio','es',1),(8442,_binary 'El <a href=\":status\">Informe de estado</a> proporciona un resumen de la configuración, estado y salud de su sitio. compruebe este informe para asegurarse de que no hay problemas que resolver y para encontrar información sobre el software que su sitio y su servidor web están usando.','es',1),(8443,_binary 'Para que el sitio y sus módulos continuen operando con normalidad, se deben ejecutar un conjunto de rutinas de operaciones administrativas de manera regular; esas operaciones son conocidas como tareas del <em>cron</em>. En la <a href=\":cron\">página Cron</a>, puede configurar el cron para ejecutar periodicamente como parte de las respuestas del servidor instalando el módulo <em>Automated Cron</em>, o puede desactivarlo y poner en marchar el cron desde un proceso externo en su servidor web. Puede comprobar el estado de las tareas del cron visitando la a href=\":status\">página de Informe de estado</a>. Para más información, consulte la <a href=\":handbook\">documentación online para la configuración de tareas del cron</a>.','es',1),(8444,_binary 'Habilitar el módulo <em>Cron Automatizado</em> para permitir  que cron se ejecute al final de una respuesta del servidor.','es',1),(8445,_binary 'La siguiente razón no permitio que @module.module_name fuera desinstalado:Las siguientes razónes no permitieron que  @module.module_name fuera desinstalado:','es',1),(8446,_binary 'Demasiado intentos fallidos de inicio de sesión desde su dirección IP. Esta dirección IP está temporalmente bloqueada. Intentelo de nuevo más tarde o <a href=\":url\">solicite una nueva contraseña</a>.','es',1),(8447,_binary 'Ha habido más de un intento de inicio de sesión fallido para esta cuenta. La cuenta está temporalmente bloqueada. Intentelo de nuevo más tarde o <a href=\":url\">solicite una nueva contraseña</a>.Ha habido más de @count intentos de inicio de sesión fallidos para esta cuenta. La cuenta está temporalmente bloqueada. Intentelo de nuevo más tarde o <a href=\":url\">solicite una nueva contraseña</a>.','es',1),(8448,_binary '%name no es reconocido como un nombre de usuario o como una dirección de correo.','es',1),(8449,_binary 'Tiempo máximo en cache','es',1),(8450,_binary 'Creando y administrando vistas','es',1),(8451,_binary 'Activando y desactivando vistas','es',1),(8452,_binary 'Exportando e importando vistas','es',1),(8453,_binary 'Estable','es',1),(8454,_binary 'El código de idioma.','es',1),(8455,_binary 'Borrar %label','es',1),(8456,_binary 'Permite al usuario visualizar todos los objetos','es',1),(8457,_binary 'Resuelva todos los problemas enumerados a continuación para continuar la instalación. Para obtener ayuda configurando su servidor de base de datos, consulte el <a href=\"https://www.drupal.org/getting-started/install\">manual de instalación</a> o contacte con su proveedor de hosting.','es',1),(8458,_binary 'Agregador de canal RSS','es',1),(8459,_binary 'Fuentes del agregador','es',1),(8460,_binary 'Encontrar y administrar bloques personalizados.','es',1),(8461,_binary 'Comentarios recientes.','es',1),(8462,_binary 'Encontrar y administrar archivos.','es',1),(8463,_binary 'Editando idiomas','es',1),(8464,_binary 'Todo el contenido, por mes.','es',1),(8465,_binary 'Contenido reciente.','es',1),(8466,_binary 'Todo el contenido promovido a la página principal.','es',1),(8467,_binary 'Todo el contenido, alfabéticamente.','es',1),(8468,_binary 'Contenido perteneciente a un término de taxonomía determinado.','es',1),(8469,_binary 'Muestra un listado de las cuentas de usuarios más recientes en el sitio.','es',1),(8470,_binary 'Bloque de usuarios conectados','es',1),(8471,_binary 'Muestra los nombres de los usuarios de los usuarios activos más recientemente, y el número total de usuarios activos.','es',1),(8472,_binary 'Ver página de edición','es',1),(8473,_binary 'Máximo 1300x1300','es',1),(8474,_binary 'Máximo 2600x2600','es',1),(8475,_binary 'Máximo 325x325','es',1),(8476,_binary 'Máximo 650x650','es',1),(8477,_binary 'Estrecho','es',1),(8478,_binary 'Prueba de anulación de la configuración','es',1),(8479,_binary 'Vista general de archivos','es',1),(8480,_binary 'Información de uso del fichero para {{ arguments.fid }}','es',1),(8481,_binary '<p>Esta página provee la posibilidad de agregar idiomas comunes a  su sitio.</p><p>Si el idioma deseado no está disponible, puede agregar un idioma personalizado.</p>','es',1),(8482,_binary '<p>Seleccione un idioma de la lista, o seleccione \"Idioma personalizado ...\" al final de la lista.</p><p>Haga clic en el botón \"Agregar idioma\" cuando haya terminado de elegir su idioma.</p><p>Al agregar un idioma personalizado, usted obtendrá un formulario adicional donde se puede proporcionar el nombre, código y dirección del idioma.</p>','es',1),(8483,_binary 'Continuando','es',1),(8484,_binary '<p>Esta página ofrece la posibilidad de editar un idioma en su sitio, incluyendo idiomas personalizados</p>','es',1),(8485,_binary '<p>No puedes cambiar el código de un idioma en el sitio, ya que se usa en el sistema para asignar el idioma.</p>','es',1),(8486,_binary '<p>El nombre del idioma es utilizado por todo el sitio para todos los usuarios y está escrito en inglés. Los nombres de idiomas incorporados pueden ser traducidos usando el módulo Interface Translation y los nombres de idiomas tanto incorporados como personalizados pueden ser traducidos usando el módulo Configuration Translation.</p>','es',1),(8487,_binary '<p>Escoja si el idioma es un idioma de \"De izquierda a derecha\" o de \"De derecha a izquierda\".</p><p>Fijese que no todos los temas soportan diseños de \"De derecha a izquierda\", por lo que debe probarlos antes si piensa usarlos.</p>','es',1),(8488,_binary '<p>La página \"Idiomas\" le permite añadir, editar, borrar y reordenar los idiomas para el sitio.</p>','es',1),(8489,_binary '<p>Para añadir más idiomas a su sitio, haga clic en el botón \"Añadir idioma\".</p><p>Los idiomas añadidos se mostrarán en la lista de idiomas y pueden entonces ser editados o borrados.</p>','es',1),(8490,_binary 'Reordenando idiomas','es',1),(8491,_binary '<p>Para cambiar el orden de los idiomas en su sitio, utilice los iconos de selección junto a cada idioma.</p><p>El orden que se muestra aquí es el orden de presentación de las listas de idiomas en el sitio como en los bloques selectores de idiomas proporcionados por los módulos Interface Translation  y Content Translation.</p><p>Cuando haya terminado con la reordenación de los idiomas, haga clic en el botón \"Guardar configuración\" para que los cambios surtan efecto.</p>','es',1),(8492,_binary 'Establecer un idioma por defecto','es',1),(8493,_binary '<p>Se puede cambiar el idioma predeterminado del sitio por uno de los idiomas configurados por defecto. El sitio utilizará el idioma predeterminado cuando se necesite tener seleccionado un idioma pero no se haya elegido ninguno. Como por ejemplo el idioma de la interfaz mostrada.</p>','es',1),(8494,_binary 'Modificando idiomas','es',1),(8495,_binary '<p>Las operaciones son proporcionadas para editar y eliminar sus idiomas.</p><p>Puede editar el nombre y la dirección de un idioma.</p><p>Los idiomas eliminados pueden ser nuevamente añadidos en otro momento. Eliminar un idioma removerá todas las traducciones de la interfaz asociadas con él, y el contenido en este idioma será establecido como idioma neutral. Tenga en cuenta que no puede eliminar el idioma predeterminado para su sitio.</p>','es',1),(8496,_binary 'Elija el idioma que quiere traducir.','es',1),(8497,_binary 'Intruduzca la palabra u oración específica que usted desea traducir, también puede escribir solamente una parte de la palabra.','es',1),(8498,_binary 'Filtrar la búsqueda','es',1),(8499,_binary 'Puede buscar cadenas no traducidas si quiere traducir algo que todavía no está traducido. Si quiere modificar una traducción exitente, podría querer buscar solo cadenas traducidas.','es',1),(8500,_binary 'Aplicar sus criterios de búsqueda','es',1),(8501,_binary 'Para aplicar su criterio de búsqueda, haga click en el botón <em>Filtrar</em>.','es',1),(8502,_binary 'Puede escribir su propia traducción en los campos de texto en la columna de la derecha. Intente fijarse en cual contexto el texto será usado para traducirlo de la manera apropiada.','es',1),(8503,_binary 'Validar la traducción','es',1),(8504,_binary 'Cuando haya terminado sus traducciones, haga clic en el botón <em>Guardar traducciones</em>. Usted debe guardar sus traducciones, cada vez antes de cambiar de página o hacer una nueva búsqueda.','es',1),(8505,_binary '{{ arguments.created_year_month }}','es',1),(8506,_binary 'Encontrar y administrar contenido','es',1),(8507,_binary 'Bienvenido a [site:name]','es',1),(8508,_binary '{{ arguments.tid }}','es',1),(8509,_binary 'El nombre o correo electrónico contiene','es',1),(8510,_binary 'Una lista de los usuarios nuevos','es',1),(8511,_binary 'Actualmente hay @total usuarios en línea.','es',1),(8512,_binary 'Actualmente hay 0 usuarios en línea.','es',1),(8513,_binary 'Una lista de los usuarios que actualmente están logueados.','es',1),(8514,_binary 'Administrar las configuraciones de la vista','es',1),(8515,_binary 'Ver o editar la configuración.','es',1),(8516,_binary 'Mostrar en esta vista','es',1),(8517,_binary 'Una visualización es una manera de mostrar los resultados, por ejemplo, como una página o un bloque. Una vista puede contener múltiples visualizaciones, las cuales figuran en esta lista. La visualización activa está resaltada.','es',1),(8518,_binary 'Administración de Vista','es',1),(8519,_binary 'Realizar tareas administrativas, como agregar una descripción y la creación de un clon. Haga clic en el botón desplegable para ver las opciones disponibles.','es',1),(8520,_b