uficiente memoria disponible para cambiar el esquema de color de este tema. Necesita al menos %size más. Comprueba la <a href=\"http://php.net/manual/ini.core.php#ini.sect.resource-limits\">documentación de PHP</a> para más información.','es',1),(8644,_binary 'La biblioteca GD de PHP está activada pero se ha compilado sin tener en cuenta PNG. Revise el enlace <a href=\"http://php.net/manual/ref.image.php\">Documentación de imagen PHP</a> para más información para corregirlo.','es',1),(8645,_binary 'La biblioteca GD de PHP no se encuentra o está desactualizada. Revisa el enlace  <a href=\"http://php.net/manual/book.image.php\">PHP image documentation</a> para más información sobre como corrregir esto.','es',1),(8646,_binary 'Completado el paso @current de @total.','es',1),(8647,_binary 'Un formato de fecha definido por el usuario. Vea el<a href=\"http://php.net/manual/function.date.php\">Manual de PHP</a> para las opciones disponibles.','es',1),(8648,_binary 'Este sitio web tiene un solo idioma habilitado. <a href=\":language_url\"> Agregue al menos otro idioma</a> para traducir el contenido','es',1),(8649,_binary 'Describe un plazo en función de la fecha actual, como \'+90 days\' (90 días desde el día en que se crea el campo) o \'+1 Saturday\' (el próximo sábado). Ver <a href=\"http://php.net/manual/function.strtotime.php\">strtotime </a> para más detalles.','es',1),(8650,_binary 'El tipo de entrada en el registro, por ejemplo \"usuario\" o \"página no encontrada\"','es',1),(8651,_binary 'El tipo de campo %field_type_label es utilizado en el siguiente campo: @fieldsEl tipo de campo %field_type_label es utilizado en los siguientes campos: @fields','es',1),(8652,_binary 'Activado (<a href=\"http://php.net/manual/apcu.configuration.php#ini.apcu.rfc1867\">APC RFC1867</a>)','es',1),(8653,_binary 'Tipo MIME de Archivo','es',1),(8654,_binary 'APIs Hypermedia son un estilo de API Web que utiliza URIs para identificar los recursos y la <a href=\"http://wikipedia.org/wiki/Link_relation\">relación de enlaces</a> entre sí, permitiendo a los consumidores de API seguir enlaces para descubrir la funcionalidad de la API.','es',1),(8655,_binary 'Este módulo es experimental. Los <a href=\":url\">Módulos experimentales</a> se proporcionan sólo con fines de prueba. Usar bajo su riesgo.','es',1),(8656,_binary 'También se puede configurar un mínimo y/o máximo para la resolución de las imágenes cargadas. Se rechazarán las imágenes que sean demasiado pequeñas. Las imágenes de mayor tamaño se ajustarán. Durante el cambio de tamaño los <a href=\"http://wikipedia.org/wiki/Exchangeable_image_file_format\">datos EXIF</a> se perderán.','es',1),(8657,_binary 'El tamaño de imagen máximo permitido expresado como ANCHOxALTO (por ejemplo, 640×480). Dejar en blanco para ninguna restricción. Si se sube unaimagen más grande, se cambiará de tamaño para reflejar el ancho y la altura dada. Cambiar el tamaño de imágenes en la subida provocará la pérdida de los datos <a href=\"http://wikipedia.org/wiki/Exchangeable_image_file_format\">EXIF</a> de la imagen.','es',1),(8658,_binary 'El módulo Language le permite configurar los idiomas utilizados en su sitio, y proporciona información para <a href=\":content\">traducir contenido </a>, <a href=\":interface\">la interfaz de Traducción </a> y <a href=\":configuration\">Los módulos de configuración de traducciones </a>, si están habilitados. Para obtener más información, consulte la<a href=\":doc_url\">documentación en línea para el módulo Language</a>.','es',1),(8659,_binary 'Los nombres de dominio a usar en estos idiomas. <strong>Modificar este valor puede estropear URL ya existentes. Úselo con precaución en un entorno de producción</strong>. Ejemplo: Especificar \"de.example.com\" como dominio de idioma para el alemán resultará en una URL como \"http://de.example.com/contact\".','es',1),(8660,_binary 'Pares «clave - valor» para pasar en la URL por GET','es',1),(8661,_binary 'Fragmento de URL','es',1),(8662,_binary 'Esta U