talación de la extensión PHP cURL</a>.','es',1),(8956,_binary '@label (deshabilitado)','es',1),(8957,_binary 'Esta seguro que desea eliminar @entity-type %label?','es',1),(8958,_binary '@entity-type %label ha sido eliminado.','es',1),(8959,_binary 'Tipo de comentario','es',1),(8960,_binary 'tipos de comentario','es',1),(8961,_binary 'Vista previa del mensaje del remitente','es',1),(8962,_binary 'El flujo de trabajo en el cual se encuentra el estado de moderación.','es',1),(8963,_binary '@bundle @label fueron omitidas porque están bajo moderación y podrían no estar publicadas directamente.','es',1),(8964,_binary '@bundle @label fueron omitidas porque están bajo moderación y podrían no estar despublicadas directamente.','es',1),(8965,_binary 'El módulo de Disposición de Campo permite ordenar campos en las regiones de formularios y en las visualizaciones de las entidades tales como nodos y usuarios.','es',1),(8966,_binary 'Para mas información, revise la <a href=\":field-layout-documentation\">documentación en línea para el módulo de Disposición de Campo</a>.','es',1),(8967,_binary 'Disposición de Campo','es',1),(8968,_binary 'Configuración de los diseños de campo por vista','es',1),(8969,_binary 'Configuración del formateador de URL de imagen','es',1),(8970,_binary 'Arrastre el archivo aquí o haga clic para subir','es',1),(8971,_binary 'Subiendo <i>@file</i>…','es',1),(8972,_binary 'Ha ocurrido un error de servidor.','es',1),(8973,_binary 'El directorio de destino no ha podido ser creado.','es',1),(8974,_binary 'Error en la validación de la imagen.','es',1),(8975,_binary 'Layout Discovery permite a módulos o temas registrar layouts, y a otros módulos listar los layouts disponibles y renderizarlos.','es',1),(8976,_binary 'Para más información, ver la <a href=\":layout-discovery-documentation\">documentación online para el módulo Layout Discovery</a>.','es',1),(8977,_binary 'Layout Discovery no puede ser instalado porque el módulo Layout Plugin está instalado y es incompatible.','es',1),(8978,_binary 'Descubrimiento de disposición','es',1),(8979,_binary 'Debe ser una ruta interna como %add-node. También puede comenzar a escribir el título de una pieza de contenido para seleccionarla. Ingrese %front para vincular a la página frontal.','es',1),(8980,_binary 'Ha salido del modo de edición.','es',1),(8981,_binary 'Elemento de mapeo de RDF','es',1),(8982,_binary 'Elementos de mapeo RDF','es',1),(8983,_binary 'El estilo de imagen de respaldo suele ser una imagen de tamaño más pequeño de la que espera que aparezca en este espacio. Debido a que el módulo responsive images utiliza la biblioteca Picturefill para que las imágenes de respaldo puedan funcionar en navegadores antiguos, la imagen de respaldo sólo aparecerá en un sitio si se produce un error.','es',1),(8984,_binary 'Si bien tiene la opción de proporcionar sólo un estilo de imagen por punto de interrupción, la opción de tamaños le permite ofrecer más opciones a los navegadores en cuanto a qué archivo de imagen puede mostrar, incluso cuando se utilizan varios puntos de interrupción para la dirección artística. Los puntos de interrupción se definen en los archivos de configuración del tema.','es',1),(8985,_binary 'Una vez que se selecciona la opción de tamaños, puede permitir que el navegador conozca el tamaño de esta imagen en relación con el diseño del sitio utilizando el campo <em>Sizes</em>. Para imagen de un héroe, que siempre llena toda la pantalla, simplemente puedes introducir 100vw (que significa el 100% del ancho de la ventana de visualización). Para una imagen que llena el 90% de la pantalla para ventanas pequeñas, pero sólo llena el 40% de la pantalla cuando la ventana es mayor que 40em (normalmente 640px), puedes insertar \"(min-width: 40em) 40vw, 90vw\" en el campo Sizes. El último elemento de la lista separada por comas es la más pequeña de las ventanas de visualización: los otros elementos de la lista separada por comas deberían tener una condición de medio vinculada con un ancho de imagen. <em>Las condiciones multimedia</em> son similares a una media query, a menudo un ancho mínimo asociado con un ancho de ventana de visualización utilizando unidades em o px: p. (Ancho mínimo: 640 px) o (anchura min: 40em). Esto se empareja con el <em>ancho de la imagen</em> en ese tamaño de la ventana de visualización usando unidades px, em o vw. La unidad vw es el ancho de la ventana de visualización y se utiliza en lugar de un porcentaje porque el porcentaje siempre se refiere al ancho de toda la ventana gráfica.','es',1),(8986,_binary 'Estos son los proveedores de autenticación admitidos para esta vista. Cuando se solicita esta vista, el cliente se verá obligado a autenticarse con uno de los proveedores seleccionados. Asegúrese de establecer los requisitos apropiados en la sección <em>Access</em>, ya que el sistema de autenticación volverá al usuario anónimo si falla en la autenticación. Por ejemplo: require Access: Role | Usuario autenticado.','es',1),(8987,_binary 'Configuraciones de serialización','es',1),(8988,_binary 'El framework de pruebas requiere la <a href=\"https://secure.php.net/manual/en/curl.setup.php\">librería PHP cURL</a>. Para más información, ver la <a href=\"https://www.drupal.org/requirements/php/curl\">información online sobre la instalación de la extensión PHP cURL</a>.','es',1),(8989,_binary 'Se intentarón generar 10 bytes aleatorios, se generaron @count','es',1),(8990,_binary 'Drupal no puede generar números altamente aleatorios, lo que significa que ciertas funciones de seguridad como las URL de restablecimiento de contraseña no son tan seguras como deberían ser. En su lugar, sólo está disponible un generador de respaldo alternativo lento y menos seguro. La causa más probable es que las restricciones de open_basedir están en vigor y /dev/urandom no está en la lista blanca. Consulte la página <a href=\":drupal-php\">requisitos del sistema</a> para obtener más información. %exception_message','es',1),(8991,_binary 'Drupal no puede generar números altamente aleatorios, lo que significa que ciertas funciones de seguridad como las URL de restablecimiento de contraseña no son tan seguras como deberían ser. En su lugar, sólo está disponible un generador de emergencia lento y menos seguro. Consulte la página de <a href=\":drupal-php\">requisitos del sistema</a> para obtener más información. %exception_message','es',1),(8992,_binary 'Menos seguro','es',1),(8993,_binary 'Registro de cron detallado','es',1),(8994,_binary 'Los visitantes solo verán el mensaje del modo mantenimiento. Solamente los usuarios con el <a href=\":permissions-url\">permiso</a>  \"@permission-label\" estarán autorizados para acceder al sitio. Los usuarios autorizados pueden autentificarse directamente a través de la pagina de <a href=\":user-login\">inicio de sesion de usuario</a>.','es',1),(8995,_binary 'Nivel de visibilidad inicial','es',1),(8996,_binary 'El menú sólo está visible si el elemento de menú para la página actual está en este nivel o debajo de él. Utilice el nivel 1 para mostrar siempre este menú.','es',1),(8997,_binary 'Número de niveles a mostrar','es',1),(8998,_binary 'Este número máximo incluye el nivel inicial.','es',1),(8999,_binary 'Editores de texto (como CKEditor) pueden anular esta configuración.','es',1),(9000,_binary 'Argumento de base por defecto','es',1),(9001,_binary 'Filtra por nombre de vista, nombre interno del sistema, descripción, o ruta de visualización','es',1),(9002,_binary 'Introduzca una parte del nombre de la vista, nombre interno del sistema, descripción, ruta de visualización para filtrar por ella.','es',1),(9003,_binary 'El módulo Flujos de trabajo proporciona una interfaz de usuario y una API para crear contenido de flujos de trabajo. Esto permite a los administradores del sitio definir los flujos de trabajo y sus estados y, a continuación, definir las transiciones entre esos estados. Para obtener más información, consulte la <a href=\":workflow\">documentación en líne