ueden causar problemas en Windows.','es',1),(9035,_binary 'Creado el Flujo de trabajo %label.','es',1),(9036,_binary 'Aún no hay transiciones hacia o desde este estado.','es',1),(9037,_binary 'Opciones de HAL','es',1),(9038,_binary 'El módulo Migrate Drupal UI proporciona una interfaz de usuario simple para realizar una actualización desde una versión anterior de Drupal. Para más información, ver la <a href=\":migrate\">documentación online para el módulo Migrate Drupal UI</a>.','es',1),(9039,_binary 'Preparando el sitio','es',1),(9040,_binary 'Necesitas habilitar todos los módulos en este sitio que estén habilitados en el sitio anterior. Por ejemplo, si has usado el módulo Book en el sitio anterior, entonces debes habilitar el módulo Book en este sitio para que los datos estén disponibles en este sitio.','es',1),(9041,_binary 'Ejecutando la actualización','es',1),(9042,_binary 'En la página de <a href=\":upgrade\">Actualización</a>, se le guiará mediante la ejecución en varios pasos.','es',1),(9043,_binary 'Necesitas introducir las credenciales de la base de datos del sitio de Drupal que deseas actualizar. También puedes incluir su directorio de archivos en la actualización.','es',1),(9044,_binary 'Por último, se muestra un mensaje sobre el número de tareas de actualización que han tenido éxito o han fallado.','es',1),(9045,_binary 'Revisando los registros de actualización','es',1),(9046,_binary 'Puede revisar un <a href=\":log\">registro de mensajes de actualización</a> haciendo clic en el vínculo del mensaje proporcionado después de la actualización o filtrando los mensajes para el tipo <em>migrate_drupal_ui</em> en la página<a href=\":messages\">Mensajes de registro recientes</a>.','es',1),(9047,_binary 'Retroceder una actualización','es',1),(9048,_binary 'Retroceder una actualización todavía no se soporta a través de la interfaz de usuario.','es',1),(9049,_binary 'Tipos de datos serializados','es',1),(9050,_binary 'La API de serialización está configurada para 