 asociada una fuente (como la fuente de imagen) que soporta la generación de miniaturas y la extracción de metadatos. Los campos gestionados por el  <a href=\":field\">módulo Field</a> pueden incluirse para almacenar los metadatos, por ejemplo anchura y altura, así como cualquier otro valor asociado.','es',1),(9127,_binary 'El módulo Media también te permite crear múltiples versiones de cualquier elemento multimedia, y volver a versiones anteriores usando la configuración de <em>Información de revisiones.</em>','es',1),(9128,_binary 'El módulo Multimedia pone a disposición una cantidad de permisos, que se pueden establecer por rol en la <a href=\":permissions\">página de permisos</a>.','es',1),(9129,_binary 'Añadir tipo multimedia','es',1),(9130,_binary 'Gestionar tipos multimedia.','es',1),(9131,_binary 'Administrar tipos multimedia','es',1),(9132,_binary 'Actualizar multimedia propio','es',1),(9133,_binary 'Eliminar multimedia propio','es',1),(9134,_binary 'Ver todas las revisiones multimedia','es',1),(9135,_binary 'Para ver una revisión, usted también necesita permiso para ver el elemento multimedia.','es',1),(9136,_binary 'URI completa hacia una carpeta en donde los iconos de media seran instalados','es',1),(9137,_binary 'Si las descargas de miniaturas deben ponerse en cola','es',1),(9138,_binary 'Configuración de fuente multimedia','es',1),(9139,_binary 'Configuración de fuente multimedia \"Archivo\"','es',1),(9140,_binary 'Configuración de fuente multimedia \"Imagen\"','es',1),(9141,_binary 'Editar %type_label @label','es',1),(9142,_binary '@type %label ha sido creado.','es',1),(9143,_binary '@type %label ha sido actualizado.','es',1),(9144,_binary '@type: añadido %label.','es',1),(9145,_binary '@type: actualizado %label.','es',1),(9146,_binary '- Crear -','es',1),(9147,_binary 'Seleccione el campo que almacenará la información esencial sobre el elemento multimedia. Si se selecciona \"Crear\", se creará automáticamente un nuevo campo.','es',1),(9148,_binary 'E